{"movieId": "1357206", "picture": "https://p1.meituan.net/moviemachine/dfc4bf8c71ae339874fdd3ffeb3763af10793417.jpg@464w_644h_1e_1c", "name": "疯狂原始人", "name2": "The Croods", "type": [" 喜剧 ", " 动画 ", " 冒险 "], "place": "美国", "length": "98分钟", "time": "2013-04-20中国大陆上映", "description": "原始人克鲁德一家六口在老爸瓜哥（尼古拉斯·凯奇 配音）的庇护下生活。每天抢夺鸵鸟蛋为食，躲避野兽的追击，每晚听老爸叙述同一个故事，在山洞里过着一成不变的生活。大女儿小伊（艾玛·斯通  配音）是一个和老爸性格截然相反的充满好奇心的女孩，她不满足一辈子留在这个小山洞里，一心想要追逐山洞外面的世界。没想到世界末日突然降临，山洞被毁，一家人被迫流离失所。展现在他们眼前的是一个崭新绚丽却又充满危险的新世界，四处都是食人鸟兽和叫不出名字的奇怪生物。危机中，他们遇到了游牧部落族人盖（瑞恩·雷诺兹 配音），凭借他超凡的创造力和革新思想，帮助克鲁德一家一次一次躲过重重困难，渐渐取代了老爸的地位，变成克鲁德全家人的偶像，也和小伊暗生情愫。但这个来历不明的神奇男子旅行的目的究竟是神马？在末日来临时，哪里才是一家人的安居之所？就这样，顽固保守的老爸，叛逆的大女儿小伊，神奇男子盖，像小疯狗一样的baby，疯狂老太奶奶，二缺的弟弟，以及温柔的妈妈，一起踏上了寻找新家园的旅途。他们一路上与拳击猴搏斗，与食人花捉迷藏，还差点酿成了森林大火……旅途中，他们与看似凶猛实则很萌的小鳄犬 、鹦鹉虎成为了朋友，一次又一次化险为夷，途中还发明了许多“高科技”产品。一行人在影片中展开了一场闹腾而又惊险的旅程。", "director": ["https://p0.meituan.net/movie/66204cc4229721ae1d62b737711af97f30303.jpg@128w_170h_1e_1c", "柯克·德·米科"], "actors": [["https://p0.meituan.net/movie/7e25ddbc3bb76e597202d8cc218b5e0149132.jpg@128w_170h_1e_1c", "尼古拉斯·凯奇", "饰：瓜哥 Grug"], ["https://p0.meituan.net/moviemachine/6fc55f4db6d25a020c8dc8c32b231c28233038.jpg@128w_170h_1e_1c", "艾玛·斯通", "饰：小伊 Eep"], ["https://p0.meituan.net/moviemachine/8e678371445e379c7b749702154888b7184520.jpg@128w_170h_1e_1c", "瑞安·雷诺兹", "饰：盖 Guy"], ["https://p0.meituan.net/movie/7e25ddbc3bb76e597202d8cc218b5e0149132.jpg@128w_170h_1e_1c", "尼古拉斯·凯奇", "饰：瓜哥 Grug"], ["https://p0.meituan.net/moviemachine/6fc55f4db6d25a020c8dc8c32b231c28233038.jpg@128w_170h_1e_1c", "艾玛·斯通", "饰：小伊 Eep"], ["https://p0.meituan.net/moviemachine/8e678371445e379c7b749702154888b7184520.jpg@128w_170h_1e_1c", "瑞安·雷诺兹", "饰：盖 Guy"], ["https://p0.meituan.net/moviemachine/30a051c6e593def9b0f8e86bb61d1524188956.jpg@128w_170h_1e_1c", "凯瑟琳·基纳", "饰：巫嘎 Ugga"], ["https://p0.meituan.net/movie/9ec2c11ade62f0ffbfc89f270889b5c816228.jpg@128w_170h_1e_1c", "克萝丽丝·利奇曼", "饰：奶奶 Gran"], ["https://p1.meituan.net/movie/c1ca601caf26749bf56254f671a04f9a42661.jpg@128w_170h_1e_1c",