{"movieId": "1358968", "picture": "https://p0.meituan.net/movie/46a1d33a99d34f80614fce61d74af35c393839.jpg@464w_644h_1e_1c", "name": "神秘世界历险记4", "name2": "Yugo&Lala IV", "type": [" 动画 ", " 冒险 ", " 奇幻 "], "place": "中国大陆", "length": "85分钟", "time": "2018-08-03中国大陆上映", "description": "雨果和父亲大山生活在一个普通的小村庄里，但她却去过一个不为人知的神奇之地，那里就是神秘世界。一个与人类世界平行的神奇空间，普通人进入神秘世界，三天后就会变成动物。传说，是神创造了这个神奇的世界，每年会有99只动物被选到这里，并成为族民，族长是一只奇怪的动物，它叫啦啦，是雨果最好的朋友。 雨果自从记事后，就没有见过自己的妈妈。大山告诉雨果，妈妈常年在外进行科考工作。雨果非常想念妈妈，经常给她写信。一天，雨果突然发现，她写给妈妈的信并没有寄走，而是被大山藏了起来。雨果追问妈妈的下落，大山不得已说出了埋藏在心底多年的真相。原来，雨果的妈妈也曾经发现过神秘世界。 为了寻找妈妈的下落，雨果和大山再次前往神秘世界。雨果的出现，为神秘世界带来了一个充满惊喜的早晨。雨果与神秘世界中的好朋友们再次重逢，族长啦啦的法术进步神速，熊大叔暗恋上了功夫与美貌并存的原住民首领兰。好朋友们正沉浸在重逢的喜悦中，一只疯疯癫癫的企鹅出现，它说神秘世界即将毁灭，因为有一只恶龙闯入了神的领地  。", "director": ["https://p0.meituan.net/movie/9a695676556b22e2562daaede5e4c839118977.jpg@128w_170h_1e_1c", "王云飞"], "actors": [["https://p1.meituan.net/movie/8083d6e932133aa5110ff8114582ef7f39308.jpg@128w_170h_1e_1c", "阎么么", "饰：雨果"], ["https://p1.meituan.net/movie/6c7d6d4309adb167d42d5595a34f367238822.jpg@128w_170h_1e_1c", "赵一博", "饰：啦啦"], ["https://p0.meituan.net/moviemachine/ec719b0cefaadbc2098dc84b7913f85539949.jpg@128w_170h_1e_1c", "图特哈蒙", "饰：熊大叔"], ["https://p1.meituan.net/movie/8083d6e932133aa5110ff8114582ef7f39308.jpg@128w_170h_1e_1c", "阎么么", "饰：雨果"], ["https://p1.meituan.net/movie/6c7d6d4309adb167d42d5595a34f367238822.jpg@128w_170h_1e_1c", "赵一博", "饰：啦啦"], ["https://p0.meituan.net/moviemachine/ec719b0cefaadbc2098dc84b7913f85539949.jpg@128w_170h_1e_1c", "图特哈蒙", "饰：熊大叔"], ["https://p1.meituan.net/moviemachine/a8b98c822db1ed7c53cea9ef8ea0437b46072.jpg@128w_170h_1e_1c", "郭政建", "饰：狐大师"], ["https://p0.meituan.net/moviemachine/354783b327bab334c7665181cf71f7d241327.jpg@128w_170h_1e_1c", "林强", "饰：企鹅"], ["https://p0.meituan.net/movie/43d14514b56237b3ab2283e8a0dcea4e33931.jpg@128w_170h_1e_1c", "白雪岑", "饰：兰"], ["https://p0.meituan.net/movie/e56343ed7d27f44b1f61dc70b0f262cd47055.jpg@128w_170h_1e_1c", "张磊", "饰：王大山"], ["https://p0.meituan.net/moviemachine/1369a0acbb6772f5