{"movieId": "1205905", "picture": "https://p0.meituan.net/movie/dea4e96876c5d9ba1baabd22fe47000a590157.jpg@464w_644h_1e_1c", "name": "铁甲钢拳", "name2": "Real Steel", "type": [" 剧情 ", " 动作 ", " 科幻 ", " 运动 "], "place": "美国,印度", "length": "127分钟", "time": "2011-11-08中国大陆上映", "description": "在不远的未来，拳击运动已经被高科技的机器人互博取代了。人类无法亲自上场比赛，取而代之的是他们操纵机器人在赛场上厮杀。查理·肯顿（ 休·杰克曼 饰）在一场2000磅、6英尺高 的机器人拳击赛中丢掉了头衔。因为输了比赛，所以查理活的穷困潦倒。不过在此之前，查理可是世界上大名鼎鼎的、排名世界第二的拳击运动员。查理有一个十一岁的孩子，叫做马克斯，查理以前忙于拳击从来没有好好照顾过他。丢掉了头衔，失去了名誉，还一无所有的查理反而有了更多的时间和自己的儿子相处。不服输的儿子鼓动查理去废弃机器人的仓库找零件回来自己做机器人参加比赛。零件没有找到多少，但是他们去意外地发现了一个陪练机器人。这个陪练机器人被马克斯起名叫做亚当，亚当没有实战经验，只有挨打的份。一开始查理带他去打各种小型赛事筹集金钱，而亚当则被打得“满地找铁”。时间一长，马克斯发现这样不行，他让查理教亚当自己的拳击技巧。亚当倒也是个聪明的机器人，能够惟妙惟肖地模仿出查理的所有动作。后来亚当成了 常胜将军，变成了世界知名的机器人拳击手。但是亚当要证明自己还有几场 恶战在等着它。而查理也需要亚当的胜利来证明自己的价值和存在的意义。在这些比赛的过程中，查理收获的不仅仅是胜利和名誉，更重要的是查理已经和自己疏于联系的儿子马克斯建立起了坚不可摧的情感  。", "director": ["https://p1.meituan.net/movie/a43098ea7a213d2d5b54ccfbd4484c1115974.jpg@128w_170h_1e_1c", "肖恩·利维"], "actors": [["https://p0.meituan.net/movie/65d592f6786945e5b2c87ddf2c0115e3179475.jpg@128w_170h_1e_1c", "休·杰克曼", "饰：查理·肯顿 Charlie Kenton"], ["https://p1.meituan.net/movie/438da92b1d81afa81c84aadf440e7b2142354.jpg@128w_170h_1e_1c", "达科塔·高尤", "饰：马克斯 Max Kenton"], ["https://p1.meituan.net/movie/bcc403976af14f3462463e0a8b969621181233.jpg@128w_170h_1e_1c", "伊万杰琳•莉莉", "饰：Bailey Tallet"], ["https://p0.meituan.net/moviemachine/b383a292f26997402d5427b221cd5a14169216.jpg@128w_170h_1e_1c", "安东尼·麦凯", "饰：芬恩 Finn"], ["https://p0.meituan.net/movie/65d592f6786945e5b2c87ddf2c0115e3179475.jpg@128w_170h_1e_1c", "休·杰克曼", "饰：查理·肯顿 Charlie Kenton"], ["https://p1.meituan.net/movie/438da92b1d81afa81c84aadf440e7b2142354.jpg@128w_170h_1e_1c", "达科塔·高尤", "饰：马克斯 Max Kenton"], ["https://p1.meituan.net/movie/bcc403976af14f3462463e0a8b969621181233.jpg@128w_170h_1e_1c", "伊万杰琳•莉莉", "饰：Bailey Tallet"], ["https://p0.meituan.net/moviemachine/b383a292f26997402d5427b221cd5a14169216.jpg@128w_170h_1e_1c", "安东尼·麦凯", "饰：芬恩 Finn"], ["https://p0.meituan.net/movie/e50b181a1