{"movieId": "1366696", "picture": "https://p0.meituan.net/moviemachine/464ea0b89ea8265c2b18c4c3ebe5f8274585629.jpg@464w_644h_1e_1c", "name": "新愚公移山", "name2": "New Yugong moves mountains", "type": [" 动画 "], "place": "中国大陆", "length": "83分钟", "time": "2020-09-10中国大陆上映", "description": "影片通过一个少年的视角讲述了万年前的新石器时代愚公移山的故事。 傲慢的山神将王屋、太行两座大山堆在了愚公的家门口，倔强的愚公决心把大山挖掉。面对众多的质疑和巨大的困难，愚公毫不退缩，带着自己的儿子和村民坚持奋斗。在斗争中，愚公的儿子清风和山中精灵微光相互接触，相互理解，找出另外一条解决之道：把山移走。 最终，不仅为愚公的勇敢与毅力而震惊，而且被愚公儿子和山中精灵的互相理解与牺牲所感动，愚公和山神消除了彼此心中的执念与成见，“心中山消，眼前山移”，两座大山被上天移走。人类用自己的勇气、毅力与智慧，实现了与自然万物的和谐共存。", "director": ["https://p1.meituan.net/movie/d466ffe2960ed4905e2e7ffa86759b4e31683.jpg@128w_170h_1e_1c", "陈志宏"], "actors": [["https://p0.meituan.net/moviemachine/a55b11f90e5bbb11060a2afc5de03eef33098.jpg@128w_170h_1e_1c", "贾邱", null], ["https://p0.meituan.net/moviemachine/96f55a4a56d43b04624ea310e23951c337936.jpg@128w_170h_1e_1c", "周南飞", null], ["https://p0.meituan.net/moviemachine/a55b11f90e5bbb11060a2afc5de03eef33098.jpg@128w_170h_1e_1c", "贾邱", null], ["https://p0.meituan.net/moviemachine/96f55a4a56d43b04624ea310e23951c337936.jpg@128w_170h_1e_1c", "周南飞", null]]}
