{"movieId": "248700", "picture": "https://p0.meituan.net/movie/a3a5ebbb81a6999a0303ad4eea7ec996232557.jpg@464w_644h_1e_1c", "name": "南极大冒险", "name2": "Eight Below", "type": [" 剧情 ", " 冒险 "], "place": "美国", "length": "120分钟", "time": "2006-04-21中国大陆上映", "description": "为了搜寻一块坠落在南极岛上的神秘陨石，一支由三个科学家组成的探险队开始了他们的南极探险之旅。探险小组包括杰里·夏洛德（ 保罗·沃克 饰），他最好的朋友库珀（ 贾森·比格斯 饰）以及一个性格古怪的美国地质学家（ 布鲁斯·格林伍德 饰）。去南极考察探险，当然离不了在雪地上行走的特殊工具——雪橇，以及人们的忠实伙伴，雪橇犬。并且，这八条“精明能干”的雪橇犬都像他们的人类同伴一样，都各自拥有自己的头衔和称号：领头的“玛雅”、忠实的“矮子”、老实“老杰克”、力气大的“杜鲁门”以及奔跑速度极快的“影子”等等。初登南极这块雪白冰雪覆盖的土地，探险队员们都被眼前美丽的景色所吸引，然而他们却丝毫没有预想到，随着对极地的慢慢深入，更加恶劣的天气以及极为凶险的自然环境将带给他们越来越多的麻烦，甚至是对生存的极大挑战。在乘着狗拉雪橇前进几日之后的他们遭遇了一场空前的暴风雪，温度自然也是急剧下降。队员们自然是对眼前的状况有些准备不足。其间一名队员不慎踩破了薄冰，掉进了刺骨的冰水当中，还好有勇敢的雪橇犬相助，及时地将绳索送到落水队员手中，令队友将其拉出险境。然而，眼前这场突如其来的猛烈的暴风雪却真的无法躲避了。阻断了他们的前进之路不说，几个人的生命也收到严重的威胁。无奈之下，眼看风雪势越来越凶猛的队员们只能被迫放弃一路上帮助他们的伙伴——雪橇狗，让其各自逃命去吧。被抛弃的雪橇狗们拼命脱绳索以从雪崩中逃生，为了生存下去，它们挣扎着互相依靠，共同抵御严寒积雪的同时，还要为了填饱肚子与身形庞大的海豹搏斗。此时的八条雪橇犬就像生死一线的好兄弟一般，相互支持着。探险队的一行三人终于安全返回了基地，但冰雪中雪橇狗们拼命前行的景象却一直缠绕着他们。终于抵不过良心的谴责，三个人同时决定，无论冒着怎样的危险，都要将他们忠诚的伙伴们拯救出冰雪严寒  。", "director": ["https://p0.meituan.net/movie/569dda4a0d93ee0b80516598d57c149925862.jpg@128w_170h_1e_1c", "弗兰克·马歇尔"], "actors": [["https://p1.meituan.net/movie/dee8cb75b5fecaacfbdf60dcc1f9d6b632677.jpg@128w_170h_1e_1c", "保罗·沃克", "饰：杰里 Jerry Shepherd"], ["https://p1.meituan.net/movie/d15d21f0fc3fb9116d5db29240abd95c41718.jpg@128w_170h_1e_1c", "布鲁斯.格林伍德", "饰：戴维·斯麦克拉伦 Davis McClaren"], ["https://p0.meituan.net/movie/0eac1e61a4e8ebfb501c65242c2999ea43824.jpg@128w_170h_1e_1c", "贾森·比格斯", "饰：查利·库珀 Charlie Cooper"], ["https://p1.meituan.net/movie/258b185541e7ab8f8dbc7298aabbf7d434581.jpg@128w_170h_1e_1c", "穆恩·布拉得古德", "饰：凯蒂 Katie"], ["https://p1.meituan.net/movie/dee8cb75b5fecaacfbdf60dcc1f9d6b632677.jpg@128w_170h_1e_1c", "保罗·沃克", "饰：杰里 Jerry Shepherd"], ["https://p1.meituan.net/movie/d15d21f0fc3fb9116d5db29240abd95c41718.jpg@128w_170h_1e_1c", "布鲁斯.格林伍德", "饰：戴维·斯麦克拉伦 Davis McClaren"], ["https://p0.meituan.net/movie/0eac1e61a4e8ebfb501c65242c2999ea43824.jpg@128w