{"movieId": "1257417", "picture": "https://p1.meituan.net/movie/5bf4549bbde3462252a5e268eb8e45c841679.jpg@464w_644h_1e_1c", "name": "灌篮高手 剧场版4", "name2": "スラムダンク 吠えろバスケットマン魂!! 花道と流川の熱き夏", "type": [" 剧情 ", " 动画 ", " 运动 "], "place": "日本", "length": "40分钟", "time": "1995-07-15日本上映", "description": "正值炎炎夏日，地处海滨的湘北也被全国大赛的热情所点燃。与海南的艰苦鏖战，让曾经不甚起眼的湘北高中篮球部一战成名。在众多现场观众中，流川枫在富丘中学的学弟水泽一郎也见证了这激动人心的一刻。自从流川毕业后，水泽已经成为富中的顶梁柱，他不断磨练自己的球技，期待早日考入湘北和前辈流川一同称霸全国。而就在此刻，水泽遭遇人生最大的打击。他被诊断患上关节结核，剧烈的疼痛让他面临放弃篮球的命运。为了让水泽毫无遗憾的离开球场，走上手术台，他的姐姐茜找到晴子，希望能安排弟弟和流川共同打一场练习赛以了心愿…… 本片根据井上雄彦的同名漫画改编，为该动画的第四部剧场版。", "director": ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "明比正行"], "actors": [["https://p1.meituan.net/movie/6837de4355f730f2539d693df10d2e6929065.jpg@128w_170h_1e_1c", "草尾毅", null], ["https://p1.meituan.net/movie/3fafc41ac47b12c5b967bf3dcaca66e78230.jpg@128w_170h_1e_1c", "平松晶子", null], ["https://p0.meituan.net/movie/2ab7277b4f592e5f60af60df6eb8f4054857.jpg@128w_170h_1e_1c", "梁田清之", null], ["https://p0.meituan.net/movie/91c36830e4eeb403d9afa50a23dabf5214646.jpg@128w_170h_1e_1c", "里内信夫", "饰：角田悟"], ["https://p1.meituan.net/movie/6837de4355f730f2539d693df10d2e6929065.jpg@128w_170h_1e_1c", "草尾毅", null], ["https://p1.meituan.net/movie/3fafc41ac47b12c5b967bf3dcaca66e78230.jpg@128w_170h_1e_1c", "平松晶子", null], ["https://p0.meituan.net/movie/2ab7277b4f592e5f60af60df6eb8f4054857.jpg@128w_170h_1e_1c", "梁田清之", null], ["https://p0.meituan.net/movie/91c36830e4eeb403d9afa50a23dabf5214646.jpg@128w_170h_1e_1c", "里内信夫", "饰：角田悟"]]}
