{"movieId": "1182552", "picture": "https://p1.meituan.net/movie/f221fda9804c9cd0871cc087fec42033398562.jpg@464w_644h_1e_1c", "name": "大白鲨", "name2": "Jaws", "type": [" 剧情 ", " 惊悚 ", " 冒险 "], "place": "美国", "length": "124分钟", "time": "1975-06-20多平台上线", "description": "艾米蒂岛是一个旅游度假胜地，有大批的游客来这里游泳。然而，大白鲨的出现却改变了这一切。事故从一对情侣开始，他们下海游泳，女的不幸成为了第一个牺牲者，支离破碎的尸体令人惨不忍睹。当地官员却不愿意封场调查，他们怕影响旅游收入，于是请来了生物学家布朗（理查德·德莱福斯 饰）。布朗断定，这是一只非比寻常的巨大白鲨。他的提醒并没有引起当局的足够重视，紧接着又有人死于非命，事态才变得越发严重。当地一个熟练捕鱼手、警察和布朗一共三人，决心要捕杀大白鲨，凶险重重的搏斗开始了，谁才是最后的胜者？要获得这场战斗的胜利，又要付出怎样的代价？", "director": ["https://p1.meituan.net/movie/bacad05d68f523f761822ab3cdb4c05657519.jpg@128w_170h_1e_1c", "史蒂文·斯皮尔伯格"], "actors": [["https://p0.meituan.net/movie/73392d3a5279650ea1872fcae770d70028057.jpg@128w_170h_1e_1c", "罗伊·施奈德", "饰：警察局长马丁·布罗迪 Police Chief Martin Brody"], ["https://p0.meituan.net/movie/b0495702994fbacb3b6038baf259a81630394.jpg@128w_170h_1e_1c", "罗伯特·肖", "饰：昆特 Quint"], ["https://p0.meituan.net/movie/23497e6d7d488620fcd81f38ab23126739700.jpg@128w_170h_1e_1c", "理查德·德莱福斯", "饰：马特 Matt Hooper"], ["https://p1.meituan.net/movie/bacad05d68f523f761822ab3cdb4c05657519.jpg@128w_170h_1e_1c", "史蒂文·斯皮尔伯格", "饰：爱德 Amity Point Lifestation Worker  (uncredited)"], ["https://p0.meituan.net/movie/73392d3a5279650ea1872fcae770d70028057.jpg@128w_170h_1e_1c", "罗伊·施奈德", "饰：警察局长马丁·布罗迪 Police Chief Martin Brody"], ["https://p0.meituan.net/movie/b0495702994fbacb3b6038baf259a81630394.jpg@128w_170h_1e_1c", "罗伯特·肖", "饰：昆特 Quint"], ["https://p0.meituan.net/movie/23497e6d7d488620fcd81f38ab23126739700.jpg@128w_170h_1e_1c", "理查德·德莱福斯", "饰：马特 Matt Hooper"], ["https://p1.meituan.net/movie/bacad05d68f523f761822ab3cdb4c05657519.jpg@128w_170h_1e_1c", "史蒂文·斯皮尔伯格", "饰：爱德 Amity Point Lifestation Worker  (uncredited)"], ["https://p1.meituan.net/movie/61e9fd020f923fd375ee7615ca9a304f40173.jpg@128w_170h_1e_1c", "莫瑞·汉密尔顿", "饰：市长拉里·沃恩 Mayor Larry Vaughn"], ["https://p1.meituan.net/movie/7373a3a03ac01fe63b14926b5518dc7f12074.jpg@128w_170h_1e_1c", "卡尔·哥特列布", "饰：本 Ben Meadows"], 