{"movieId": "1243239", "picture": "https://p0.meituan.net/movie/b3309d6acd229cc5292ac179321a03a52466374.jpg@464w_644h_1e_1c", "name": "森林战士", "name2": "Epic", "type": [" 动画 ", " 冒险 ", " 奇幻 "], "place": "美国", "length": "102分钟", "time": "2013-11-29中国大陆上映", "description": "玛丽·凯瑟琳是一个天真的小姑娘，在一次长久的别离后，她去树林里看望自己的父亲博玛教授。博玛教授是一个研究树林里奇怪微小生物的专家，就住在树林的附近，陪着他的是他的斗牛犬奥兹。博玛教授研究的是一种被当做卫兵来使用的生物，它们守护的是自己的家园，并且时时刻刻都在提防着敌人的入侵。 　　博玛的研究入了迷，他走入了森林之中，设置了录像机，监视着树林中的细小的细节。因为受不了自己父亲如此着迷的研究，凯瑟琳给父亲留了一个便条就准备离去。但是在离开的路上，发生了意外--她被神迷的力量召唤，变成了父亲研究的细小的生物，进入了那个她认为并不存在的世界。这个世界，是一个正义的、绿色的世界，这里面的人在保卫着森林的和谐，对抗着黑暗力量对森林的破坏。 　　在这个神秘世界里，凯瑟琳见到了会说话的鼻涕虫、保护森林的树叶人、蒲公英仙子、森林女王等等人物。为了这个绿色世界的命运、为了保护人类的生态环境不受破坏，同样也为了自己能回到人类社会中，凯瑟琳顺应着自己的命运，从一个柔弱的女孩慢慢成长成为了一个骁勇善战的女战士  。", "director": ["https://p1.meituan.net/movie/9e3da2cb92bbee3a3b470634561fc43c36490.jpg@128w_170h_1e_1c", "克里斯·韦奇"], "actors": [["https://p1.meituan.net/movie/f93df3677a2d0470e152edd9be8d36f7181856.jpg@128w_170h_1e_1c", "阿曼达·塞弗里德", "饰：玛莉·凯瑟琳 Mary Katherine"], ["https://p1.meituan.net/movie/8850b10ea0559b1a08ddb76fa291fa7413461.jpg@128w_170h_1e_1c", "乔什·哈切森", "饰：纳德 Nod"], ["https://p1.meituan.net/movie/960bf8612b6e9f102a99f3cda355d28c56173.jpg@128w_170h_1e_1c", "碧昂丝·诺尔斯", "饰：泰拉皇后 Queen Tara"], ["https://p0.meituan.net/movie/a6f9957801c479eab4e3795b6a80b85e47160.jpg@128w_170h_1e_1c", "科林·法瑞尔", "饰：罗尼 Ronin"], ["https://p1.meituan.net/movie/f93df3677a2d0470e152edd9be8d36f7181856.jpg@128w_170h_1e_1c", "阿曼达·塞弗里德", "饰：玛莉·凯瑟琳 Mary Katherine"], ["https://p1.meituan.net/movie/8850b10ea0559b1a08ddb76fa291fa7413461.jpg@128w_170h_1e_1c", "乔什·哈切森", "饰：纳德 Nod"], ["https://p1.meituan.net/movie/960bf8612b6e9f102a99f3cda355d28c56173.jpg@128w_170h_1e_1c", "碧昂丝·诺尔斯", "饰：泰拉皇后 Queen Tara"], ["https://p0.meituan.net/movie/a6f9957801c479eab4e3795b6a80b85e47160.jpg@128w_170h_1e_1c", "科林·法瑞尔", "饰：罗尼 Ronin"], ["https://p0.meituan.net/moviemachine/b64edda264e8182b2312d60b84c6aaeb293391.jpg@128w_170h_1e_1c", "杰森·苏戴奇斯", "饰：邦巴 Bomba"], ["https://p0.meituan.net/movie/25acf2f961dabe835cb8d3