{"movieId": "1200", "picture": "https://p1.meituan.net/movie/3de5b2a8708690c03714e48c2005f331449999.jpg@464w_644h_1e_1c", "name": "他是龙", "name2": "Он - дракон", "type": [" 爱情 ", " 冒险 ", " 奇幻 "], "place": "俄罗斯", "length": "107分钟", "time": "2016-08-19中国大陆上映", "description": "在那个久远的时代，人类的村落总受龙族侵袭，由于龙族没有“雌性”，于是每年要生育的季节，恶龙就会前往人族村落强掳人类少女。人族为了免受恶龙的侵害，每年挑选几位最美貌的少女作为祭品，高唱“龙之歌”召唤恶龙。然而某次挑选的几位少女中，有一位姑娘的情人因不舍爱人离去，上山将恶龙打死，人族以为世间再无恶龙，封此人为“龙斗士”，从此过上了一段相安无事的生活。几十年后，“龙斗士”所在城镇公爵的小女儿米拉 （玛利亚·波兹哈娃饰）要出嫁，在结婚典礼上众人早已习惯了没有恶龙侵扰的生活，为表喜悦重新唱起了“龙之歌”，孰料当年已死的恶龙居然还有一个后裔阿尔曼 （马特维·雷科夫饰），“龙之歌”将刚成年的小龙召唤而来强行将米拉掳走，然后从此开始了一段人与龙的跨种族爱恋，米拉一边努力在荒岛上活下去，一边试图唤醒龙的人性，而另一边爱上龙的米拉终于明白，爱能战胜恐惧，跨越种族冲破禁忌，人与龙过上了幸福的生活  。", "director": ["https://p1.meituan.net/movie/e26ca1371b4c56c5b9f5fbc319efdfcb51506.jpg@128w_170h_1e_1c", "因达尔·詹杜巴耶夫"], "actors": [["https://p1.meituan.net/movie/824f4a0e65f21a0933df0cc47fad5c3731011.jpg@128w_170h_1e_1c", "马特维·雷科夫", "饰：阿尔曼 Arman"], ["https://p1.meituan.net/movie/1d1c42e693a971f4ba8c75a75cc4c01052950.jpg@128w_170h_1e_1c", "玛利亚·波叶扎耶娃", "饰：米拉 Miroslava"], ["https://p0.meituan.net/movie/ff1e9efd142f360cd260e80e886b4b1f9404.jpg@128w_170h_1e_1c", "列娃·安德烈瓦伊达", "饰：Yaroslava (as Ieva Andreevayte)"], ["https://p1.meituan.net/movie/c81086019c4e2a4157e78254c944712265084.jpg@128w_170h_1e_1c", "阿莲娜·契诃娃", "饰：Nevesta"], ["https://p1.meituan.net/movie/824f4a0e65f21a0933df0cc47fad5c3731011.jpg@128w_170h_1e_1c", "马特维·雷科夫", "饰：阿尔曼 Arman"], ["https://p1.meituan.net/movie/1d1c42e693a971f4ba8c75a75cc4c01052950.jpg@128w_170h_1e_1c", "玛利亚·波叶扎耶娃", "饰：米拉 Miroslava"], ["https://p0.meituan.net/movie/ff1e9efd142f360cd260e80e886b4b1f9404.jpg@128w_170h_1e_1c", "列娃·安德烈瓦伊达", "饰：Yaroslava (as Ieva Andreevayte)"], ["https://p1.meituan.net/movie/c81086019c4e2a4157e78254c944712265084.jpg@128w_170h_1e_1c", "阿莲娜·契诃娃", "饰：Nevesta"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "AnastasiyaDubrovina", "饰：Nevesta"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6