{"movieId": "42964", "picture": "https://p1.meituan.net/movie/3666295a75c2c014f222af74815180e8435203.jpg@464w_644h_1e_1c", "name": "昆虫总动员", "name2": "Minuscule: la Vallée des Fourmis Perdues", "type": [" 动画 ", " 冒险 "], "place": "法国,比利时", "length": "89分钟", "time": "2014-08-22中国大陆上映", "description": "在一片宁静的丛林里，在人类的行迹之下，掩藏着一个生机勃勃、热闹非凡的昆虫世界。一只瓢虫遭遇丛林各色虫类追赶，又闯入红黑蚂蚁的战争现场，亲身见证一场昆虫界的“特洛伊攻城”。影片想象力天马行空，不断抛出新的昆虫物种及各色设计感丰富的道具，在银幕上走马观花，笨拙的蜘蛛、卖萌的瓢虫、精明的蚂蚁，轮番登场，教人目不暇接。整部影片没有对白，以3D形式呈现出昆虫王国的微观世界，动画与实景拍摄结合，创造与好莱坞动画趣味大有不同的法式动画大片。", "director": ["https://p1.meituan.net/movie/c77b00161e3d88ad1cce35671e76ec8e44522.jpg@128w_170h_1e_1c", "海琳·吉罗"], "actors": []}
