{"movieId": "342068", "picture": "https://p0.meituan.net/movie/ea8cd597e64d4e8bbac51ea509d45bc0680772.jpg@464w_644h_1e_1c", "name": "画壁", "name2": "Mural", "type": [" 剧情 ", " 动作 ", " 爱情 ", " 奇幻 "], "place": "中国大陆,中国香港", "length": "122分钟", "time": "2011-09-29中国大陆上映", "description": "书生朱孝廉 （ 邓超 饰）与书僮后夏 （ 包贝尔 饰）在赴京赶考途中，遇上山贼孟龙潭 （ 邹兆龙 饰）大打出手，最终到了一座古寺，经由不动和尚 （ 曾志伟 饰）劝说，三人和解。而朱孝廉在古寺里发现了一幅壁画，画中人宛若鲜活灵动。在凝望之时，朱孝廉被一个从壁画出来的 仙女牡丹 （ 郑爽 饰）带进了画中的仙 境－－万花林。万花林里没有男人，生活着一群美丽的仙女，她们虽然各怀绝技，却受制于仙境统领“姑姑” （ 闫妮 饰）的强权之下。在奇异的女儿国仙境之中，众多仙女在姑姑的管理下，过着单纯而顺服的生活，姑姑惟独不许她们与男人产生感情，而且对私自闯进万花林的男人也绝不手软。在仙境里，朱孝廉认识了继承者仙女芍药 （ 孙俪 饰），在芍药的帮助下，朱孝廉躲过被姑姑发现的危险，顺利的返回人间。牡丹却被姑姑发现男人是她带进来的。其后朱孝廉回到原来的世界，发现壁画上的牡丹被处罚受苦，书僮告知壁画是一幅地狱图。朱孝廉出于义气打算重返“画壁”世界，于是在不动和尚的帮助下，朱孝廉连同后夏与孟龙潭进入仙境。不料姑姑却一反常态，款待三位来宾，并让他们从众多仙女中挑选妻子，为万花林 传宗接代。朱孝廉为不使姑姑怀疑，也假意挑选了仙女牡丹的朋友翠竹 （ 谢楠 饰）为妻子，后夏和孟龙潭也各自挑选了他们心满意足的妻子，却不知道姑姑打算利用几个男人后把他们杀光。朱孝廉得悉牡丹已被姑姑收押后，尝试取得芍药的帮助来营救，展开了一连串的奇幻冒险旅程。", "director": ["https://p0.meituan.net/movie/638bcc68f94dc37478a1b2fdee45678761995.jpg@128w_170h_1e_1c", "陈嘉上"], "actors": [["https://p0.meituan.net/moviemachine/9b613223f8f8369596fc28d11c4fd336150028.jpg@128w_170h_1e_1c", "邓超", "饰：朱孝廉"], ["https://p0.meituan.net/movie/d168bc00fdff843cd59ab8094f7d295740001.jpg@128w_170h_1e_1c", "孙俪", "饰：芍药"], ["https://p1.meituan.net/movie/c6f56b1f058373f25817be00d9b2597237984.jpg@128w_170h_1e_1c", "闫妮", "饰：姑姑"], ["https://p0.meituan.net/moviemachine/9458effc2d3928fe424e17a29207b133172316.jpg@128w_170h_1e_1c", "邹兆龙", "饰：孟龙潭"], ["https://p0.meituan.net/moviemachine/9b613223f8f8369596fc28d11c4fd336150028.jpg@128w_170h_1e_1c", "邓超", "饰：朱孝廉"], ["https://p0.meituan.net/movie/d168bc00fdff843cd59ab8094f7d295740001.jpg@128w_170h_1e_1c", "孙俪", "饰：芍药"], ["https://p1.meituan.net/movie/c6f56b1f058373f25817be00d9b2597237984.jpg@128w_170h_1e_1c", "闫妮", "饰：姑姑"], ["https://p0.meituan.net/moviemachine/9458effc2d3928fe424e17a29207b133172316.jpg@128w_170h_1e_1c", "邹兆龙", "饰：孟龙潭"], ["https://p0.meituan.net/movie/a1da8be065739b7359a4ddaa3167d9fe56154.jpg@128w_170h_1e_1c", "郑爽",