{"movieId": "1279731", "picture": "https://p0.meituan.net/movie/d661b97eb4423aad319be07b31fda852428765.jpg@464w_644h_1e_1c", "name": "麦兜故事", "name2": "My Life as McDull", "type": [" 剧情 ", " 喜剧 ", " 动画 "], "place": "中国香港", "length": "75分钟", "time": "2001-12-15多平台上线", "description": "麦兜是一只单纯乐观的小猪，他有一个单亲妈妈： 麦太。在麦兜出生前，麦太躺在产床上看到一只橘红色的塑料脸盆从天而降，脸盆无端端飘来总有原由，妈妈麦太单纯地想到“好运临盆”的话，并许下愿望：“保佑我的孩子像周润发、梁朝伟……”麦太把所有希望和梦想都寄托在了未出生的孩子身上。然而等小猪麦兜呱呱落地，他并没有成为发哥和华仔，却始终是个资质平平且机灵不足，憨厚有余的小人物。从小就是草根阶层出身的他也幻想自己的命运能有所转机，生活能过得更精彩。因此麦兜的梦想很多，其中得奥运会金牌和去马尔代夫旅游是他最大的梦想。想做奥运冠军是受了香港帆船运动员李丽珊获得奥运金牌的感召，为此他还亲赴长洲拜师学习帆船技术，结果却学会了失传多年的“抢包山”，这一乡土特种运动的过时绝技完全不合时宜。想去马尔代夫旅游，妈妈却只能带他去香港附近的山头看看。尽管这样，麦兜仍旧觉得很快乐。凭借着近乎愚蠢的执着和善良，麦兜在希望、失望的交替更迭之中，努力创造着自己美好的生活。", "director": ["https://p0.meituan.net/movie/7f73c89f65594e16fb128049ca963a6c32688.jpg@128w_170h_1e_1c", "袁建滔"], "actors": [["https://p0.meituan.net/movie/8b287d45c503de07dabeb3bd6b049bf436976.jpg@128w_170h_1e_1c", "林海峰", "饰：成年麦兜"], ["https://p0.meituan.net/movie/bd462eb563c7c4e5605001c3e6b13ddd38902.jpg@128w_170h_1e_1c", "吴君如", "饰：麦太"], ["https://p1.meituan.net/movie/e837fd543f351bb7c2139750aa81d3b941386.jpg@128w_170h_1e_1c", "黄秋生", "饰：校长黎根茶餐厅老板"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "李晋纬", "饰：童年麦兜"], ["https://p0.meituan.net/movie/8b287d45c503de07dabeb3bd6b049bf436976.jpg@128w_170h_1e_1c", "林海峰", "饰：成年麦兜"], ["https://p0.meituan.net/movie/bd462eb563c7c4e5605001c3e6b13ddd38902.jpg@128w_170h_1e_1c", "吴君如", "饰：麦太"], ["https://p1.meituan.net/movie/e837fd543f351bb7c2139750aa81d3b941386.jpg@128w_170h_1e_1c", "黄秋生", "饰：校长黎根茶餐厅老板"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "李晋纬", "饰：童年麦兜"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "甘耀明", "饰：成年麦兜（真人）"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "余绍琪", "饰：旁白"], ["https://p1.meituan.net/movie/1af9266857334b5