{"movieId": "1174518", "picture": "https://p0.meituan.net/movie/f7264edc34f454f8151eaa8a4cf647bd773285.jpg@464w_644h_1e_1c", "name": "阿拉姜色", "name2": "Ala Changso", "type": [" 剧情 "], "place": "中国大陆", "length": "109分钟", "time": "2018-10-26中国大陆上映", "description": "“阿拉姜色”为藏语音译，是一首藏族民歌，意思为“请您干了这杯美酒”。妻子俄玛 （ 尼玛颂宋 饰 ）执意要去拉萨朝圣，却向丈夫罗尔基 （ 容中尔甲 饰）隐瞒了自己身患绝症的实情。罗尔基知晓后劝其就治却遭拒绝，只能下决心陪她前行，然而同行的俄玛与前夫所生之子诺尔吾 （赛却加饰）却对两人一直心存芥蒂。俄玛半路病发，罗尔基这才知道她此行是为了完成对前夫的承诺。俄玛去世，心情复杂的罗尔基决心带着诺尔吾，继续俄玛未完的行程  。", "director": ["https://p0.meituan.net/movie/2aa91248c523001da195f2e12226f69344445.jpg@128w_170h_1e_1c", "松太加"], "actors": [["https://p0.meituan.net/movie/d2ec48d1aea75b893f7e21c75388daff33779.jpg@128w_170h_1e_1c", "容中尔甲", "饰：罗尔基"], ["https://p0.meituan.net/movie/82eb51f00071789cba806bc9daa5a6f257226.jpg@128w_170h_1e_1c", "尼玛颂宋", "饰：俄玛"], ["https://p0.meituan.net/movie/90e9383e4d5c08b401fe4f8de1e3d01f50171.jpg@128w_170h_1e_1c", "赛却加", "饰：诺尔吾"], ["https://p1.meituan.net/movie/f10406fde5d1a4b4187529cef76037af30958.jpg@128w_170h_1e_1c", "廖希", "饰：肿瘤科医生"], ["https://p0.meituan.net/movie/d2ec48d1aea75b893f7e21c75388daff33779.jpg@128w_170h_1e_1c", "容中尔甲", "饰：罗尔基"], ["https://p0.meituan.net/movie/82eb51f00071789cba806bc9daa5a6f257226.jpg@128w_170h_1e_1c", "尼玛颂宋", "饰：俄玛"], ["https://p0.meituan.net/movie/90e9383e4d5c08b401fe4f8de1e3d01f50171.jpg@128w_170h_1e_1c", "赛却加", "饰：诺尔吾"], ["https://p1.meituan.net/movie/f10406fde5d1a4b4187529cef76037af30958.jpg@128w_170h_1e_1c", "廖希", "饰：肿瘤科医生"], ["https://p0.meituan.net/moviemachine/fa4894edf3f47259bee4a85d7131e90b199719.jpg@128w_170h_1e_1c", "金巴", null], ["https://p1.meituan.net/movie/dafd46f62ca5d579194f21cae8c6c41e121672.jpg@128w_170h_1e_1c", "格日才旦", null]]}
