{"movieId": "414997", "picture": "https://p0.meituan.net/movie/0ecea01ab23014b727f035f6f0d3bab172918.jpg@464w_644h_1e_1c", "name": "守边人", "name2": "The Frontier Wairriors", "type": [" 剧情 "], "place": "中国大陆", "length": "90分钟", "time": "2017-10-17中国大陆上映", "description": "魏大有在退役戍边前找对象。24岁的魏大有 （ 刘佩琦 饰）隔着桌子与相亲女子端坐。小魏相中了刘小好 （ 刘园园 饰），正是她，陪他远赴新疆，住地窨子，骑马巡逻，为执行任务两次流产，随他白头偕老在边地。其次是161团兵二连的解散。上级为了照顾这个团队多年的辛苦，将其改为优裕的地方编制，而大魏不想进城“享福”，找到团部力争留守边关。诉求得到上级的批准，大魏戍边的决心更加坚决，即使后来小女儿为了上学，寄宿在县里兰芝家，受委屈、想父母，也丝毫没动摇护边的决心。后来，老魏到了退休年龄，长大的女儿多次要接他进城养老，可老魏不愿意，他让老伴去了，自己一个人继续守着老屋，升国旗，喂鸡放羊，巡逻在已设围栏、立界碑的边防线上，这一守便是50余年。", "director": ["https://p1.meituan.net/movie/bcf7be5243473b43c7db06afe15765e531123.jpg@128w_170h_1e_1c", "方军亮"], "actors": [["https://p1.meituan.net/moviemachine/821a8c50ca8fa751434ab11640f05ed2130056.jpg@128w_170h_1e_1c", "刘佩琦", "饰：魏大有"], ["https://p0.meituan.net/movie/3845157199da66e9b1a57ca0bb783e2111440.jpg@128w_170h_1e_1c", "刘园园", "饰：刘小好"], ["https://p0.meituan.net/moviemachine/d840b020c30a5c0882a78b4f2f13c83c12765.jpg@128w_170h_1e_1c", "吴楠", "饰：郑学军"], ["https://p0.meituan.net/moviemachine/d57532eea98f9faa9d1aaf52fdcc510545904.jpg@128w_170h_1e_1c", "蒋君燕", "饰：魏宝贝"], ["https://p1.meituan.net/moviemachine/821a8c50ca8fa751434ab11640f05ed2130056.jpg@128w_170h_1e_1c", "刘佩琦", "饰：魏大有"], ["https://p0.meituan.net/movie/3845157199da66e9b1a57ca0bb783e2111440.jpg@128w_170h_1e_1c", "刘园园", "饰：刘小好"], ["https://p0.meituan.net/moviemachine/d840b020c30a5c0882a78b4f2f13c83c12765.jpg@128w_170h_1e_1c", "吴楠", "饰：郑学军"], ["https://p0.meituan.net/moviemachine/d57532eea98f9faa9d1aaf52fdcc510545904.jpg@128w_170h_1e_1c", "蒋君燕", "饰：魏宝贝"], ["https://p0.meituan.net/movie/cceb0f23eb88b99faabd1822a80473aa32927.jpg@128w_170h_1e_1c", "李悦铭", "饰：小贵"]]}
{"movieId": "162", "picture": "https://p0.meituan.net/movie/b3584123d64591866c3282760ef7d887353498.jpg@464w_644h_1e_1c", "name": "间谍同盟", "name2": "Allied", "type": [" 爱情 ", " 动作 ", " 战争 "], "place": "美国", "length": "124分钟", "time": "2016-11-30中国大陆上映", "description": "影片讲述了二战期间盟军特工麦克斯与法国间谍玛丽安伪装成夫妻刺杀德国大使的谍战故事。1942年，卡萨布兰卡，盟军反情报特工麦克斯·瓦坦（布拉德·皮特 饰）拿取了在法国维希政府卧底玛丽安·博塞茹尔（玛丽昂·歌迪亚 饰）的法国抵抗运动间谍丈夫的身份。睿智果敢的麦克斯无意间发现了玛丽安在伦敦的秘密，而突然浮出水面的过往经历让这对假戏真做的恋人逐渐心生间隙。深入敌阵的两人在顺利执行一个艰巨危险的北非任务之后，坠入爱河并结为眷侣，婚后的两人开始了一段祥和安稳的生活，未曾想在伦敦团聚重逢的两人陷入了一场始料未及的间谍谜案。惊觉妻子极有可能是纳粹间谍的麦克斯，为找出爱人的真正身份的他开始暗中隐秘调查为他生下女儿的枕边人的一举一动。然而随着战情局势陷入白热化阶段，一段浪漫情缘在乱世战火之中面临前所未有的严峻考验……", "director": ["https://p1.meituan.net/movie/28c2c17c2958b1efe174ffe7702b299646881.jpg@128w_170h_1e_1c", "罗伯特·泽米吉斯"], "actors": [["https://p0.meituan.net/moviemachine/3e523c730e278d0fe8cbf519a361376d189135.jpg@128w_170h_1e_1c", "布拉德·皮特", "饰：Max Vatan"], ["https://p1.meituan.net/moviemachine/08297ad13989d0c7963ae8b4d558b4af45187.jpg@128w_170h_1e_1c", "玛丽昂·歌迪亚", "饰：Marianne Beausejour"], ["https://p0.meituan.net/moviemachine/d6d43efdd680d9b2c25f2e4cf8d3121a40391.jpg@128w_170h_1e_1c", "马修·古迪", "饰：\nGuy Sangster"], ["https://p0.meituan.net/movie/284eef0e25f127827922508b6fb0c3d2157700.jpg@128w_170h_1e_1c", "杰瑞德·哈里斯", "饰：\nFrank Heslop"], ["https://p0.meituan.net/moviemachine/3e523c730e278d0fe8cbf519a361376d189135.jpg@128w_170h_1e_1c", "布拉德·皮特", "饰：Max Vatan"], ["https://p1.meituan.net/moviemachine/08297ad13989d0c7963ae8b4d558b4af45187.jpg@128w_170h_1e_1c", "玛丽昂·歌迪亚", "饰：Marianne Beausejour"], ["https://p0.meituan.net/moviemachine/d6d43efdd680d9b2c25f2e4cf8d3121a40391.jpg@128w_170h_1e_1c", "马修·古迪", "饰：\nGuy Sangster"], ["https://p0.meituan.net/movie/284eef0e25f127827922508b6fb0c3d2157700.jpg@128w_170h_1e_1c", "杰瑞德·哈里斯", "饰：\nFrank Heslop"], ["https://p0.meituan.net/moviemachine/fdb9f2274123b8c2e895083f17a1875349630.jpg@128w_170h_1e_1c", "丽兹·卡潘", "饰：Bridget"], ["https://p1.meituan.net/movie/5ed0663fd40470abded7f29675301b7c11596.jpg@128w_170h_1e_1c", "安格斯·肯尼迪", "饰