{"movieId": "246951", "picture": "https://p0.meituan.net/moviemachine/35f9e1c431d6276fd28dcd4e6682a84a222968.jpg@464w_644h_1e_1c", "name": "北京遇上西雅图之不二情书", "name2": "Book of Love", "type": [" 剧情 ", " 爱情 "], "place": "中国大陆", "length": "131分钟", "time": "2016-04-29中国大陆上映", "description": "姣爷 （ 汤唯 饰）15岁就随父亲移民到澳门，从此在赌城安家，并成为赌场公关。过着朝不保夕、居无定所的落魄生活。来自北京的大牛Daniel （ 吴秀波 饰）只身在美国打滚多年，已贵为加洲销售成绩最优秀的房地产经纪之一，更是身边不乏女伴的钻石王老五。姣爷一日起床后看到头顶一本《 查令十字街84号》的书，书谐音同“输”，姣爷气愤不已，几次把书扔掉都意外再回来，无奈之下只好将书按照书上的地址寄了出去。无独有偶，Daniel大牛也同时因为这本书备受困扰，将书寄到了同一地址。查令十字街84号的书店老板也是闲来无事，又将两人的信件寄给了对方，收到书后更加疑惑的两人通过后续的书信来往从彼此不顺眼慢慢成为灵魂知己。姣爷分别与学霸 （ 陆毅 饰）、富豪邓先生 （ 王志文 饰）和诗人 （ 祖峰 饰）开展一段无果的感情。Daniel则与两名外国女子谈情，并惨遭抛弃。Daniel为了得到在洛杉矶生活的一对华裔老人 （ 秦沛 、 吴彦姝 饰）的房屋借机接近老人，Daniel从小在国外生活却对中国古诗词文化颇为精通，再加上能言善道意外赢得了性格古怪但饱读诗书的老爷爷的信任。Daniel带两位老人到拉斯维加斯旅游，为两位老人补办婚礼。爷爷得知Daniel靠近他们的真相后，一度非常气愤并且生病住院，在和老人相处过程中已经产生了感情的Daniel内疚不已，多次探望都被爷爷拒绝。转眼到春节，远在NASA的孙子无法和爷爷奶奶团聚，只好进行视频对话，无奈爷爷奶奶搞不懂这些高科技，在爷爷的默许下奶奶叫来了Daniel，面对气还没完全消除的爷爷，奶奶说“好孩子才可以来家里看电视”，两人之间的关系才慢慢缓和  。", "director": ["https://p0.meituan.net/moviemachine/d32347e59839fb38091d174ef31fdec544746.jpg@128w_170h_1e_1c", "薛晓路"], "actors": [["https://p0.meituan.net/moviemachine/d683d2e788ecc245da1946bc434c889e58890.jpg@128w_170h_1e_1c", "汤唯", "饰：焦姣"], ["https://p0.meituan.net/movie/432999b78928d8595c5036638f53e2b340080.jpg@128w_170h_1e_1c", "吴秀波", "饰：罗大牛"], ["https://p1.meituan.net/moviemachine/89aed3b51b10fa5fc0240fd88fbc2af233906.jpg@128w_170h_1e_1c", "惠英红", "饰：凌姐"], ["https://p1.meituan.net/movie/f785a933fc2e4c1fa842abaf9d87a10b689446.png@128w_170h_1e_1c", "胡晨雨", null], ["https://p0.meituan.net/moviemachine/d683d2e788ecc245da1946bc434c889e58890.jpg@128w_170h_1e_1c", "汤唯", "饰：焦姣"], ["https://p0.meituan.net/movie/432999b78928d8595c5036638f53e2b340080.jpg@128w_170h_1e_1c", "吴秀波", "饰：罗大牛"], ["https://p1.meituan.net/moviemachine/89aed3b51b10fa5fc0240fd88fbc2af233906.jpg@128w_170h_1e_1c", "惠英红", "饰：凌姐"], ["https://p1.meituan.net/movie/f785a933fc2e4c1fa842abaf9d87a10b689446.png@128w_170h_1e_1c", "胡晨雨", null], ["htt