{"movieId": "1362110", "picture": "https://p1.meituan.net/movie/71fa47b4e6adbe816346b46f709bc6468785.jpg@464w_644h_1e_1c", "name": "生人勿进", "name2": "Låt den rätte komma in", "type": [" 剧情 ", " 爱情 ", " 恐怖 "], "place": "瑞典", "length": "115分钟", "time": "2008-01-26瑞典上映", "description": "奥斯卡是一个孤独并且经常受人欺负的12岁小男孩。一天晚上，他的隔壁来了一户新邻居。他和这个隔壁的小女孩艾丽很快就成了好朋友。当艾丽得知奥斯卡经常受到科尼等人欺负的时候，她告诉奥斯卡要学会反击。而 在此期间，这个寒冷的瑞典小镇频频发生命案，死者都被吸干了血。原来，这些都是艾丽的“父亲”埃里克干的，艾丽其实是个吸血鬼，她靠吸人血维持生命。某天，艾丽的“父亲”正在采集人血的时候被人发现了，他立刻束手就擒，还因此毁了容。埃里克面对前来寻找自己的艾丽表示，希望艾丽帮助他从痛苦中解脱出来。奥斯卡在一次学校组织的野营中，再次受到科尼等人的挑衅。已经变得勇敢的奥斯卡用木棍教训了科尼。而一个人生活的艾丽则继续寻找血源，她咬了一个叫维吉尼亚的女人，但由于雷克斯的阻挠而最终没有采集到对方的血液。然而，维吉尼亚还是很快就变成了吸血鬼，她在医院就医时，由于护士不小心打开了了窗帘，维吉尼亚随即在阳光的照射下化为了灰烬。愤怒的雷克斯前去除掉艾丽，此时奥斯卡却突然出现，救了艾丽一命。奥斯卡其实早就知道了艾丽是个吸血鬼的事实，但他已经深深地爱上了艾丽，而艾丽也将奥斯卡作为了自己的精神依靠。一晚，奥斯卡在游泳池接受训练，科尼和吉米等人前来找他算账，吉米让奥斯卡在水里憋气3分钟，否则就要在其身上划几刀。奥斯卡只好照做，正当危机之时，艾丽及时出现，她消灭了科尼和吉米等人。之后，奥斯卡和艾丽踏上了离乡的旅程，奥斯卡搭上了火车，带着剩余的钱和物品，还有藏在箱子里面的艾丽，远走高飞  。", "director": ["https://p1.meituan.net/movie/94c54e8b2f8e499f94e6ac06e954707858730.jpg@128w_170h_1e_1c", "托马斯·阿尔弗莱德森"], "actors": [["https://p0.meituan.net/movie/6353a4c6bfa2da7c099f2f1a5e9524e177567.jpg@128w_170h_1e_1c", "凯尔·赫德布朗特", "饰：奥斯卡"], ["https://p1.meituan.net/movie/173859ef63ce97893dc4f00a84c463db31524.jpg@128w_170h_1e_1c", "HenrikDahl", "饰：Erik"], ["https://p0.meituan.net/movie/7d63914647c04f75d8b7dde88840d42311208.jpg@128w_170h_1e_1c", "莉娜·莱纳德尔森", "饰：艾丽 Eli"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "KarinBergquist", "饰：Yvonne"], ["https://p0.meituan.net/movie/6353a4c6bfa2da7c099f2f1a5e9524e177567.jpg@128w_170h_1e_1c", "凯尔·赫德布朗特", "饰：奥斯卡"], ["https://p1.meituan.net/movie/173859ef63ce97893dc4f00a84c463db31524.jpg@128w_170h_1e_1c", "HenrikDahl", "饰：Erik"], ["https://p0.meituan.net/movie/7d63914647c04f75d8b7dde88840d42311208.jpg@128w_170h_1e_1c", "莉娜·莱纳德尔森", "饰：艾丽 Eli"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "KarinBergquist", "饰：Yvonne"], ["htt