{"movieId": "1203437", "picture": "https://p1.meituan.net/movie/dce2ad3a2f5ddbe36d14638c71d16dad4638848.jpg@464w_644h_1e_1c", "name": "再见十八班", "name2": null, "type": [" 剧情 "], "place": "中国大陆", "length": "102分钟", "time": "2018-03-07中国大陆上映", "description": "梧桐中学高二十八班是远近闻名的问题班级，后进生、艺术生、体育生、不良少年聚集在此，以宋宸（柯焱曦 饰）为首的男生帮派和以秦淼淼（熊婧文 饰）为首的女生帮派互相不服，班级混乱无序。一天，高二十八班收到了一封信，这封信自称是由一年后的他们集体寄来。信上说，即将调来的班主任谭 睿明（秦海 饰）会改变十八班，成为对他们最重要的人。然而在一年后的未来，谭老师却永远地离开了他们。为了实现一段没有遗憾的青春，扭转历史，少年们决定按照信上所说，挑战一个个不可能实现的任务...", "director": ["https://p0.meituan.net/movie/535e1529050a8d6a7da16204858d0a8410659.jpg@128w_170h_1e_1c", "柯焱曦"], "actors": [["https://p0.meituan.net/movie/535e1529050a8d6a7da16204858d0a8410659.jpg@128w_170h_1e_1c", "柯焱曦", "饰：宋宸"], ["https://p0.meituan.net/movie/15ba278c937317b964b9f8e6644183656036.jpg@128w_170h_1e_1c", "熊婧文", "饰：秦淼淼"], ["https://p1.meituan.net/moviemachine/b366d84b39afde8527899ded41757a9a42540.jpg@128w_170h_1e_1c", "秦海", "饰：谭睿明"], ["https://p0.meituan.net/movie/535e1529050a8d6a7da16204858d0a8410659.jpg@128w_170h_1e_1c", "柯焱曦", "饰：宋宸"], ["https://p0.meituan.net/movie/15ba278c937317b964b9f8e6644183656036.jpg@128w_170h_1e_1c", "熊婧文", "饰：秦淼淼"], ["https://p1.meituan.net/moviemachine/b366d84b39afde8527899ded41757a9a42540.jpg@128w_170h_1e_1c", "秦海", "饰：谭睿明"]]}
{"movieId": "1203734", "picture": "https://p0.meituan.net/movie/d96821ab24715c232053d5bc0d7f65c0108219.jpg@464w_644h_1e_1c", "name": "大世界", "name2": "Have a Nice Day", "type": [" 喜剧 ", " 动画 ", " 犯罪 "], "place": "中国大陆", "length": "77分钟", "time": "2018-01-12中国大陆上映", "description": "本片主要描绘了一个发生在一天之内的黑色幽默故事。南方小城，大雨将至。青年小张为了挽救和女友的爱情，抢劫了老板的巨款，引发连锁反应。几股势力纷纷对小张展开追逐。原本没有关系的他们，命运产生了交集。在一番阴差阳错、啼笑皆非的交手之后，他们迎来了意想不到的结局。这些想改变命运的人，最终被命运开了一个玩笑。", "director": ["https://p1.meituan.net/movie/34f4722a0df1ba8d11adffc267fc0eb47975.jpg@128w_170h_1e_1c", "刘健"], "actors": [["https://p0.meituan.net/movie/571b34c3afdb2a8024cd02182a9162b592101.jpg@128w_170h_1e_1c", "朱昌龙", "饰：小张"], ["https://p1.meituan.net/movie/7b95311d4ee9fa99f3e3e1dfdf877f9093158.jpg@128w_170h_1e_1c", "曹恺", "饰：老赵"], ["https://p0.meituan.net/movie/1e9df4a8e9f09eaade301531749fd3c776320.jpg@128w_170h_1e_1c", "曹寇", "饰：黄眼"], ["https://p1.meituan.net/movie/c5e766ae0e243a69bd8c37bfea7f5577106791.jpg@128w_170h_1e_1c", "薛峰", "饰：老三"], ["https://p0.meituan.net/movie/571b34c3afdb2a8024cd02182a9162b592101.jpg@128w_170h_1e_1c", "朱昌龙", "饰：小张"], ["https://p1.meituan.net/movie/7b95311d4ee9fa99f3e3e1dfdf877f9093158.jpg@128w_170h_1e_1c", "曹恺", "饰：老赵"], ["https://p0.meituan.net/movie/1e9df4a8e9f09eaade301531749fd3c776320.jpg@128w_170h_1e_1c", "曹寇", "饰：黄眼"], ["https://p1.meituan.net/movie/c5e766ae0e243a69bd8c37bfea7f5577106791.jpg@128w_170h_1e_1c", "薛峰", "饰：老三"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "杨思明", "饰：刘叔"], ["https://p0.meituan.net/movie/187b3edb183f7d539675c1a08ee8a80991936.jpg@128w_170h_1e_1c", "王达", "饰：吴力度"], ["https://p1.meituan.net/movie/21a103f63df3125eb57a3cb57e44fa274029.jpg@128w_170h_1e_1c", "马晓峰", "饰：瘦皮"], ["https://p1.meituan.net/movie/34f4722a0df1ba8d11adffc267fc0eb47975.jpg@128w_170h_1e_1c", "刘健", "饰：方援军"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "朱虹", "饰：古洝洝"], ["https://p0.meituan.net/moviemachine/b99384cf1