{"movieId": "1319629", "picture": "https://p1.meituan.net/movie/8e9a569ab0157eb076fed6e84651e86f4000110.jpg@464w_644h_1e_1c", "name": "降临", "name2": "Arrival", "type": [" 悬疑 ", " 冒险 ", " 科幻 "], "place": "美国", "length": "116分钟", "time": "2017-01-20中国大陆上映", "description": "十二艘来历不明的外星飞船在地球现身并分别在全球多地降落，这些不期而至的来客更向外界发出了人类无从知晓的声音讯息。在无法判断辨识这些神秘访客是敌是友的情况下，人类的安危遭受着突发的威胁，不敢掉以轻心的美国政府和军方不得不寻求优秀的语言学专家露易丝·班克（艾米·亚当斯 饰）及物理学教授伊恩·唐纳利（杰瑞米·雷纳 饰）来协助破译这些外星来客所传递的不明讯息。被政府派遣的两人带领着一支精英调查研究团队与时间赛跑，试图尽快得到答案的他们必须赶在这些不速之客再次行动前归纳并拆解各种玄机。在露易丝利用外星语言“七肢桶”与这些来客交流沟通，试图分析并了解这些来客此行的意图时，她的脑海里却突然浮现出了她从出生到死亡的片段景象，即使是未知的未来竟然也尽收眼底。在联手探索外星来客秘密的过程中，露易丝与默契的工作搭档伊恩形成了强大的友谊。然而当外星来客造访地球的真实目的逐渐明朗时，露易丝赫然发现眼前这些支离破碎而又莫名难解的片段原来别有用意。徘徊在生死存亡边缘的全球人类又能否逃过此劫……", "director": ["https://p1.meituan.net/movie/fb6df0038844f35d7495f71d0f143a2c160021.jpg@128w_170h_1e_1c", "丹尼斯·维伦纽瓦"], "actors": [["https://p0.meituan.net/movie/add602ffcbf98313b0303f7740bb50f451592.jpg@128w_170h_1e_1c", "艾米·亚当斯", "饰：露易丝·班克斯 Dr. Louise Banks"], ["https://p0.meituan.net/moviemachine/3c087f6b63676a2e1baaba7a02aab8fa49544.jpg@128w_170h_1e_1c", "杰瑞米·雷纳", "饰：伊恩·唐纳利 Ian Donnelly"], ["https://p1.meituan.net/movie/5e1e2d391eca173666f792a029f0d80c7241.jpg@128w_170h_1e_1c", "福里斯特·惠特克", "饰：韦伯上校 Colonel Weber"], ["https://p0.meituan.net/movie/19bcc3dd4c95611e2194af11256cc00375410.jpg@128w_170h_1e_1c", "迈克尔·斯图巴", "饰：Agent Halpern"], ["https://p0.meituan.net/movie/add602ffcbf98313b0303f7740bb50f451592.jpg@128w_170h_1e_1c", "艾米·亚当斯", "饰：露易丝·班克斯 Dr. Louise Banks"], ["https://p0.meituan.net/moviemachine/3c087f6b63676a2e1baaba7a02aab8fa49544.jpg@128w_170h_1e_1c", "杰瑞米·雷纳", "饰：伊恩·唐纳利 Ian Donnelly"], ["https://p1.meituan.net/movie/5e1e2d391eca173666f792a029f0d80c7241.jpg@128w_170h_1e_1c", "福里斯特·惠特克", "饰：韦伯上校 Colonel Weber"], ["https://p0.meituan.net/movie/19bcc3dd4c95611e2194af11256cc00375410.jpg@128w_170h_1e_1c", "迈克尔·斯图巴", "饰：Agent Halpern"], ["https://p1.meituan.net/movie/3385934150b923935d2a1305f547678815889.jpg@128w_170h_1e_1c", "马克·奥布莱恩", "饰：Captain Marks"], ["https