{"movieId": "338391", "picture": "https://p0.meituan.net/movie/2489823af3b55a2cb6057219a8ede767192044.jpg@464w_644h_1e_1c", "name": "扎职", "name2": "紮職", "type": [" 犯罪 "], "place": "中国香港", "length": "90分钟", "time": "2012-11-15中国香港上映", "description": "1997年，用功读书且孝敬寡母的阿霆（陈伟霆 饰）和早早便混社会的阿祥（曾国祥 饰）、阿栋（徐伟栋 饰）是自幼长大的好朋友。因做小生意的霆母被人欺负，阿祥等人叫来大哥耀文（谭耀文 饰）相助。文哥是黑道响当当的人物，当年曾一夜之间横扫油麻地，但却甘心经营一家小水果摊。见识了文哥的义气，阿霆决心拜入其门下，希望早日赚大钱孝敬父母。经过多年的打拼历练，阿霆逐渐成长为足以独当一面的少壮派人物。他代大老板王波（卢海鹏 饰）收账，由此与富家千金Michelle （诗雅 饰）相识相恋。 风光无限的阿霆惹到同门前辈火爆明（林利 饰），不仅遭到残酷毒打，连恋情也出现转机。这一事件促使他的内心世界以及黑道格局发生天翻地覆的变化……", "director": ["https://p0.meituan.net/movie/ead3eaa69f9f592ed94c722eeabde6ea33020.jpg@128w_170h_1e_1c", "陈翊恒"], "actors": [["https://p1.meituan.net/movie/ecfdbe6286e4a27448e0c35d7fcaaecb125507.jpg@128w_170h_1e_1c", "陈伟霆", "饰：阿霆"], ["https://p0.meituan.net/moviemachine/8fe11b307bf465695b9ce8ac911f6037171563.jpg@128w_170h_1e_1c", "卫诗雅", "饰：Michelle"], ["https://p0.meituan.net/movie/a895ced15905906b06be6d622e9d4dc7141965.jpg@128w_170h_1e_1c", "谭耀文", "饰：耀文"], ["https://p1.meituan.net/moviemachine/5bcf6688265a839a0d1938aeab0d0238204278.jpg@128w_170h_1e_1c", "曾国祥", "饰：阿祥"], ["https://p1.meituan.net/movie/ecfdbe6286e4a27448e0c35d7fcaaecb125507.jpg@128w_170h_1e_1c", "陈伟霆", "饰：阿霆"], ["https://p0.meituan.net/moviemachine/8fe11b307bf465695b9ce8ac911f6037171563.jpg@128w_170h_1e_1c", "卫诗雅", "饰：Michelle"], ["https://p0.meituan.net/movie/a895ced15905906b06be6d622e9d4dc7141965.jpg@128w_170h_1e_1c", "谭耀文", "饰：耀文"], ["https://p1.meituan.net/moviemachine/5bcf6688265a839a0d1938aeab0d0238204278.jpg@128w_170h_1e_1c", "曾国祥", "饰：阿祥"], ["https://p0.meituan.net/movie/d1fec15e16270e481f0dc9b6312b16fe38769.jpg@128w_170h_1e_1c", "吴浩康", "饰：Kin"], ["https://p1.meituan.net/moviemachine/b3233ac60d27ac37d1473b05ba20f67c171430.jpg@128w_170h_1e_1c", "陈家乐", "饰：Hitman"], ["https://p0.meituan.net/moviemachine/8f211fac4b4ef28b4d27d412aa37add6148917.jpg@128w_170h_1e_1c", "吴嘉龙", "饰：Bobby"], ["https://p1.meituan.net/movie/bcd7fd34f68002b91480e215435892743383