{"movieId": "498327", "picture": "https://p0.meituan.net/movie/aea8aa6459032255017014144a34fadf696434.jpg@464w_644h_1e_1c", "name": "笔仙Ⅱ", "name2": "Bunshinsaba 2", "type": [" 惊悚 ", " 悬疑 "], "place": "中国大陆", "length": "94分钟", "time": "2013-07-16中国大陆上映", "description": "大学时期，宋倩（朴韩星 饰）与娜娜（辛芷蕾 饰）、羽菲（李昕岳 饰）、游峰（张皓然 饰）、宏瑞（杨帆 饰）、杨铮（孙绍龙 饰）几个人是非常要好的朋友。直到认识了新生小艾（章婷婷 饰）。漂亮的小艾让本来亲密无间的小团体产生了裂痕。特别是娜娜，处处针对她，只有宋倩努力维系着大家的关系。渐渐开始有不好的传言在学校漫延——小艾一直被视为邪恶的化身，所有与她接触的人都会有厄运。很快宏瑞发生意外摔伤腿，错过一场重要比赛。宋倩几个人在学校的屋顶阁楼玩起笔仙，结果笔仙也验证了小艾的不详，当晚小艾便跳楼自杀了。 　　大学毕业后，宋倩和她的同学们事业都发展很顺利，有的成了大明星，有的成为了企业精英，而直到娜娜从美国回来，怪事接二连三的发生，每个人都开始遇到危险，谜底一层层揭开，原来大学时代小艾的死，是另有原因…… 　　2013年与2010年，都市中与校园里，一段尘封已久的大学往事，某个被记忆掩埋在心灵深处的名字再次因为笔仙的到来浮现脑海……", "director": ["https://p0.meituan.net/movie/c0a7d0e7c53d8dba9fb2966cc1ebb0dc36960.jpg@128w_170h_1e_1c", "安兵基"], "actors": [["https://p1.meituan.net/movie/bcd776e7b1e3b295b60192744aebefe536635.jpg@128w_170h_1e_1c", "朴寒星", "饰：宋倩"], ["https://p0.meituan.net/movie/696141972690e29df6899882053dd08245767.jpg@128w_170h_1e_1c", "辛芷蕾", "饰：娜娜"], ["https://p0.meituan.net/moviemachine/ad0451bdea9df29cd241dad08356f2be182924.jpg@128w_170h_1e_1c", "张皓然", "饰：游峰"], ["https://p0.meituan.net/movie/074f088e14aa4f8d859cd343e205f83935908.jpg@128w_170h_1e_1c", "章婷婷", "饰：小艾(玉涵)"], ["https://p1.meituan.net/movie/bcd776e7b1e3b295b60192744aebefe536635.jpg@128w_170h_1e_1c", "朴寒星", "饰：宋倩"], ["https://p0.meituan.net/movie/696141972690e29df6899882053dd08245767.jpg@128w_170h_1e_1c", "辛芷蕾", "饰：娜娜"], ["https://p0.meituan.net/moviemachine/ad0451bdea9df29cd241dad08356f2be182924.jpg@128w_170h_1e_1c", "张皓然", "饰：游峰"], ["https://p0.meituan.net/movie/074f088e14aa4f8d859cd343e205f83935908.jpg@128w_170h_1e_1c", "章婷婷", "饰：小艾(玉涵)"], ["https://p0.meituan.net/moviemachine/a7ba291aa6918382e2edb2917456ba4720965629.jpg@128w_170h_1e_1c", "李昕岳", "饰：羽菲"], ["https://p0.meituan.net/movie/481e9fa4ca8c5e860901428e7ab263ca27562.jpg@128w_170h_1e_1c", "高欣宇", "饰：小艾(玉涵)"], ["https://p1.meituan.net/moviemachine/544ae52b96e474d609da7e5c0f6f1449155959.jpg@