{"movieId": "1292", "picture": "https://p1.meituan.net/movie/6bc004d57358ee6875faa5e9a1239140128550.jpg@464w_644h_1e_1c", "name": "音乐之声", "name2": "The Sound of Music", "type": [" 剧情 ", " 爱情 ", " 歌舞 ", " 传记 "], "place": "美国", "length": "174分钟", "time": "1965-03-02多平台上线", "description": "玛利亚（朱丽·安德鲁斯 饰）是一个年轻活泼的修女，喜欢在大自然下高声歌唱，所以她常常忘记了修道院里的规矩。院长认为玛利亚并不属于规矩严格的修道院。院长与众嬷嬷商量后，决定安排玛利亚到一位名叫特拉普（克里斯托弗·普卢默 饰）上校家当家庭教师。上校的妻子去世多年，留下7个孩子，他要求对孩子严格管教。他告诉玛利亚在他家的家庭教师都做不长久，都是因为孩子的恶作剧。玛利亚果然也遭到了恶作剧，可是这位善良的老师并没有告诉他们的父亲，而是像个母亲一样照顾孩子，很快跟孩子打成一片。上校也渐渐在玛利亚的引导下改变了对孩子们的态度。上校与玛利亚之间发生了感情，他们完婚后回到了已被纳粹占领的奥地利，上校并不想为纳粹办事，一家人准备逃跑……", "director": ["https://p0.meituan.net/movie/91afa766fb09e80b74f83adf08f7870132793.jpg@128w_170h_1e_1c", "罗伯特·怀斯"], "actors": [["https://p1.meituan.net/movie/d8127b9c8d27493b7828b28a32ee4a8a5832.jpg@128w_170h_1e_1c", "朱莉·安德鲁斯", "饰：玛利亚 Maria"], ["https://p0.meituan.net/movie/63181eeb1456f260295a748147f2131a79584.jpg@128w_170h_1e_1c", "克里斯托弗·普卢默", "饰：特拉普 Captain Georg von Trapp"], ["https://p0.meituan.net/movie/ece0fd3a67bb13c0696594ea7505799931122.jpg@128w_170h_1e_1c", "埃琳诺·帕克", "饰：Baroness Elsa Schraeder"], ["https://p1.meituan.net/movie/cdae0aad1d90b130fd809deabc45666d28187.jpg@128w_170h_1e_1c", "理查德·海顿", "饰：Max Detweiler"], ["https://p1.meituan.net/movie/d8127b9c8d27493b7828b28a32ee4a8a5832.jpg@128w_170h_1e_1c", "朱莉·安德鲁斯", "饰：玛利亚 Maria"], ["https://p0.meituan.net/movie/63181eeb1456f260295a748147f2131a79584.jpg@128w_170h_1e_1c", "克里斯托弗·普卢默", "饰：特拉普 Captain Georg von Trapp"], ["https://p0.meituan.net/movie/ece0fd3a67bb13c0696594ea7505799931122.jpg@128w_170h_1e_1c", "埃琳诺·帕克", "饰：Baroness Elsa Schraeder"], ["https://p1.meituan.net/movie/cdae0aad1d90b130fd809deabc45666d28187.jpg@128w_170h_1e_1c", "理查德·海顿", "饰：Max Detweiler"], ["https://p0.meituan.net/movie/9b74cebe68ca4092a0c23b28568bc7a222770.jpg@128w_170h_1e_1c", "安娜·李", "饰：Sister Margaretta"], ["https://p1.meituan.net/movie/142491e0d0d91eee65dfce06af3fea2317870.jpg@128w_170h_1e_1c", "本·怀特", "饰：Herr Zeller"], ["https://p1.meitu