{"movieId": "1215685", "picture": "https://p0.meituan.net/movie/ddcf755a66007a823d88bc943a82344f319357.jpg@464w_644h_1e_1c", "name": "冰冷热带鱼", "name2": "冷たい熱帯魚", "type": [" 剧情 ", " 惊悚 ", " 犯罪 "], "place": "日本", "length": "146分钟", "time": "2011-01-29日本上映", "description": "富士见市某经营热带鱼的商店，居住着社本一家三口。户主信介（吹越满 饰）在妻子去世后不久便娶了美丽的妙子，此举令女儿美津子大为不满，因此家中的气氛总是压抑凝重，妙子更是小心翼翼，生怕因自己惹出事端。某晚，美津子因在行窃被超市所扣留，社本夫妇匆忙前往，多亏热情的陌生男子村田幸雄出面方得以脱身。村田也是一家热带鱼商店的老板，他诚恳地邀请社见一家到他的店中做客，并愿意聘用美津子为职员。社本夫妇虽有些无所适从，却不自觉地被村田牵着鼻子走。不久后，村田邀请信介为合作人，结果竟在信介的面前杀死了一个质疑自己的男人。一向唯唯诺诺的信介，被迫成为了疯狂的村田毁尸灭迹的帮凶……本片根据1993年震惊日本的琦玉爱犬家连续杀人事件改编。", "director": ["https://p0.meituan.net/movie/01645a640c55293f2cb5e20abc4c1e059974.jpg@128w_170h_1e_1c", "园子温"], "actors": [["https://p1.meituan.net/movie/c947e2ec1cb1d069476c81836dca42c339068.jpg@128w_170h_1e_1c", "吹越满", "饰：Nobuyuki Syamoto"], ["https://p1.meituan.net/movie/50ab1d5384f246d1ae3d7ac7a5c8d4659451.jpg@128w_170h_1e_1c", "绪方义博", "饰：Yukio Murata"], ["https://p1.meituan.net/movie/3e60d42caa4143c8aa90ce28f5968bdf36828.jpg@128w_170h_1e_1c", "黑泽明日香", "饰：Aiko Murata"], ["https://p0.meituan.net/movie/4bfedd1567b185f13ff3a76c6e073e4b47570.jpg@128w_170h_1e_1c", "神乐坂惠", "饰：Taeko Syamoto"], ["https://p1.meituan.net/movie/c947e2ec1cb1d069476c81836dca42c339068.jpg@128w_170h_1e_1c", "吹越满", "饰：Nobuyuki Syamoto"], ["https://p1.meituan.net/movie/50ab1d5384f246d1ae3d7ac7a5c8d4659451.jpg@128w_170h_1e_1c", "绪方义博", "饰：Yukio Murata"], ["https://p1.meituan.net/movie/3e60d42caa4143c8aa90ce28f5968bdf36828.jpg@128w_170h_1e_1c", "黑泽明日香", "饰：Aiko Murata"], ["https://p0.meituan.net/movie/4bfedd1567b185f13ff3a76c6e073e4b47570.jpg@128w_170h_1e_1c", "神乐坂惠", "饰：Taeko Syamoto"], ["https://p0.meituan.net/movie/87576f8c3f9b7ec63f58bf47ad6670ea29956.jpg@128w_170h_1e_1c", "芦川诚", "饰：出演"], ["https://p0.meituan.net/movie/3595bb0e6acd6f14d298c60f23460fd533191.jpg@128w_170h_1e_1c", "渡边哲", "饰：Takayasu TsuTsui"], ["https://p1.meituan.net/movie/f6815fa2e7b1ee508798fd868ac94f7629415.jpg@128w_170h_1e_1c", "三浦诚己", "饰：出演"], ["https:/