{"movieId": "78151", "picture": "https://p0.meituan.net/movie/f32c38156f0c4865bc3e738ef1eb32dd623383.jpg@464w_644h_1e_1c", "name": "侏罗纪公园3", "name2": "Jurassic Park 3", "type": [" 动作 ", " 科幻 ", " 惊悚 "], "place": "美国", "length": "92分钟", "time": "2002-01-23中国大陆上映", "description": "电影的时间设定在恐龙大闹 圣地亚哥事件 四年后（ 第二部的事件四年后）。一名小男孩玩 滑翔翼不幸失踪在索纳岛上。他的父母富商保罗与前妻阿曼达请求恐龙专家格兰特博士前往搭救。艾伦·格兰特博士（ 山姆·尼尔 饰）无论如何也不愿再返回那个鬼地方。虽然发下重誓，但现状不得不让他收回誓言。他的一项史前动物研究陷入资金紧张的窘境。而这时，富有的商人保罗·科比（ 威廉姆·H·梅西 饰）及其夫人阿曼达（ 蒂娅·里欧妮 饰）找到艾伦，邀请他作为向导带他们乘飞机前往 索纳岛观光。一方面酬劳颇丰，一方面又得知不用着陆小岛，好了伤疤忘了疼的艾伦接受了他们的邀请。然而事情却朝相反的方向发展，他们的飞机最终迫降小岛。至此他才得知，原来科比夫妇来此的目的竟是为了寻找失踪的儿子。与此同时他还发现，经过八年的自然进化，恐龙中最聪明的速龙竟然拥有了自己赖以交流的语言。这一次他的对手不仅凶恶，而且更为狡猾  。", "director": ["https://p0.meituan.net/movie/7ff23819f1abb6f17445cffc24f0ee0951559.jpg@128w_170h_1e_1c", "乔·庄斯顿"], "actors": [["https://p0.meituan.net/movie/79f287096ddd0123b98c27ab0549671492325.jpg@128w_170h_1e_1c", "萨姆·尼尔", "饰：艾伦•格兰特博士 Dr. Alan Grant"], ["https://p0.meituan.net/movie/8c5b256d82fb2e92a26329526a8b01ae48448.jpg@128w_170h_1e_1c", "威廉姆·H·梅西", "饰：保罗•科比 Paul Kirby"], ["https://p0.meituan.net/moviemachine/a4c68ea6f5fe5f997f1aeacd1ddd5f7d196388.jpg@128w_170h_1e_1c", "劳拉·邓恩", "饰：Dr. Ellie Sattler"], ["https://p1.meituan.net/movie/c9512d4b4bdf5d0f655b89e40458cb5715933.jpg@128w_170h_1e_1c", "蒂娅·里欧妮", "饰：阿曼达 Amanda Kirby"], ["https://p0.meituan.net/movie/79f287096ddd0123b98c27ab0549671492325.jpg@128w_170h_1e_1c", "萨姆·尼尔", "饰：艾伦•格兰特博士 Dr. Alan Grant"], ["https://p0.meituan.net/movie/8c5b256d82fb2e92a26329526a8b01ae48448.jpg@128w_170h_1e_1c", "威廉姆·H·梅西", "饰：保罗•科比 Paul Kirby"], ["https://p0.meituan.net/moviemachine/a4c68ea6f5fe5f997f1aeacd1ddd5f7d196388.jpg@128w_170h_1e_1c", "劳拉·邓恩", "饰：Dr. Ellie Sattler"], ["https://p1.meituan.net/movie/c9512d4b4bdf5d0f655b89e40458cb5715933.jpg@128w_170h_1e_1c", "蒂娅·里欧妮", "饰：阿曼达 Amanda Kirby"], ["https://p1.meituan.net/movie/5dc51c5282b5b7a50eda92133991405623445.jpg@128w_170h_1e_1c", "亚历桑德罗·尼沃拉", "饰：Billy Brennan"], ["https://p0.meituan.net/movie/e2a1657917f3062947601b