{"movieId": "1203", "picture": "https://p1.meituan.net/movie/c07903ec47468dff627c3f58afc73c4728102.jpg@464w_644h_1e_1c", "name": "明天，你好", "name2": null, "type": [" 纪录片 "], "place": "中国大陆", "length": "43分钟", "time": "2016-09-09中国大陆上映", "description": "美少女团体SNH48里汇聚了从14岁到22岁不等的青春女孩，她们为自己的梦想走上了一条特殊的道路。上海女孩陈佳莹不顾家人反对，加入团队，但是仍坚持护士工作，日夜兼程。团里年龄最大的徐辰辰面临尴尬的去留问题，未来的路不知道该何去何从。龚诗淇在这一年里迎来自己的18岁成人生日，在团队里学会独立和成长，而明年她即将面对高考。她们都对未来充满迷茫，但也充满着希望。", "director": ["https://p1.meituan.net/movie/226af5b10be82f0e28feb4f09b735689163492.jpg@128w_170h_1e_1c", "徐晨辰"], "actors": [["https://p1.meituan.net/movie/226af5b10be82f0e28feb4f09b735689163492.jpg@128w_170h_1e_1c", "徐晨辰", null], ["https://p1.meituan.net/movie/440824ac5a67df88b63932a93ea0da9d96284.jpg@128w_170h_1e_1c", "龚诗淇", null], ["https://p0.meituan.net/movie/493be3775fe27d5bf4781468cb610c5f74329.jpg@128w_170h_1e_1c", "陈佳莹", null], ["https://p1.meituan.net/movie/226af5b10be82f0e28feb4f09b735689163492.jpg@128w_170h_1e_1c", "徐晨辰", null], ["https://p1.meituan.net/movie/440824ac5a67df88b63932a93ea0da9d96284.jpg@128w_170h_1e_1c", "龚诗淇", null], ["https://p0.meituan.net/movie/493be3775fe27d5bf4781468cb610c5f74329.jpg@128w_170h_1e_1c", "陈佳莹", null]]}
{"movieId": "287274", "picture": "https://p1.meituan.net/movie/8c0219361fd69a3d1f3ac94d58f3409b341430.jpg@464w_644h_1e_1c", "name": "猛龙过江", "name2": "The Way of the Dragon", "type": [" 剧情 ", " 喜剧 ", " 动作 ", " 惊悚 "], "place": "中国香港", "length": "100分钟", "time": "1972-12-30多平台上线", "description": "唐龙 （李小龙饰）是一名香港乡下青年，受叔父所托，只身前往罗马协助餐馆经理陈清华 （苗可秀饰）。餐馆经常受到一伙商业集团的威胁，逼其出卖餐馆的地皮，并常派来歹徒滋事，餐馆生意每况日下。唐龙初到罗马，对当地习俗很不习惯，很令清华及餐馆的伙计反感。一日晚，歹徒又来捣乱，一名伙计被打昏。唐龙愤然出手，以三两招凌厉的腿法就将歹徒击倒，大家对他和中国功夫无不刮目相看。但商业集团的头目并没有善罢甘休，纠集一伙持枪歹徒到餐馆破坏，并指明要找唐龙报复。唐龙从外面回到餐馆，歹徒以枪逼他马上离开罗马。唐龙假意答应，引歹徒走出餐馆后，将歹徒一一击倒。在这次打斗中，李小龙展示了他双二节棍的威力，他面对多个敌人从容不迫，二节棍左右出击，以瞬雷不及掩耳的速度重创对手。歹徒头目发出暗杀令，除夕之夜，一名狙击手奉命暗杀唐龙，但唐龙以敏捷的身手躲过并追踪杀手，回到家中才发现清华已被歹徒抓走。愤怒的唐龙与伙计一道直捣匪徒巢穴，狠狠教训了所有的歹徒，并再次警告歹徒头目别再捣乱。恼羞成怒的歹徒高价请来全美空手道冠军及其徒弟，另外还请来合气道高手，并设下陷阱企图杀害唐龙。但唐龙凭借一身高强的武艺和顽强的斗志最终将敌人打败，并一举歼灭歹徒团伙。", "director": ["https://p1.meituan.net/movie/a617a9a15ada5a022a8d2540da29723063608.jpg@128w_170h_1e_1c", "李小龙"], "actors": [["https://p1.meituan.net/movie/a617a9a15ada5a022a8d2540da29723063608.jpg@128w_170h_1e_1c", "李小龙", "饰：Tang Lung (a.k.a. Dragon)"], ["https://p0.meituan.net/movie/cdab479d472368165133c2bf6ee8d80e36748.jpg@128w_170h_1e_1c", "苗可秀", "饰：Chen Ching Hua"], ["https://p1.meituan.net/movie/450aac453594030d5ab385eb86b251b419464.jpg@128w_170h_1e_1c", "小麒麟", "饰：Jimmy (uncredited)"], ["https://p1.meituan.net/movie/fe1598bd5f2360fa51041752148e001c18515.jpg@128w_170h_1e_1c", "黄宗迅", "饰：'Uncle' Wang (as Wang Chung Hsin)"], ["https://p1.meituan.net/movie/a617a9a15ada5a022a8d2540da29723063608.jpg@128w_170h_1e_1c", "李小龙", "饰：Tang Lung (a.k.a. Dragon)"], ["https://p0.meituan.net/movie/cdab479d472368165133c2bf6ee8d80e36748.jpg@128w_170h_1e_1c", "苗可秀", "饰：Chen Ching Hua"], ["https://p1.meituan.net/movie/450aac453594030d5ab385eb86b251b419464.jpg@128w_170h_1e_1c", "小麒麟", "饰：Jimmy (uncredited)"], ["https://p1.meituan.net/movie/fe1598bd5f2360fa51041752148e001c18515.jpg@128w_170h_1e_1c", "黄宗迅", "饰：'Uncle' Wang (as Wang Chung Hsin)"], ["https://p1.meituan.net/movie/d9d2ac93b8eef865cf41d