{"movieId": "78538", "picture": "https://p0.meituan.net/movie/e9bcb46638735a6a7d5a90d416343ba8189361.jpg@464w_644h_1e_1c", "name": "云的彼端，约定的地方", "name2": "雲のむこう、約束の場所", "type": [" 剧情 ", " 科幻 ", " 动画 "], "place": "日本", "length": "91分钟", "time": "2004-11-20乐视视频独播", "description": "在日本战后被分割统治的另一个世界里，1996年夏，位于联合国统治下的北海道的神秘巨塔工程悄然开始了。而在美国占领的本州，这个塔真正建设目的却无人知晓。　　那塔是一座隔着轻津海峡也可以清楚看到的庞然大物。两个15岁的少年：藤泽浩纪和白川拓也，对它有着不知道是敬畏还是憧憬的奇妙感情。他们利用军需废品，在山上的废弃小站里组装了一架名为ヴェラシーラ的小飞机。两个男孩同时喜欢着班上的泽渡佐由理。无论是佐由理还是“塔”，对他们而言都是一种象征，现在无法触即，将来一定会接近的事物。　　但是，佐由理在中学三年级时，突然得了原因不明的记忆障碍症，转学去了东京。在无可名状的虚脱感中，两个少年渐渐停止了对飞机的制造，走上了不同的道路。　　在2001年的东京，已经是大学生的浩纪和拓也再次相会。得知佐由理依然身陷病中，常年沉睡。二人想要把她解救出来。在这个过程中，他们不知不觉的接近了“塔”和这个世界的本质，以及佐由理隐藏的秘密。　　他们三个人，还能不能回到那约定的地方呢……", "director": ["https://p1.meituan.net/movie/249e7a7481c0dbe4d2e20b0d7d66465e36249.jpg@128w_170h_1e_1c", "新海诚"], "actors": [["https://p0.meituan.net/movie/25105b4d133c100771cfa64e2265f43972144.jpg@128w_170h_1e_1c", "吉冈秀隆", "饰：Hiroki Fujisawa"], ["https://p1.meituan.net/movie/f0f70294a5bac8b3c8126859b4bd4f2d27332.jpg@128w_170h_1e_1c", "萩原圣人", "饰：Takuya Shirakawa"], ["https://p0.meituan.net/movie/67fecef33245d659015d9596a464b8fc36824.jpg@128w_170h_1e_1c", "南里侑香", "饰：Sayuri Sawatari"], ["https://p0.meituan.net/movie/25105b4d133c100771cfa64e2265f43972144.jpg@128w_170h_1e_1c", "吉冈秀隆", "饰：Hiroki Fujisawa"], ["https://p1.meituan.net/movie/f0f70294a5bac8b3c8126859b4bd4f2d27332.jpg@128w_170h_1e_1c", "萩原圣人", "饰：Takuya Shirakawa"], ["https://p0.meituan.net/movie/67fecef33245d659015d9596a464b8fc36824.jpg@128w_170h_1e_1c", "南里侑香", "饰：Sayuri Sawatari"], ["https://p1.meituan.net/movie/b4eec09830668ee632644766203ea89728402.jpg@128w_170h_1e_1c", "石冢运升", "饰：Okabe"], ["https://p1.meituan.net/movie/f2eec901c98499ccd71830b7351fd66733994.jpg@128w_170h_1e_1c", "井上和彦", "饰：Tomizawa"], ["https://p1.meituan.net/movie/194020dbfdb440509f2b3fb87a3897a342903.jpg@128w_170h_1e_1c", "水野理纱", "饰：Maki Kasahara"], ["https://p1.meituan.net/movie/9dd9c73a3553698bf4cd276b06c7389130219.jpg@128w_170h_1e_1c", "木