{"movieId": "1217402", "picture": "https://p0.meituan.net/movie/f6c4fd6d634cd11fee46ed5607f5488f411473.jpg@464w_644h_1e_1c", "name": "三枪拍案惊奇", "name2": "A Simple Noodle Story", "type": [" 喜剧 ", " 悬疑 ", " 古装 "], "place": "中国大陆,中国香港", "length": "95分钟", "time": "2009-12-11中国大陆上映", "description": "荒漠中的麻子面馆，风情万种的老板娘（闫妮 饰）向波斯商人订购了一把左轮手枪，后者还展示了大炮的威力。炮声引来了巡逻队，老板娘跟情人李四（小沈阳 饰）将枪藏匿后，插科打诨，好饭招待，这才稳住了精明的队长（赵本山 饰）。队长的得力助手张三（孙红雷 饰）知悉老板娘与李四的暧昧关系，但未说破。原来，他跟老板（倪大红 饰）之间还有勾当。店员六暗恋店员七，二人被老板克扣工钱，同命相连，六曾试图向老板讨薪，惨遭痛骂。老板怀疑老板娘偷人，并对她动用死刑。密室中，张三告知老板真相，老板听后，怒不可遏，前去痛扁二人，被老板娘用手枪喝退。事后，老板与张三密谋买凶杀人，由此引发一场令人啼笑皆非的血案……", "director": ["https://p0.meituan.net/movie/a8642d79debf184d964a846afe0a126845962.jpg@128w_170h_1e_1c", "张艺谋"], "actors": [["https://p1.meituan.net/movie/ac5889eeccf0ced36638f1f1f0f0e349125157.jpg@128w_170h_1e_1c", "小沈阳", "饰：李四"], ["https://p1.meituan.net/movie/c6f56b1f058373f25817be00d9b2597237984.jpg@128w_170h_1e_1c", "闫妮", "饰：老板娘"], ["https://p1.meituan.net/movie/d226adc575bfbf6f347492de5bbbd88126972.jpg@128w_170h_1e_1c", "孙红雷", "饰：张三"], ["https://p1.meituan.net/movie/ac5889eeccf0ced36638f1f1f0f0e349125157.jpg@128w_170h_1e_1c", "小沈阳", "饰：李四"], ["https://p1.meituan.net/movie/c6f56b1f058373f25817be00d9b2597237984.jpg@128w_170h_1e_1c", "闫妮", "饰：老板娘"], ["https://p1.meituan.net/movie/d226adc575bfbf6f347492de5bbbd88126972.jpg@128w_170h_1e_1c", "孙红雷", "饰：张三"], ["https://p0.meituan.net/movie/c2352b921f5d930475752aa00c9b63fe151983.jpg@128w_170h_1e_1c", "倪大红", "饰：王五麻子"], ["https://p1.meituan.net/movie/8b7ad0f2fd0b163851d3562d47700aa033326.jpg@128w_170h_1e_1c", "程野", "饰：赵六"], ["https://p0.meituan.net/movie/a1f2e7f75d254d6908f4eb8cdb8af52262445.jpg@128w_170h_1e_1c", "赵本山", "饰：对眼将军,巡逻队长"], ["https://p0.meituan.net/moviemachine/eb05441a752842e352269e2238660ed130452.jpg@128w_170h_1e_1c", "毛毛", "饰：陈七"], ["https://p0.meituan.net/movie/4242f8982fe4e029e017e50e2f55062116445.jpg@128w_170h_1e_1c", "朱力安", "饰：波斯商人"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1