{"movieId": "1329694", "picture": "https://p0.meituan.net/movie/a6a7468d9960c9fabf8214d3bba211ee168781.jpg@464w_644h_1e_1c", "name": "看上去很美", "name2": "Little Red Flowers", "type": [" 剧情 ", " 喜剧 "], "place": "中国大陆,意大利", "length": "92分钟", "time": "2006-03-18中国大陆上映", "description": "方枪枪是个一直由奶奶带着的3岁男孩儿，一下子被当军人的爸爸丢进了幼儿园这个集体的环境里。生存的本能使他仔细地观察这一新环境并尽可能迅速地溶入这个新的社会里。慈眉善目的唐老师让他感到亲近，而不苟言笑的李老师则让他感到恐惧。小朋友们一个人一个性格，方枪枪试图接近他们、了解他们，本能地寻找着自己的盟友。他很快就和陈南燕陈北燕两姐妹成了朋友。这个有着几百个三四岁孩子的幼儿园，是一个建立在奖惩体制下的集体主义小社会。孩子们为了得到成年人的赞许和同龄人的羡慕、认同，都努力遵守幼儿园的各种纪律，为自己争得更多的小红花。得到5朵小红花，即最多的小红花，是方枪枪的最大愿望，为此他使出了吃奶的力气，克服了各种各样的个人习性，但他总也得不到5朵小红花。对于方枪枪来说，障碍越大，欲望则越强烈，他明里暗里都在使劲儿。但一个突发事件让方枪枪变了，变得内向了，也对小红花失去了兴趣。他更愿意和比他稍大一点儿的陈北燕一块儿玩，两人一块儿编故事，背着小朋友给他起外号、画像，一起篡改幼儿园的游戏和游戏规则。日子一天一天过去，方枪枪变得有些平庸，但看起来他乐在其中。有天晚上他做了个怪梦，第二天醒来，他开始告诉别的小朋友李老师是一个吃人的大妖怪。每个人都相信了方枪枪，并把方枪枪当成了他们的英雄。方枪枪和陈北燕成了孩子头儿，享受着其他孩子们的拥戴和尊敬。李老师和园长宣布禁止任何孩子与他交往，甚至他的好朋友陈南燕也在躲着他，他被孤立了  。", "director": ["https://p1.meituan.net/movie/b66602f0786b63d9ef1dbf7a9903699c56035.jpg@128w_170h_1e_1c", "张元"], "actors": [["https://p1.meituan.net/moviemachine/d0f35eb264ab2d224ea8749543ffff4039591.jpg@128w_170h_1e_1c", "董博文", "饰：方枪枪"], ["https://p0.meituan.net/movie/2ac8f0de8fa9316519417a8d6589e2f3182623.jpg@128w_170h_1e_1c", "宁元元", "饰：杨南燕"], ["https://p1.meituan.net/movie/552bb152ee8b9d8d758d0d4c235f953b44567.jpg@128w_170h_1e_1c", "陈曼媛", "饰：杨北燕"], ["https://p1.meituan.net/movie/118da739bd233b5b4e37375a8948864629713.jpg@128w_170h_1e_1c", "李昕芸", "饰：唐老师"], ["https://p1.meituan.net/moviemachine/d0f35eb264ab2d224ea8749543ffff4039591.jpg@128w_170h_1e_1c", "董博文", "饰：方枪枪"], ["https://p0.meituan.net/movie/2ac8f0de8fa9316519417a8d6589e2f3182623.jpg@128w_170h_1e_1c", "宁元元", "饰：杨南燕"], ["https://p1.meituan.net/movie/552bb152ee8b9d8d758d0d4c235f953b44567.jpg@128w_170h_1e_1c", "陈曼媛", "饰：杨北燕"], ["https://p1.meituan.net/movie/118da739bd233b5b4e37375a8948864629713.jpg@128w_170h_1e_1c", "李昕芸", "饰：唐老师"], ["https://p0.meituan.net/movie/7b461c9d85f89d4f6eedbacebf61d0f3189554.jpg@128w_170h_1e_1c", "战卫华", "饰：方父"],