{"movieId": "576169", "picture": "https://p0.meituan.net/movie/d5b92dc4f6e2b0be1d93a976df0eba81442982.jpg@464w_644h_1e_1c", "name": "举起手来2：追击阿多丸号", "name2": "Hands Up 2", "type": [" 喜剧 "], "place": "中国大陆", "length": "91分钟", "time": "2010-09-09中国大陆上映", "description": "1945年，第二次世界大战接近尾声，轴心国已成强弩之末，败局已定。许多战争中被俘虏的日本士兵经过改造后，陆续踏上回国的旅途，这其中便包括罗圈腿中村下等兵（潘长江 饰）。然而，即使在这垂死关头，帝国主义的贪婪仍旧没有收敛。轮椅太君（胡晓光 饰）伤愈出院，亲自负责指挥战舰阿多丸运送伤兵回国的重任，但是阿多丸还有一个秘密任务，那就是将从中国劫掠来的文物偷运出境。这个秘密被小刘（刘小微 饰）的父亲——一个文物老专家所得知，他掌握着所有文物的清单，也因此遭到日寇的追杀。临死之际，老教授将藏有清单的可乐瓶交给担任联络员的郭大叔（郭达 饰）。侦知到日本人的阴谋，八路军以及重庆方面的势力都行动起来。 而在这一过程中，更大的阴谋也悄悄浮出水面……", "director": ["https://p0.meituan.net/movie/5ed2b413af7173bba7094d6f2cbcc58736542.jpg@128w_170h_1e_1c", "冯小宁"], "actors": [["https://p1.meituan.net/movie/19a964074f8769dbd5a5e349a550fe9e32253.jpg@128w_170h_1e_1c", "潘长江", null], ["https://p1.meituan.net/movie/f9741aa58f2d82924c36706c84b515ee31538.jpg@128w_170h_1e_1c", "郭达", null], ["https://p0.meituan.net/movie/ba083fc1daba792faf4984e8af1e2bf332818.jpg@128w_170h_1e_1c", "刘小微", null], ["https://p1.meituan.net/movie/b4a256e24f5cfc98fd077367709d263f115816.jpg@128w_170h_1e_1c", "尹国华", null], ["https://p1.meituan.net/movie/19a964074f8769dbd5a5e349a550fe9e32253.jpg@128w_170h_1e_1c", "潘长江", null], ["https://p1.meituan.net/movie/f9741aa58f2d82924c36706c84b515ee31538.jpg@128w_170h_1e_1c", "郭达", null], ["https://p0.meituan.net/movie/ba083fc1daba792faf4984e8af1e2bf332818.jpg@128w_170h_1e_1c", "刘小微", null], ["https://p1.meituan.net/movie/b4a256e24f5cfc98fd077367709d263f115816.jpg@128w_170h_1e_1c", "尹国华", null], ["https://p0.meituan.net/movie/23ce054edfc02a3b1500508c4aae52f647734.jpg@128w_170h_1e_1c", "戴菲菲", "饰：赵小姐"], ["https://p0.meituan.net/movie/5ed2b413af7173bba7094d6f2cbcc58736542.jpg@128w_170h_1e_1c", "冯小宁", "饰：渔夫"], ["https://p0.meituan.net/movie/193194c73ae4f28cd73e5bf71050bf1b60465.jpg@128w_170h_1e_1c", "刘薇", null], ["https://p0.meituan.net/moviemachine/5d9238e045887f34a1205e0a2734c33d145810.jpg@128w_170h_1e_1c", "胡晓光", null], ["https://p1.meit