{"movieId": "246505", "picture": "https://p0.meituan.net/movie/c7bbc2910c2ce96d2fb4ef8d0afd95a2569605.jpg@464w_644h_1e_1c", "name": "我的父亲母亲", "name2": "My Father and Mother", "type": [" 剧情 ", " 爱情 "], "place": "中国大陆", "length": "89分钟", "time": "1999-10-16中国大陆上映", "description": "母亲乳名招娣 （ 章子怡 饰），年轻时是远近闻名的美人，不仅心灵手巧，而且勇敢地成为十里八乡第一个自由恋爱的女孩，她暗恋上骆玉生 （ 孙红雷 饰）的父亲骆长余 （ 郑昊 饰），一个淳朴幽默的青年教师。她以家传的青花大碗为记号，给心上人花样翻新地送最好吃的“派饭”；她通宵达旦织出最艳的“房梁红”装点他的教室；为了听到他的朗朗读书声，她不惜绕远路去担水；为了引起他的注意，她每天在送学生的路边等着他。 终于，招娣的美丽和诚挚打动了青年骆老师的心，他们很浪漫又很传统地相爱了。一只塑料红发卡就是他给她的爱情信物，然而，就在心灵刚刚撞击的那一刻，悲剧降临了——骆老师莫名其妙被打成右派，招娣特意为他做的晚饭蒸饺没吃上，就被带走了。她疯了一般，怀揣蒸饺沿路追赶，人摔倒了，蒸饺烂了，青花碗也碎了。技艺精湛的锔碗匠锔好了青花碗，却弥合不了姑娘破碎的心灵，招娣决心拖着病弱的身体去远行寻找初恋情人，瞎妈妈的泪水阻止不了招娣的决心。她瞒着众人上路了，却昏死半途，被路人送回，执拗的招娣挣扎起身还要冒死去寻觅。恰在此时，骆老师意外地来了，她躺在病床上，大滴的泪珠从她美丽而又憔悴的大眼睛中尽情地滚落。 他再也没有离开她，两个人一爱就是四十年，相濡以沫，心心相印  。", "director": ["https://p0.meituan.net/movie/a8642d79debf184d964a846afe0a126845962.jpg@128w_170h_1e_1c", "张艺谋"], "actors": [["https://p0.meituan.net/moviemachine/415b91df95c3ce02540901b5f67207ee188015.jpg@128w_170h_1e_1c", "章子怡", "饰：招娣"], ["https://p1.meituan.net/movie/d226adc575bfbf6f347492de5bbbd88126972.jpg@128w_170h_1e_1c", "孙红雷", "饰：骆玉生"], ["https://p1.meituan.net/movie/e14d3f22b1e566c63f121eb76849a65634657.jpg@128w_170h_1e_1c", "郑昊", "饰：骆长余"], ["https://p0.meituan.net/movie/f9f63fab7dc73a4b7115f26706f97e7776169.jpg@128w_170h_1e_1c", "李滨", "饰：招娣母亲"], ["https://p0.meituan.net/moviemachine/415b91df95c3ce02540901b5f67207ee188015.jpg@128w_170h_1e_1c", "章子怡", "饰：招娣"], ["https://p1.meituan.net/movie/d226adc575bfbf6f347492de5bbbd88126972.jpg@128w_170h_1e_1c", "孙红雷", "饰：骆玉生"], ["https://p1.meituan.net/movie/e14d3f22b1e566c63f121eb76849a65634657.jpg@128w_170h_1e_1c", "郑昊", "饰：骆长余"], ["https://p0.meituan.net/movie/f9f63fab7dc73a4b7115f26706f97e7776169.jpg@128w_170h_1e_1c", "李滨", "饰：招娣母亲"], ["https://p0.meituan.net/movie/6c6ad19da284574259b1958bf76a29f236696.jpg@128w_170h_1e_1c", "嵇波", "饰：青年夏木匠"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_