{"movieId": "1298552", "picture": "https://p1.meituan.net/movie/9c92a7313a9baded537ff592f38aa5af24965.jpg@464w_644h_1e_1c", "name": "奇异博士", "name2": "Doctor Strange", "type": [" 动画 ", " 奇幻 "], "place": "美国", "length": "76分钟", "time": "2007-08-14腾讯视频独播", "description": "年轻人史奇对自己的技巧有点儿骄傲，他将成为外科医生，他认为能把妹妹从痛苦中解脱出来，虽然其他医生觉得手术太昂贵和无效果。…但史奇最后还是失去了妹妹。在车祸后，双手动不了的他变得抑郁，而现代科技起不了作用。他去了喜玛拉雅山来找寻前人，谣传他医术高明。他发现前人帮不上忙，前 人告诉他先治愈好心灵，才能治愈好身体，要冲破心灵障碍，别相信眼见为实，史奇接受了古怪的身体训练，可他情况变得更糟糕…前人病了，随从莫多想继承魔法大师的职位，因此他视史奇为对手。同时，妖法高深莫测的邪灵Dormammu扬言离开监禁后，会为祸人间。在敌人的敌人就是朋友的理论下，追求权力的莫多也许和Dormammu联手。究竟史奇能否做好准备，及时阻止他们？", "director": ["https://p0.meituan.net/movie/5091f9ff69a6df0fe234c98c8f77aaff28370.jpg@128w_170h_1e_1c", "杰伊·欧力瓦"], "actors": [["https://p0.meituan.net/movie/057f087879fdb962fac0f64565a6ed6f95720.jpg@128w_170h_1e_1c", "拜斯·约翰逊", "饰：Doctor Strange,"], ["https://p0.meituan.net/movie/5b43f12e2934831c4bdf781bd5e2529d64105.jpg@128w_170h_1e_1c", "保罗·纳高奇", "饰：Wong,"], ["https://p1.meituan.net/movie/41c65c02725894b082eb618e101b694b18161.jpg@128w_170h_1e_1c", "乔纳森·亚当斯", null], ["https://p0.meituan.net/movie/057f087879fdb962fac0f64565a6ed6f95720.jpg@128w_170h_1e_1c", "拜斯·约翰逊", "饰：Doctor Strange,"], ["https://p0.meituan.net/movie/5b43f12e2934831c4bdf781bd5e2529d64105.jpg@128w_170h_1e_1c", "保罗·纳高奇", "饰：Wong,"], ["https://p1.meituan.net/movie/41c65c02725894b082eb618e101b694b18161.jpg@128w_170h_1e_1c", "乔纳森·亚当斯", null], ["https://p0.meituan.net/movie/e3d3ae6712bd2568e00198f5e39d543d47692.jpg@128w_170h_1e_1c", "凯文·迈克尔·理查德森", "饰：Mordo,"], ["https://p0.meituan.net/movie/76f4948560963d9367091221c48035ad191195.jpg@128w_170h_1e_1c", "塔拉·斯特朗", "饰：April,Lucy,Additional Voices,/  /"], ["https://p1.meituan.net/movie/5474a02625b1b9422e5d78868df2268633533.jpg@128w_170h_1e_1c", "乔什·基顿", "饰：Additional Voices"], ["https://p0.meituan.net/movie/80af88a0a930d8fcaa37840c2118f38e39098.jpg@128w_170h_1e_1c", "菲尔·拉马", "饰：Additional Voices"], ["https://p1.meituan.net/moviemachine/db0852a25f6df120ef9038cbe106d273151867.jpg@128w_170h_