{"movieId": "1240815", "picture": "https://p1.meituan.net/movie/8a3e28fe88b9b3a388215730ad7bc24f300356.jpg@464w_644h_1e_1c", "name": "灵魂纸扎店", "name2": null, "type": [" 爱情 ", " 悬疑 ", " 惊悚 "], "place": "中国大陆", "length": "65分钟", "time": "2016-12-23中国大陆上映", "description": "拥有不死之身的阴阳眼女孩小安白天经营纸扎店，晚上折纸烧给游魂野鬼帮助他们了却心愿投胎。百鬼缠身的小安，送走了无数野鬼，却常年被厉鬼全德喜纠缠。为了送走全德喜，小安心生一计，想把意外结识的单纯男孩苏晋送给全德喜，以了却其心愿。在送走厉鬼全德喜的过程中，渐渐抽丝剥茧出一件跨越百年的爱恨纠葛，同时也找出了她自己的身世之谜。到底小安为什么会不生不灭不死？到底全德喜为什么会一直纠缠小安？最后小安、全德喜和苏晋三人的命运如何？", "director": ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "朱滢心"], "actors": [["https://p1.meituan.net/moviemachine/72c265b1c079fd24ed26418bb42c44ad147349.jpg@128w_170h_1e_1c", "葛铮", "饰：苏晋"], ["https://p1.meituan.net/movie/7be8199223e87a84418d8a7a84368171147323.jpg@128w_170h_1e_1c", "裘斯", null], ["https://p1.meituan.net/moviemachine/11bafa9e8a2364a4968ca213a20b181d173575.jpg@128w_170h_1e_1c", "陈意涵", null], ["https://p1.meituan.net/moviemachine/72c265b1c079fd24ed26418bb42c44ad147349.jpg@128w_170h_1e_1c", "葛铮", "饰：苏晋"], ["https://p1.meituan.net/movie/7be8199223e87a84418d8a7a84368171147323.jpg@128w_170h_1e_1c", "裘斯", null], ["https://p1.meituan.net/moviemachine/11bafa9e8a2364a4968ca213a20b181d173575.jpg@128w_170h_1e_1c", "陈意涵", null]]}
{"movieId": "341229", "picture": "https://p0.meituan.net/movie/699b70322db80793be17661e6b5132b3165278.jpg@464w_644h_1e_1c", "name": "攻壳机动队2：无罪", "name2": "攻殻機動隊2 イノセンス", "type": [" 剧情 ", " 科幻 ", " 动画 "], "place": "日本", "length": "100分钟", "time": "2004-03-06日本上映", "description": "2032年，作别草雉少佐已有3年。光电、纳米、机械、生物、网络依然迅猛发展，唯有人类的安危更值得关注。离开了素子的公安九课的刑警、主力干将巴特，性格也起了变化，愈发冷漠偏执起来。某日，一个女性球形关节机器人偶突然袭击了自己的主人，在杀害两名警探后，被巴特制服并击毙。殊不知与此案相关更有数起类似球形关节人偶杀人事件发生，皆为洛克斯·索罗斯公司的测试用先期量产型所为。除了一名政客和一名国家安全人员外，被害人没有政治上的共同点，作案手法也都是将被害人杀害后将自身电脑毁灭初始化。而更为奇怪的是受害者家属全部同公司答成协议撤销起诉。为此，九课派出巴特和搭档特古沙展开调查。从工程师哈拉维口中，两人得知该型号人偶被用于性爱用途，受害者家属因家丑纷纷撤诉，这使得案情更加扑朔迷离。与此同时，索罗斯公司质检部长杰克·沃尔逊被残忍杀害，据查凶手为红尘会指使。在血洗了红尘会后两人发现，帮会的现任头目是为替前任复仇而派出杀手，而前任正是死在索罗斯公司的球形关节人偶手中。由于擅用职权，两人遭到了上级的训斥。回家路上，巴特惯例去超市购买狗粮，却遭暗算被人黑入电子脑，自残手臂后更是险些酿出人命，幸得同事中川及时出手相助。为了尽快调查清楚，巴特和特古沙直接飞往北部索罗斯公司进行采证。二人来到令巴特出丑的黑客基姆的宅邸，却为幻象迷惑。特古沙的电子脑更是被黑进入死循环，幸得草雉素子以守护天使身份潜入给予提示，二人才得以退出，将基姆逮捕，并将计就计追查下去。在特古沙的协助下，巴特利用基姆脑中的数据，成功突入洛克斯·索罗斯公司的巨型船舶，而此时此刻，船上的人偶也因程序原因启动自觉意识，开始发起进攻。千钧一发之时，一个球形关节人偶突然出现协助巴特成功突围，原来草雉素子利用卫星网络将作战义体加载至其中一个人偶中。两个最佳拍档的协力，将船上的系统彻底击破。在船上一间舱体内，一切秘密大白于天下：原来洛克斯·索罗斯公司所开发的Ghost Dubbing系统虽然通过动物实验证明可以大量劣化刻录Ghost进人偶，但由于会对宿主大脑产生损害而被禁，公司遂通过红尘会拐来孩子，利用系统将他们洗脑，刻录入他们的灵魂进入人偶。在成功解救出杰克·沃尔逊的女儿后，素子完成了任务，重又回到广阔的网路世界去了。留下的巴特并不会觉得孤独，因为他记得少佐留给他最后的话，“只要在网路里，我永远和你在一起。”", "director": ["https://p0.meituan.net/movie/78ddf3d7ac6d0cbcaaea92b5778d1ee835958.jpg@128w_170h_1e_1c", "押井守"], "actors": [["https://p1.meituan.net/movie/3166f7c343e09bcfd112f7d51b463c3d33137.jpg@128w_170h_1e_1c", "大木民夫", "饰：第9部分荒牧长 Section 9 Department Chief Aramaki"], ["https://p1.meituan.net/movie/8cb434b3e4ecf6e1ce890450e02c99c826876.jpg@128w_170h_1e_1c", "竹中直人", "饰：金 Kim"], ["https://p0.meituan.net/movie/b4c5bf1edccbed16d0dfa0179185dd3f22943.jpg@128w_170h_1e_1c", "山寺宏一", "饰：Togusa"], ["https://p0.meituan.net/movie/2a0f25543d685f230683b872cb4c178e38123.jpg@128w_170h_1e_1c", "田中敦子", "饰：元子草薙 Major Motoko Kusanagi"], ["https://p1.meituan.net/movie/3166f7c343e09bcfd112f7d51b463c3d33137.jpg@128w_170h_1e_1c", "大木民夫", "饰：第9部分荒牧长 S