{"movieId": "502", "picture": "https://p0.meituan.net/movie/326fb54acb9c4feab45f1f3988568e571769525.jpg@464w_644h_1e_1c", "name": "我为你牺牲", "name2": "Warriors of Hornor", "type": [" 剧情 ", " 动作 "], "place": "中国大陆", "length": "109分钟", "time": "2019-12-05中国大陆上映", "description": "根据三个武警部队真实人物故事改编：战斗在缉毒一线的王强（李琦 饰）“卧底”制毒工厂，凭借过硬的军事技能和强大的心理素质，排爆，制服毒枭，铲除制毒窝点；军属庄小红（陈姝 饰）默默支持丈夫多年驻守高原山口，而探亲过程中她却遭遇车祸截肢，为确保能生下健康的军人后代，忍痛不打麻药进行手术。术后依然自强自立；援疆战士李报国身患癌症，多次申请援疆执行任务，最后重症不治牺牲，留下“来生再报国”的遗愿，用生命诠释“为你牺牲”这一主题。", "director": ["https://p0.meituan.net/movie/071c33bb5e2b8952ab87d486756ad45243102.jpg@128w_170h_1e_1c", "安战军"], "actors": [["https://p1.meituan.net/moviemachine/178781d72d2ce75eec4cbda2cee8801927908.jpg@128w_170h_1e_1c", "李琦", "饰：王强"], ["https://p0.meituan.net/moviemachine/e2f30b4ab2151a824e19b070bd7dace1190091.jpg@128w_170h_1e_1c", "国永振", "饰：杨国富"], ["https://p0.meituan.net/moviemachine/68e0bced155fbfc567af54c421091182142975.jpg@128w_170h_1e_1c", "陈姝", "饰：庄小红"], ["https://p1.meituan.net/moviemachine/a0500098305fb30bed771c2fa75c2425125548.jpg@128w_170h_1e_1c", "魏鹏", "饰：李报国"], ["https://p1.meituan.net/moviemachine/178781d72d2ce75eec4cbda2cee8801927908.jpg@128w_170h_1e_1c", "李琦", "饰：王强"], ["https://p0.meituan.net/moviemachine/e2f30b4ab2151a824e19b070bd7dace1190091.jpg@128w_170h_1e_1c", "国永振", "饰：杨国富"], ["https://p0.meituan.net/moviemachine/68e0bced155fbfc567af54c421091182142975.jpg@128w_170h_1e_1c", "陈姝", "饰：庄小红"], ["https://p1.meituan.net/moviemachine/a0500098305fb30bed771c2fa75c2425125548.jpg@128w_170h_1e_1c", "魏鹏", "饰：李报国"], ["https://p0.meituan.net/movie/1fe45524b08df576048e844fde6e057444537.jpg@128w_170h_1e_1c", "尤勇", null], ["https://p0.meituan.net/moviemachine/0e12f2d0cdcb0b0d11eb552d23af3a9b43782.jpg@128w_170h_1e_1c", "林江国", null], ["https://p0.meituan.net/movie/b9ffde97fadde49191ddd3a5362e569367686.jpg@128w_170h_1e_1c", "宋楚炎", null], ["https://p0.meituan.net/moviemachine/a8ea6a90db5fdb351397fb5622ba4bc1131435.jpg@128w_170h_1e_1c", "李君峰", null], ["https://p1.meituan.net/movie/c4f55