{"movieId": "1203426", "picture": "https://p1.meituan.net/movie/96f8bc11f4288bff490da9f46d5d47e9337320.jpg@464w_644h_1e_1c", "name": "终结者", "name2": "The Terminator", "type": [" 动作 ", " 科幻 ", " 惊悚 "], "place": "美国,英国", "length": "107分钟", "time": "1992-06中国大陆上映", "description": "这是一个未来的世界，天下已经由机器人来操控。机器人想完全占有这个世界，把人类赶尽杀绝，然而却遇到了顽强抵抗的人类精英康纳。于是，终结者机器人T-800（阿诺·施瓦辛格 饰）受命回到1984年，杀害康纳母亲莎拉（琳达·汉密尔顿  饰），目的是灭掉康纳的出生。 康纳得知后，火速派战士雷斯（迈克尔·比恩 饰）前往救援。雷斯来到1984年的洛杉矶，及时搭救了被机器人追杀的莎拉——她当时还是一个大学生。然而，人们把雷斯当成疯子，不相信未来机器人统治世界。 直到莎拉又一次遭到机器人追击，她才相信了这一切。奔走中她和雷斯相爱，怀上了未来的康纳，而雷斯也陷入和机器人的苦斗当中。人类世界能否从因为这场斗争改变原来的噩运？", "director": ["https://p0.meituan.net/movie/871490cbd3ee1422ed57d7713543283b45250.jpg@128w_170h_1e_1c", "詹姆斯·卡梅隆"], "actors": [["https://p0.meituan.net/movie/2ce75e7e304866f08f9b4ffbf1f12a8b40360.jpg@128w_170h_1e_1c", "阿诺德·施瓦辛格", "饰：101号终结者 The Terminator"], ["https://p1.meituan.net/movie/5a193ac395cf0daea482c75d561cf5ea40286.jpg@128w_170h_1e_1c", "迈克尔·比恩", "饰：里斯凯优 Kyle Reese"], ["https://p1.meituan.net/moviemachine/3c6debcd8679a8e4838469add60778dc38344.jpg@128w_170h_1e_1c", "琳达·汉密尔顿", "饰：莎拉康纳 Sarah Connor"], ["https://p1.meituan.net/movie/5f63af4def44cf62f099b914ef5a8a8f49882.jpg@128w_170h_1e_1c", "兰斯·亨利克森", "饰：Detective Vukovich"], ["https://p0.meituan.net/movie/2ce75e7e304866f08f9b4ffbf1f12a8b40360.jpg@128w_170h_1e_1c", "阿诺德·施瓦辛格", "饰：101号终结者 The Terminator"], ["https://p1.meituan.net/movie/5a193ac395cf0daea482c75d561cf5ea40286.jpg@128w_170h_1e_1c", "迈克尔·比恩", "饰：里斯凯优 Kyle Reese"], ["https://p1.meituan.net/moviemachine/3c6debcd8679a8e4838469add60778dc38344.jpg@128w_170h_1e_1c", "琳达·汉密尔顿", "饰：莎拉康纳 Sarah Connor"], ["https://p1.meituan.net/movie/5f63af4def44cf62f099b914ef5a8a8f49882.jpg@128w_170h_1e_1c", "兰斯·亨利克森", "饰：Detective Vukovich"], ["https://p0.meituan.net/movie/320ff53701b9ce6d8084f2a3843f0bcb29868.jpg@128w_170h_1e_1c", "比尔·帕克斯顿", "饰：Punk Leader"], ["https://p0.meituan.net/movie/15b4eedd6370bdb12089e51626584d8c31166.jpg@128w_170h_1e_1c", "保罗·温菲尔德", "饰：Lieutenant Ed Traxler"], ["https