{"movieId": "938", "picture": "https://p0.meituan.net/movie/68571f14996ace7ff9d1572123d7f8d745942.jpg@464w_644h_1e_1c", "name": "我们亲爱的父母", "name2": "Au secours, les enfants reviennent!", "type": [" 喜剧 ", " 家庭 "], "place": "法国", "length": "", "time": "2006-11-29法国上映", "description": "夏尔和玛丽安娜辛苦了大半辈子，终于双双退休，于是二人决定开始梦想多年的印度之旅，并为这次激动人心的旅行做着各种准备。可是，让以为马上就可以飞往印度度假的二人没有想到的是，在准备出发的前一天小儿子维克多回到了家里，并准备在家长住下去。因为他把自己的公寓借给了非洲难民居住，而自己只能暂时回来求助于父亲。这是夏尔所不能容忍的，在他看来，只要年满十八岁就一定要独立生活。虽然小儿子维克多让二人多少有些不放心，但夏尔和玛丽安娜还是决定不能改变旅行计划。 一波未平，一波又起，晚上大女儿朱丽叶特带着两个孩子哭哭啼啼地回到家来。原来，朱丽叶特的丈夫艾迪安有了外遇，并把她赶了出来。朱丽叶特无处可去，只能回到了父母家。安慰好了女儿已经是后半夜了，夏尔和玛丽安娜再也睡不着了。大女儿朱丽叶特的情况让两位老人十分担心，二人决定暂时推迟旅行的时间，先把大女儿的婚姻矛盾处理好。但是让夏尔没有想到的是，艾迪安不但不负责任，还公然霸占了他和朱丽叶特的所有财产，包括她一手建立起来的美发店。 夏尔气不过女儿受欺负，和艾迪安发生了冲突，却意外惹上了官司。这一系列意外都让夏尔和玛丽安娜头疼不已，旅行计划早已化作泡影。可此时，大儿子托马也回到了家中，经济危机不但让他失了业，住的地方也被抵押了。面对儿女们的种种问题，夏尔和玛丽安娜可以选择的只有一次一次地放弃自己的生活，来帮助儿女们解决问题。为了让大女儿朱丽叶特重新找回自信，家人鼓励她继续从事爱好的美发事业，没有资金，父母支持。没有场所，家里就是最好的美发沙龙。 渐渐地，朱丽叶特开始新的生活，为了即将到来的美发比赛更是投入了全身心的努力。最重要的是，前夫艾迪安也参加了这个比赛，朱丽叶特要向他证明自己是很优秀的。对于朱丽叶特的努力，夏尔和玛丽安娜给予她全力的支持。而在这一过程中，家人之间的矛盾也渐渐地消除。朱丽叶特最终凭借自己的天赋和实力赢得了大赛的冠军，也认清了前夫的丑恶嘴脸。夏尔和玛丽安娜为儿女们感到骄傲，虽然没能旅游，但是他们收获了更多。", "director": ["https://p0.meituan.net/movie/962409f05e939102de662117a729df2c26063.jpg@128w_170h_1e_1c", "ThierryBinisti"], "actors": [["https://p0.meituan.net/movie/5bfa93264d07c78982ca5c79c9be869143566.jpg@128w_170h_1e_1c", "布鲁诺·萨拉曼", "饰：Thomas Brival"], ["https://p1.meituan.net/movie/0511c5fe5a47388dd2b794071d61432233875.jpg@128w_170h_1e_1c", "罗兰·吉罗", "饰：Charles Brival"], ["https://p0.meituan.net/movie/b94d2b9efddccd7e5337605dc1dc47d163166.jpg@128w_170h_1e_1c", "芬尼·科腾肯", "饰：Marianne Brival"], ["https://p0.meituan.net/movie/bfcdd1e5ff45ba7a438d47fefa74b52a30969.jpg@128w_170h_1e_1c", "艾丽斯·蒂尔罗伊", "饰：Juliette Ducatteau"], ["https://p0.meituan.net/movie/5bfa93264d07c78982ca5c79c9be869143566.jpg@128w_170h_1e_1c", "布鲁诺·萨拉曼", "饰：Thomas Brival"], ["https://p1.meituan.net/movie/0511c5fe5a47388dd2b794071d61432233875.jpg@128w_170h_1e_1c", "罗兰·吉罗", "饰：Charles Brival"], ["https