{"movieId": "334722", "picture": "https://p0.meituan.net/movie/d23a920d50fdee499a520e3edf1e1099240830.jpg@464w_644h_1e_1c", "name": "我的1919", "name2": "My 1919", "type": [" 剧情 ", " 传记 ", " 历史 "], "place": "中国大陆", "length": "98分钟", "time": "1999-09-16中国大陆上映", "description": "1918年，历时四年的第一次世界大战结束。1919年初，中国驻美公使顾维钧作为本国政府的全权代表赴法国参加巴黎和会。中国虽然是战胜国，但在和会上却处处受到歧视，野心勃勃的日本政府更企图继承德国在胶东半岛的特权。辩论会上，顾维钧慷慨陈词，从历史、人文等诸多方面阐明中国必须收回山东的严正立场，由此获得全世界与全国的一致称赞。为争取在法华工的同工同酬，顾维钧的好友肖克俭在巴黎组织游行罢工，遭到法国警察逮捕。获释之后，他仍然积极投入唤醒民众的工作。然而，他和朝鲜革命者一起爆炸日本代表团所住旅馆的偏激行为使朝鲜和中国成为舆论矛头的指向。巴黎和会最终拒绝了中国的正义要求，决定由日本继承德国在胶东半岛的特权。国内由此爆发了声势浩大的“五四”运动，肖克俭等人也在巴黎集会抗议。而软弱的北洋政府竟然逼迫代表团在和约上签字。代表团团长陆徽祥等人左右为难之下只好出走，代表团仅剩顾维钧和王正廷两人仍在坚持外交斡旋。肖克俭眼见帝国主义列强重新瓜分中国的现状，愤然给爱妻留下遗书，在凡尔赛宫广场举火自焚。", "director": ["https://p1.meituan.net/movie/dda889b10bf136250d0c039516d6f5aa12407.jpg@128w_170h_1e_1c", "黄健中"], "actors": [["https://p1.meituan.net/movie/335a518d22d2be6e73c1cd5fc1051cac36788.jpg@128w_170h_1e_1c", "陈道明", "饰：顾维钧"], ["https://p1.meituan.net/movie/6d816c951faeb7028abcc79615d3041f43448.jpg@128w_170h_1e_1c", "修宗迪", "饰：陆徽祥"], ["https://p1.meituan.net/movie/0b6bae40e28d8b6606c260227c920aa118511.jpg@128w_170h_1e_1c", "萨拉·格莱宾", "饰：Jeanne"], ["https://p0.meituan.net/movie/713a7cbcc5bf53bf27a83240da30bd45129794.jpg@128w_170h_1e_1c", "何政军", "饰：肖克俭"], ["https://p1.meituan.net/movie/335a518d22d2be6e73c1cd5fc1051cac36788.jpg@128w_170h_1e_1c", "陈道明", "饰：顾维钧"], ["https://p1.meituan.net/movie/6d816c951faeb7028abcc79615d3041f43448.jpg@128w_170h_1e_1c", "修宗迪", "饰：陆徽祥"], ["https://p1.meituan.net/movie/0b6bae40e28d8b6606c260227c920aa118511.jpg@128w_170h_1e_1c", "萨拉·格莱宾", "饰：Jeanne"], ["https://p0.meituan.net/movie/713a7cbcc5bf53bf27a83240da30bd45129794.jpg@128w_170h_1e_1c", "何政军", "饰：肖克俭"], ["https://p0.meituan.net/movie/5db76b355a2c0d228a58a627547f9d6b31896.jpg@128w_170h_1e_1c", "许晴", "饰：梅"], ["https://p0.meituan.net/moviemachine/05ce438480f4a9ab90486ddb88b4ca2c124844.jpg@128w_170h_1e_1c", "李建义", "饰：王正延"], ["https://p0.meituan.net/movie/326b20e87b1b60c180c848dfce8