{"movieId": "180", "picture": "https://p1.meituan.net/movie/88afea2bc7eb50d759c625190ee7d13e911026.jpg@464w_644h_1e_1c", "name": "地心历险记2：神秘岛", "name2": "Journey 2: The Mysterious Island", "type": [" 动作 ", " 科幻 ", " 冒险 "], "place": "美国", "length": "94分钟", "time": "2012-02-10中国大陆上映", "description": "17岁的肖恩·安德森（ 乔什·哈切森 饰）意外从一个神秘的岛屿上收到了一个遇难者的求救信号，可是当他查看地图的时候，才惊讶地发现那个位置上根本就没有什么海岛，而是一片完全空白的海 域。随着肖恩还是不断地收到来自于同一方位的SOS信息，刚刚成为他的继父的汉克·帕森斯（ 道恩·强森 饰）决定加入他寻求答案的行列，他们一起来到了南太平洋，然后进入了一片几乎没有人知道的区域。这是一座拥有着令人惊叹的美的小岛，展现出的是一种异常奇异且极具威胁性的生态环境，在火山和黄金山的背后，则隐藏着不只一个令人惊叹的大秘密。与肖恩、汉克一起的还有盖巴托（ 路易斯·古兹曼 饰），因为他是惟一一个愿意冒险踏上这次未知的旅程的直升机飞行员，随行的是盖巴托那美丽且意志坚强的女儿卡拉妮（ 凡妮莎·哈金斯 饰），他们决定出发去寻找这座不被人所知的小岛，然后解救岛上的那位孤独的人类求救者以及数不清的宝藏。同时，他们还得在地震引发的毁灭性的冲击抵达之前，离开那里，否则他们的命运将会和这片土地一样，永远地葬身海底。", "director": ["https://p0.meituan.net/movie/06fa4d0205cdd468e576511320f93b9650317.jpg@128w_170h_1e_1c", "布拉德·佩顿"], "actors": [["https://p1.meituan.net/movie/7e3067d066c1e285b0cc17bfd5f1b34e108474.jpg@128w_170h_1e_1c", "道恩·强森", "饰：汉克 Hank"], ["https://p1.meituan.net/movie/8850b10ea0559b1a08ddb76fa291fa7413461.jpg@128w_170h_1e_1c", "乔什·哈切森", "饰：肖恩 Sean"], ["https://p0.meituan.net/moviemachine/b95f355e9d1ac442bad7c76500c7c3b2169389.jpg@128w_170h_1e_1c", "凡妮莎·哈金斯", "饰：凯兰尼 Kailani"], ["https://p0.meituan.net/moviemachine/71c175e95beaf40ce938b79b3530b735172946.jpg@128w_170h_1e_1c", "迈克尔·凯恩", "饰：亚历山大 Alexander"], ["https://p1.meituan.net/movie/7e3067d066c1e285b0cc17bfd5f1b34e108474.jpg@128w_170h_1e_1c", "道恩·强森", "饰：汉克 Hank"], ["https://p1.meituan.net/movie/8850b10ea0559b1a08ddb76fa291fa7413461.jpg@128w_170h_1e_1c", "乔什·哈切森", "饰：肖恩 Sean"], ["https://p0.meituan.net/moviemachine/b95f355e9d1ac442bad7c76500c7c3b2169389.jpg@128w_170h_1e_1c", "凡妮莎·哈金斯", "饰：凯兰尼 Kailani"], ["https://p0.meituan.net/moviemachine/71c175e95beaf40ce938b79b3530b735172946.jpg@128w_170h_1e_1c", "迈克尔·凯恩", "饰：亚历山大 Alexander"], ["https://p0.meituan.net/movie/783cab1c5a682ba48911b1410566710659650.jpg@128w_170h_1e_1c", "路易斯·古兹曼", "饰：加布托 Gabato"], ["https://p0.meituan.net/movie/f4d5