{"movieId": "249898", "picture": "https://p1.meituan.net/movie/976ae27bed355c66694d946f703b4b99451410.jpg@464w_644h_1e_1c", "name": "妈妈再爱我一次", "name2": "My Beloved", "type": [" 剧情 ", " 家庭 "], "place": "中国台湾", "length": "87分钟", "time": "1990-09中国大陆上映", "description": "电影剧情以倒叙方式进行，描写精神病医生林志强（ 孙亚东 饰）留学归国，正要展开精神病院的业务，偶然发现院中一名病人，竟是他失踪18年的母亲秋霞（ 杨贵媚 饰）。原来当年其母秋霞与其父林国荣 相恋，但遭林母以秋霞身家不清白为由拆散鸳鸯，另外为国荣娶妻。已经怀孕的秋霞到乡下投靠姨母，并在生下志强后独力抚养，母子二人感情极佳。数年后，国荣之妻娟娟经证实不能生育，林家父母为了延续香火，用尽办法要志强离开母亲回到林家认祖归宗。秋霞几经内心挣扎，终于答应。但年幼的志强因思念母亲而无法过平静生活，经常偷偷回到乡下找母亲。一次风雨之夜，志强躲在庙外避雨， 秋霞等人遍寻不着，翌晨找到时，志强已奄奄一息昏迷不醒。秋霞大为激动，失足跌下楼梯成为疯妇。18年后，志强终于找到他心爱的母亲，并以一曲儿歌“ 世上只有妈妈好”重新唤醒母亲尘封多年的记忆，母子相认大团圆。", "director": ["https://p0.meituan.net/movie/9b046bd1f4e903c75c44d42532fff73532929.jpg@128w_170h_1e_1c", "陈朱煌"], "actors": [["https://p1.meituan.net/movie/ba0b8593cce79f94015f044b8067d29489445.jpg@128w_170h_1e_1c", "文英", "饰：(as Ying Wen)"], ["https://p1.meituan.net/movie/0627d6337a48ecc9d3183adf249968aa25528.jpg@128w_170h_1e_1c", "陈淑芳", null], ["https://p0.meituan.net/movie/e235909e76c25cf8fd25e637d9391fe212395.jpg@128w_170h_1e_1c", "孙亚东", null], ["https://p0.meituan.net/movie/e156a824d807e95b007e693cddf1839c25221.jpg@128w_170h_1e_1c", "赖德南", null], ["https://p1.meituan.net/movie/ba0b8593cce79f94015f044b8067d29489445.jpg@128w_170h_1e_1c", "文英", "饰：(as Ying Wen)"], ["https://p1.meituan.net/movie/0627d6337a48ecc9d3183adf249968aa25528.jpg@128w_170h_1e_1c", "陈淑芳", null], ["https://p0.meituan.net/movie/e235909e76c25cf8fd25e637d9391fe212395.jpg@128w_170h_1e_1c", "孙亚东", null], ["https://p0.meituan.net/movie/e156a824d807e95b007e693cddf1839c25221.jpg@128w_170h_1e_1c", "赖德南", null], ["https://p1.meituan.net/movie/23b1974b543c098517358a4bce4884bc29536.jpg@128w_170h_1e_1c", "陈琪", "饰：(as June Chen)"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "方龙", null], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "彭晓兰", null], ["https://p0.meituan.net/mov