{"movieId": "1250341", "picture": "https://p1.meituan.net/movie/4b4a4ce0a47ea55b71c5abb0f210cfbf36533.jpg@464w_644h_1e_1c", "name": "暮光之城", "name2": "Twilight", "type": [" 剧情 ", " 爱情 ", " 惊悚 ", " 奇幻 "], "place": "美国", "length": "122分钟", "time": "2009-11-25中国大陆上映", "description": "在美国一个名叫 福克斯的地方，住着一位英俊帅气的男青年爱德华。他出没神秘，与世无争，他的家人同样低调神秘，原因在于他是一只永远不会衰老，更不会死亡的吸血鬼。爱德华生于20世纪的第一年，自从1918年发育成长为十七岁的翩翩少年之后，他便再也没有衰老，永远保持着年轻俊朗的外形。时光飞梭，过了近百年后，他已经不再靠吸人血为生，因为爱德华和同是吸血鬼的家人都秉持着素食主义，只吸食动物的血。十七岁的少女伊莎贝拉从小与母亲相依为命，因为父母的感情破 裂，母亲带着她去了另一个城市。但当她长大的时候，母亲却决定再婚，由于继父是位棒球运动员，需要来回奔波，伊莎贝拉回到在福克斯的父亲查理的身边。在学校里，她结识了男孩爱德华，很快就被爱德华魅力所吸引，并渐渐喜欢上了他。不过爱德华虽然也喜欢伊莎贝拉，可是他却深知，一只吸血鬼是没有办法和人类正常生活在一起的。但他又无法忘却伊莎贝拉，也不忍心远走高飞，与伊莎贝拉断绝音信。而这时候另一派吸食人血的吸血鬼来到此地，并无意中盯上了伊莎贝拉，爱德华保护好了伊莎贝拉，两人的感情得到了稳定地发展。", "director": ["https://p0.meituan.net/movie/b23e2750ddbec2bf5756be4d6e37273a53071.jpg@128w_170h_1e_1c", "凯瑟琳·哈德威克"], "actors": [["https://p1.meituan.net/moviemachine/e7165bfc42e0336826bf5dfbc823397b177055.jpg@128w_170h_1e_1c", "克里斯汀·斯图尔特", "饰：贝拉·斯旺 Bella Swan"], ["https://p1.meituan.net/movie/c9a2126e6a74ea486428ca5ca644b42c33568.jpg@128w_170h_1e_1c", "罗伯特·帕丁森", "饰：爱德华·卡伦 Edward Cullen"], ["https://p1.meituan.net/movie/a3d1dc7b6bdf6a5836f638293f25cfda38546.jpg@128w_170h_1e_1c", "泰勒·洛特纳", "饰：雅各布·布莱克 Jacob Black"], ["https://p0.meituan.net/movie/e9f4678fd7a2e1852a4f89a9646221a017270.jpg@128w_170h_1e_1c", "杰克逊·拉斯波恩", "饰：贾斯帕·黑尔 Jasper Hale"], ["https://p1.meituan.net/moviemachine/e7165bfc42e0336826bf5dfbc823397b177055.jpg@128w_170h_1e_1c", "克里斯汀·斯图尔特", "饰：贝拉·斯旺 Bella Swan"], ["https://p1.meituan.net/movie/c9a2126e6a74ea486428ca5ca644b42c33568.jpg@128w_170h_1e_1c", "罗伯特·帕丁森", "饰：爱德华·卡伦 Edward Cullen"], ["https://p1.meituan.net/movie/a3d1dc7b6bdf6a5836f638293f25cfda38546.jpg@128w_170h_1e_1c", "泰勒·洛特纳", "饰：雅各布·布莱克 Jacob Black"], ["https://p0.meituan.net/movie/e9f4678fd7a2e1852a4f89a9646221a017270.jpg@128w_170h_1e_1c", "杰克逊·拉斯波恩", "饰：贾斯帕·黑尔 Jasper Hale"], ["https://p1.meituan.net/movie/04a24cb98b1797e5388efab1a20b691548659.jpg@128w_170h_1e_1c",