{"movieId": "1217859", "picture": "https://p0.meituan.net/movie/29a00bf92f96092f45e2636b86b1935e8256926.jpg@464w_644h_1e_1c", "name": "致我们终将逝去的青春", "name2": "So Young", "type": [" 剧情 ", " 爱情 "], "place": "中国大陆", "length": "132分钟", "time": "2013-04-26中国大陆上映", "description": "18岁的郑微（杨子姗 饰）终于如愿考上青梅竹马邻家大哥哥林静（韩庚 饰）所在学校的邻校，等她满怀期冀地步入大学校园，却遭遇打击：林静出国留学，杳无音信。郑微倍感失落，患难时刻与室友阮莞（江疏影 饰）、朱小北（刘雅瑟 饰）、黎维娟（张瑶 饰）及师哥老张（包贝尔 饰）结下深厚友谊，同时富家公子许开阳（郑恺 饰）对郑微展开了疯狂的追求，而备受男生欢迎的阮莞用她特有的清冷守护着对于爱情的忠贞。一次偶然的误会使郑微与老张室友陈孝正（赵又廷 饰）结为死敌，在一次次地反击中，郑微发现自己爱上了这个表面冷酷、内心善良的高材生，于是疯狂地反击演变为死缠烂打地追求，而陈孝正也终于在强攻之下缴械投降，欢喜冤家终成甜蜜恋人。大四毕业之际郑微的生活再次经受考验：陈孝正迫于家庭压力选择出国留学，却迟迟不敢告诉郑微。感觉再次被欺骗的郑微痛苦地离开陈孝正，却遇到搂着新欢的许开阳。多年后，郑微已蜕变为职场上的白领丽人，竟再次品尝命运的无常：带着悔意和爱意的林静和陈孝正同时回到她的生活里！郑微，这个昔日的玉面小飞龙，将怎样面对生活和青春赐予她的迷雾和抉择……", "director": ["https://p1.meituan.net/movie/f7dd59d2910c8ce854d510231cba5aaa53401.jpg@128w_170h_1e_1c", "赵薇"], "actors": [["https://p1.meituan.net/movie/9dca15d609c5d6c2fa89172e16396a1835092.jpg@128w_170h_1e_1c", "赵又廷", "饰：陈孝正"], ["https://p1.meituan.net/moviemachine/b3cc1b718aebab4f80bc49a52f2ebfc9195697.jpg@128w_170h_1e_1c", "韩庚", "饰：林静"], ["https://p0.meituan.net/movie/97e403072f168388a5e29b80edc64bed132225.jpg@128w_170h_1e_1c", "杨子姗", "饰：郑微"], ["https://p0.meituan.net/moviemachine/411187c4b6fecc9311e335b59dc85ce4167040.jpg@128w_170h_1e_1c", "江疏影", "饰：阮莞"], ["https://p1.meituan.net/movie/9dca15d609c5d6c2fa89172e16396a1835092.jpg@128w_170h_1e_1c", "赵又廷", "饰：陈孝正"], ["https://p1.meituan.net/moviemachine/b3cc1b718aebab4f80bc49a52f2ebfc9195697.jpg@128w_170h_1e_1c", "韩庚", "饰：林静"], ["https://p0.meituan.net/movie/97e403072f168388a5e29b80edc64bed132225.jpg@128w_170h_1e_1c", "杨子姗", "饰：郑微"], ["https://p0.meituan.net/moviemachine/411187c4b6fecc9311e335b59dc85ce4167040.jpg@128w_170h_1e_1c", "江疏影", "饰：阮莞"], ["https://p0.meituan.net/moviemachine/fd5e6bb94de0549083674241aa6d7cdb142000.jpg@128w_170h_1e_1c", "张瑶", "饰：黎维娟"], ["https://p0.meituan.net/moviemachine/1c0f7955daf90bf47fd56440cd0b02af40239.jpg@128w_170h_1e_1c", "郑恺", "饰：许开阳"], ["https://p1.m