{"movieId": "1207254", "picture": "https://p1.meituan.net/movie/5d097b762af26bd9fa0240c200605036393850.jpg@464w_644h_1e_1c", "name": "冰雪奇缘：生日惊喜", "name2": "Frozen Fever", "type": [" 喜剧 ", " 动画 ", " 短片 ", " 歌舞 "], "place": "美国", "length": "8分钟", "time": "2015-03-13腾讯视频独播", "description": "阳光明媚的阿伦黛尔王国，终于迎来了安娜（克里斯汀·贝尔 Kristen Bell 配音）的生日。早在数周前艾莎（伊迪娜•门泽尔 Idina Menzel 配音）便和克里斯托弗（乔纳森·格罗夫 Jonathan Groff 配音）、雪宝（乔什·盖德 Josh Gad 饰）精心准备这次生日庆典，我们这位认真执着的女王决不允许有半点失误。当她确认一切准备就绪时，便安排两位搭档看好会场，防止蛋糕遭到损坏，自己则独自走入城堡去叫醒熟睡中的安娜。姐妹俩共度生日的记忆还要追溯到艾莎被关在房间的那些年，所以艾莎极其重视今天这个特殊的日子。她为安娜精心挑选准备了各种小礼物，但或许是这几周来太过操劳了，以致于患上了感冒。一路上艾莎喷嚏连连，许多小雪宝从喷嚏中诞生出来，给克里斯托弗和雪宝惹出不少的麻烦……", "director": ["https://p1.meituan.net/moviemachine/ef4d0c3d7a4b7a7d71c3904416053b9a158758.jpg@128w_170h_1e_1c", "克里斯·巴克"], "actors": [["https://p1.meituan.net/movie/332730ecf19037688d1b9bb9cfe5991d48834.jpg@128w_170h_1e_1c", "乔什·加德", "饰：Olaf"], ["https://p1.meituan.net/moviemachine/16773b94779ef3bb6739d9a027d6a4ce221913.jpg@128w_170h_1e_1c", "伊迪娜·门泽尔", "饰：Elsa"], ["https://p0.meituan.net/moviemachine/4add7bf4251fdf2845b5719d24d9ee37171098.jpg@128w_170h_1e_1c", "乔纳森·格罗夫", "饰：Kristoff"], ["https://p1.meituan.net/movie/332730ecf19037688d1b9bb9cfe5991d48834.jpg@128w_170h_1e_1c", "乔什·加德", "饰：Olaf"], ["https://p1.meituan.net/moviemachine/16773b94779ef3bb6739d9a027d6a4ce221913.jpg@128w_170h_1e_1c", "伊迪娜·门泽尔", "饰：Elsa"], ["https://p0.meituan.net/moviemachine/4add7bf4251fdf2845b5719d24d9ee37171098.jpg@128w_170h_1e_1c", "乔纳森·格罗夫", "饰：Kristoff"], ["https://p0.meituan.net/moviemachine/0a0feee0e1a543aa962fe9ce729c66cc182895.jpg@128w_170h_1e_1c", "克里斯汀·贝尔", "饰：Anna"], ["https://p1.meituan.net/movie/ba5f7a75f71264b9942b6ee736156d0c21539.jpg@128w_170h_1e_1c", "克里斯·威廉姆斯", "饰：奥肯 Oaken"], ["https://p0.meituan.net/movie/02230f3ee4ed3fe96649b42b4b38949d29480.jpg@128w_170h_1e_1c", "保罗·布里格斯", "饰：棉花糖 Marshmallow"], ["https://p0.meituan.net/moviemachine/9137e3d1ab9b49da6b768161f49d16c9161681.jpg@128w_170h_1e_1c", "圣蒂诺·方塔纳", "饰：汉斯 Hans"]]}
