{"movieId": "13813", "picture": "https://p0.meituan.net/movie/e1a04ede9b5134ec96d3469e29e6de1c1542489.jpg@464w_644h_1e_1c", "name": "哆啦A梦：大雄的平行西游记", "name2": "Doraemon: Nobita no Parareru saiyûki", "type": [" 科幻 ", " 动画 ", " 冒险 "], "place": "日本", "length": "91分钟", "time": "1988-03-12日本上映", "description": "《大雄的平行西游记》是1988年公映的一部动画电影，改编自中国小说《 西游记》。由于原作 藤子·F·不二雄当时身体不好，该剧场版成为藤子先生在世时《哆啦a梦》剧场版作品中唯一没有漫画原作及脚本并非本人所写的作品。这个作品并没有出版原作漫画版，不过取代原本漫画的是由藤子自己画上封面的动画版彩色漫画，也是第一次以彩色动画版漫画的方式出版。该动画版彩色漫画就是动画电影的截图，大小不一地截图，在构图上接近漫画的形式。可能为了配合故事背景，该片开头出现了“机械猫·乃比太的同次元西游记”的汉字，为罕见的官方翻译，但这种翻译并不成熟且之后未被通用。同时该剧场版的预告片中也出现的日本声优朗读的汉语独白。并映作品为《 超能力魔美》和《Ultra B》。故事取景于公元630年的唐朝，发生在 玄奘前往天竺取经的时代。由于哆啦A梦的模拟游戏里的妖怪从游戏盒里跑了出来，导致世界陷入大混乱，历史被改变，妖怪战胜了人类。", "director": ["https://p0.meituan.net/movie/f279ffa72513dbc769077cb0617a3f1532108.jpg@128w_170h_1e_1c", "芝山努"], "actors": [["https://p1.meituan.net/movie/10d6e4fb81f890715857531c166bd95528641.jpg@128w_170h_1e_1c", "大山信代", "饰：哆啦A梦 Doraemon"], ["https://p1.meituan.net/movie/33966c1eabc34dfd2b48545f1bca312936621.jpg@128w_170h_1e_1c", "小原乃梨子", "饰：大雄 Nobita Nobi"], ["https://p0.meituan.net/movie/ab344ee5530acab7caf089971df80b0531484.jpg@128w_170h_1e_1c", "野村道子", "饰：Shizuka Minamoto"], ["https://p0.meituan.net/movie/d72e6ac28f5eb782fcda723f5319e58417637.jpg@128w_170h_1e_1c", "肝付兼太", "饰：Suneo Honegawa"], ["https://p1.meituan.net/movie/10d6e4fb81f890715857531c166bd95528641.jpg@128w_170h_1e_1c", "大山信代", "饰：哆啦A梦 Doraemon"], ["https://p1.meituan.net/movie/33966c1eabc34dfd2b48545f1bca312936621.jpg@128w_170h_1e_1c", "小原乃梨子", "饰：大雄 Nobita Nobi"], ["https://p0.meituan.net/movie/ab344ee5530acab7caf089971df80b0531484.jpg@128w_170h_1e_1c", "野村道子", "饰：Shizuka Minamoto"], ["https://p0.meituan.net/movie/d72e6ac28f5eb782fcda723f5319e58417637.jpg@128w_170h_1e_1c", "肝付兼太", "饰：Suneo Honegawa"], ["https://p0.meituan.net/movie/b0a042eb670897f790646891c8c76d0135015.jpg@128w_170h_1e_1c", "立壁和也", "饰：Takeshi Goda"], ["https://p0.meituan.net/movie/534dd528a69e4fc7928539f55f0aff8528737.jpg@128w_170h_1e