{"movieId": "1258163", "picture": "https://p1.meituan.net/moviemachine/3e8ec372564f86db6105eb1aa95094ef1926569.png@464w_644h_1e_1c", "name": "坂本龙一：终曲", "name2": "Ryuichi Sakamoto: CODA", "type": [" 纪录片 ", " 音乐 "], "place": "日本", "length": "102分钟", "time": "2019-12-16中国大陆上映", "description": "这部关于日本顶级作曲家坂本龙一的纪录片，主要按照2012年到2017年的时间顺序，剪辑了坂本龙一30年前参与《末代皇帝》等电影以及40年前作为YMO乐队成员活动的宝贵片段。Coda在音乐术语中是，Coda是一个乐章最后的段落里强调终止效果的乐段。，正如有着匠人精神的坂本龙一，愿将每部作品都当做生命中的最后一部进行创作。", "director": ["https://p0.meituan.net/moviemachine/49caa6348ad6fdc3c60b1fd5433f3eba146330.jpg@128w_170h_1e_1c", "史蒂芬·野村·斯奇博"], "actors": [["https://p0.meituan.net/moviemachine/e2718dfbfa591ccf680f702d7f0f8386168837.jpg@128w_170h_1e_1c", "坂本龙一", "饰：Self"], ["https://p0.meituan.net/moviemachine/e2718dfbfa591ccf680f702d7f0f8386168837.jpg@128w_170h_1e_1c", "坂本龙一", "饰：Self"]]}
