{"movieId": "246388", "picture": "https://p0.meituan.net/movie/5aa97c7b5aa14db7dcc5f57b5dc2746329978.jpg@464w_644h_1e_1c", "name": "隐形人", "name2": "The Invisible", "type": [" 剧情 ", " 犯罪 ", " 奇幻 "], "place": "美国,瑞典", "length": "102分钟", "time": "2013-10-01优酷独播", "description": "高三学生尼克·鲍威尔的早上正常抵达学校开始一天的课程，然而让他感到震惊的是，所有的同学都不认识他，准确点来说是看不到他了。尼克惊恐地发现，自己不知道因为什么原因，而身陷生死两界的中间地带，他的灵魂脱离了肉体，在这个世界上不被人知地游荡着，他的状况是类似于死亡，却又不等同于死亡。渐渐地，尼克能够零星地回忆起之前发生的事情了：原来他在一天晚上受到了突然袭击，他那受到伤害的身体因为被人为地认定已经死亡，而留在了案发现场。虽然在地狱边上徘徊是一件非常可怕的事情，但尼克很快就接受了这个现实，他唯一想知道的，就是到底是谁把自己害成了这般模样，只有这样，他才有机会重新找回那个完整的自我。但是难题也摆在了尼克的面前，他必须要去解决一场受害者是他自己的谋杀案。发生在身体上的不可思议的新状态，使得尼克有机会从另一个角度去观察这个世界和那些曾经生活在他周围的人，他顺藤摸瓜地一点一点抠出凶杀背后的可怕真相，线索先指向他的妈妈，然后又指向他的好友，其中还经历了一个可疑的罪犯。最后，所有的疑点都集中在了一个名叫安妮的问题少女身上，原来她就是害死尼克的凶手。但呈透明状态的尼克的感觉也突然变得敏锐起来，他有理由相信，安妮并不只是一名少年犯那般简单，而是掌握着能够唤醒一切无法解释秘密的关键钥匙，让尼克更想不明白的是，他竟然爱上了这个人前张狂、人后落寞的美丽姑娘  。", "director": ["https://p1.meituan.net/movie/befb35dc5f7e6bfde3bfeb74cadee92027370.jpg@128w_170h_1e_1c", "大卫·S·高耶"], "actors": [["https://p1.meituan.net/movie/c17fc5f4dd57df67ddc676bfed90454436852.jpg@128w_170h_1e_1c", "玛格丽塔·列维耶娃", "饰：Annie Newton"], ["https://p0.meituan.net/movie/0117cec3b129a6ed85be52fa29ac5e9d44936.jpg@128w_170h_1e_1c", "马西娅·盖伊·哈登", "饰：Diane Powell"], ["https://p1.meituan.net/movie/57675c2b73403804c0978f329a35349c31265.jpg@128w_170h_1e_1c", "克里斯·马奎特", "饰：Pete Egan"], ["https://p0.meituan.net/movie/58c644d01f613e6125ea29d994d26b7d22480.jpg@128w_170h_1e_1c", "艾历克斯·奥洛林", "饰：Marcus Bohem"], ["https://p1.meituan.net/movie/c17fc5f4dd57df67ddc676bfed90454436852.jpg@128w_170h_1e_1c", "玛格丽塔·列维耶娃", "饰：Annie Newton"], ["https://p0.meituan.net/movie/0117cec3b129a6ed85be52fa29ac5e9d44936.jpg@128w_170h_1e_1c", "马西娅·盖伊·哈登", "饰：Diane Powell"], ["https://p1.meituan.net/movie/57675c2b73403804c0978f329a35349c31265.jpg@128w_170h_1e_1c", "克里斯·马奎特", "饰：Pete Egan"], ["https://p0.meituan.net/movie/58c644d01f613e6125ea29d994d26b7d22480.jpg@128w_170h_1e_1c", "艾历克斯·奥洛林", "饰：Marcus Bohem"], ["https://p1.meituan.net/movie/088215d1ab85e12b