{"movieId": "789", "picture": "https://p0.meituan.net/movie/8f588ccbb7040fcc7867ac7b79ec63ad314507.jpg@464w_644h_1e_1c", "name": "温蒂妮", "name2": "Undine", "type": [" 剧情 ", " 爱情 "], "place": "德国,法国", "length": "90分钟", "time": "2020-09-09爱奇艺独播", "description": "影片设定在当下的柏林，女主角温蒂妮是一名城市发展局的顾问。她的现任男友忽然提出分手，此时一个古老的诅咒似乎正要应验。中世纪的传说里，温蒂妮是水中的精灵，倘若与她们结合的男人背叛了她们，她们就会杀死男人并回归水中。电影的女主角想要抵抗这一诅咒，故而离开了柏林。此时她结识了克里斯多弗，一名在德国西部水库区工作的工业潜水员。两人相爱。不久后克里斯多弗察觉到，温蒂妮似乎在逃离什么，感觉受到了背叛... 《温蒂妮》是导演佩措尔德计划的“元素精灵三部曲”的第一部。接下来的两部将分别涉及气精灵西尔芙和地精灵诺姆。", "director": ["https://p0.meituan.net/movie/31719a331d93b721247b7a05cd32e1c430733.jpg@128w_170h_1e_1c", "克里斯蒂安·佩措尔德"], "actors": [["https://p0.meituan.net/moviemachine/70880d24e4a4979e9b0c872401ab406238944.jpg@128w_170h_1e_1c", "葆拉·贝尔", "饰：Undine Wibeau"], ["https://p1.meituan.net/movie/7a4dcaa75c83e7bd2b0e5015d76262e346295.jpg@128w_170h_1e_1c", "弗兰茨·罗戈夫斯基", "饰：Christoph"], ["https://p1.meituan.net/movie/e3d753659afdb446ab4b91f8170d2b11150906.jpg@128w_170h_1e_1c", "玛丽安·扎瑞", "饰：Monika"], ["https://p0.meituan.net/movie/ac423bccc91f1a2caddf2afea0c1d4de37261.jpg@128w_170h_1e_1c", "雅各布·马琛茨", "饰：Johannes"], ["https://p0.meituan.net/moviemachine/70880d24e4a4979e9b0c872401ab406238944.jpg@128w_170h_1e_1c", "葆拉·贝尔", "饰：Undine Wibeau"], ["https://p1.meituan.net/movie/7a4dcaa75c83e7bd2b0e5015d76262e346295.jpg@128w_170h_1e_1c", "弗兰茨·罗戈夫斯基", "饰：Christoph"], ["https://p1.meituan.net/movie/e3d753659afdb446ab4b91f8170d2b11150906.jpg@128w_170h_1e_1c", "玛丽安·扎瑞", "饰：Monika"], ["https://p0.meituan.net/movie/ac423bccc91f1a2caddf2afea0c1d4de37261.jpg@128w_170h_1e_1c", "雅各布·马琛茨", "饰：Johannes"], ["https://p1.meituan.net/moviemachine/9e5fadd695792366d03681e9d22aff6843492.jpg@128w_170h_1e_1c", "安妮·拉特-波利", "饰：Anna"], ["https://p0.meituan.net/movie/81337dee345993e86c7a5f1ff73178ac34104.jpg@128w_170h_1e_1c", "拉斐尔·斯塔霍维亚克", "饰：Jochen"], ["https://p1.meituan.net/movie/e0416326a01ea4c51d9cef1f51026e8618873.jpg@128w_170h_1e_1c", "格洛丽娅·安德雷斯·德·奥利维拉", null], ["https://p0.meituan.net/movie/36602bede2