{"movieId": "248918", "picture": "https://p1.meituan.net/movie/640cc32445df972b066c9a04b194da141104515.jpg@464w_644h_1e_1c", "name": "借东西的小人阿莉埃蒂", "name2": "借りぐらしのアリエッティ", "type": [" 动画 ", " 奇幻 ", " 冒险 "], "place": "日本", "length": "94分钟", "time": "2010-07-17日本上映", "description": "虽然患有心脏方面的疾病，但是少年翔（神木隆之介 配音）的父母依然对他疏于呵护。为了准备即将到来的手术，翔来到了位于偏远乡间的姨婆（竹下景子 配音）家静养。姨婆家位于一片幽静的丛林中，这是一幢有着上百年历史的欧式别墅。这里除了生活着姨婆和女佣阿春（树木希林 配音）外，还有一个奇特的三口之家，“借东西一族”——小人阿莉埃蒂（志田未来 配音）和她的爸爸（三浦友和 配音）妈妈（大竹忍 配音），他们生活在别墅的地板下，只有几公分高，过着不为人类察觉的生活。遇到所需的日常用品时，便会在夜深人静之时偷偷潜入厨房借出来。翔无意中瞥见阿莉埃蒂的身影，他有心接近这些传说中的小人，却不知不觉打扰了他们的生活…… 本片根据英国作家玛丽·诺顿的原著《借东西的小人》改编，并荣获2011年日本电影学院奖最佳动画片奖。", "director": ["https://p1.meituan.net/movie/ccc0d4f7b5733a27685080f0301e423c27517.jpg@128w_170h_1e_1c", "米林宏昌"], "actors": [["https://p1.meituan.net/moviemachine/0457b26152f31818bc5d3bb7e482e45f39663.jpg@128w_170h_1e_1c", "志田未来", "饰：阿莉埃蒂"], ["https://p1.meituan.net/movie/5a995164858cbc247dc33e89b24e5cbc44413.jpg@128w_170h_1e_1c", "神木隆之介", "饰：翔"], ["https://p0.meituan.net/movie/c494715757f1d40767438bd070e6314042342.jpg@128w_170h_1e_1c", "大竹忍", "饰：荷米莉"], ["https://p0.meituan.net/movie/61429a258d3066ae8a1ebd24144061f232587.jpg@128w_170h_1e_1c", "三浦友和", "饰：波德"], ["https://p1.meituan.net/moviemachine/0457b26152f31818bc5d3bb7e482e45f39663.jpg@128w_170h_1e_1c", "志田未来", "饰：阿莉埃蒂"], ["https://p1.meituan.net/movie/5a995164858cbc247dc33e89b24e5cbc44413.jpg@128w_170h_1e_1c", "神木隆之介", "饰：翔"], ["https://p0.meituan.net/movie/c494715757f1d40767438bd070e6314042342.jpg@128w_170h_1e_1c", "大竹忍", "饰：荷米莉"], ["https://p0.meituan.net/movie/61429a258d3066ae8a1ebd24144061f232587.jpg@128w_170h_1e_1c", "三浦友和", "饰：波德"], ["https://p1.meituan.net/movie/0727e647f1364bd9652c3635681d141618893.jpg@128w_170h_1e_1c", "竹下景子", "饰：贞子"], ["https://p1.meituan.net/movie/3bba97f9209d19d13795778612011a6639760.jpg@128w_170h_1e_1c", "树木希林", "饰：春"], ["https://p1.meituan.net/moviemachine/7ed55bf8046572a3d588eb12d74f0dd247697.jpg@128w_170h_1e_1c", "藤原龙也", "饰：斯莱碧"], ["https://p0.meituan.net/moviema