{"movieId": "84", "picture": "https://p0.meituan.net/movie/45ca387c7b3137c04ab625b764527f90412143.jpg@464w_644h_1e_1c", "name": "名侦探柯南：唐红的恋歌", "name2": "名探偵コナン から紅の恋歌", "type": [" 动画 ", " 悬疑 "], "place": "日本", "length": "112分钟", "time": "2017-04-15日本上映", "description": "阳光明媚的一天，柯南（高山南 配音）、小兰（山崎和佳奈 配音）以及少年侦探团的伙伴们随同毛利小五郎（小山力也 配音）来到大阪，参加在当地举行的“高中生皋月杯”百人一首和歌大赛。期间，他们还见到了彼此的好友服部平次（堀川亮 配音）和远山和叶（宫村优子 配音）。就在比赛进行中途，一封爆炸预告信送到电视台，警方迅速行动起来组织疏散。疏散一半时，爆炸突然发生，结果平次与和叶被困在建筑物中。而在一连串的混乱过后，一位皋月杯相关人员的尸体突然出现在众人面前。迷离的案情再度引起柯南的注意…… 本片根据青山刚昌的超人气漫画改编，系“名侦探柯南系列”第21部电影版。", "director": ["https://p0.meituan.net/movie/1aeff76fb79693f4252aba503bcfa82031617.jpg@128w_170h_1e_1c", "静野孔文"], "actors": [["https://p0.meituan.net/movie/1ab4867b2fa3e8c61b8d0a8a4a3dd58f113038.jpg@128w_170h_1e_1c", "堀川亮", "饰：服部平次"], ["https://p0.meituan.net/movie/ffec37a6c1dcbded88f8faa5310b1d5329579.jpg@128w_170h_1e_1c", "宫村优子", "饰：远山和叶"], ["https://p0.meituan.net/moviemachine/aae57007f9dd74a3c977c545a207a9f9115827.jpg@128w_170h_1e_1c", "山口胜平", "饰：Kudo Shinichi"], ["https://p1.meituan.net/moviemachine/aaede55e4a6da843539cf10f220de861114639.jpg@128w_170h_1e_1c", "山崎和佳奈", "饰：毛利兰"], ["https://p0.meituan.net/movie/1ab4867b2fa3e8c61b8d0a8a4a3dd58f113038.jpg@128w_170h_1e_1c", "堀川亮", "饰：服部平次"], ["https://p0.meituan.net/movie/ffec37a6c1dcbded88f8faa5310b1d5329579.jpg@128w_170h_1e_1c", "宫村优子", "饰：远山和叶"], ["https://p0.meituan.net/moviemachine/aae57007f9dd74a3c977c545a207a9f9115827.jpg@128w_170h_1e_1c", "山口胜平", "饰：Kudo Shinichi"], ["https://p1.meituan.net/moviemachine/aaede55e4a6da843539cf10f220de861114639.jpg@128w_170h_1e_1c", "山崎和佳奈", "饰：毛利兰"], ["https://p0.meituan.net/moviemachine/71fdf65776164df6545636ff961dc2be138537.jpg@128w_170h_1e_1c", "小山力也", "饰：毛利小五郎"], ["https://p1.meituan.net/movie/f2dcf1bd8a7d9e695f07c2aa37196a7f42773.jpg@128w_170h_1e_1c", "绪方贤一", "饰：阿笠博士"], ["https://p1.meituan.net/movie/8ca6a8e4bb9f660d4574933ba9239b2d33561.jpg@128w_170h_1e_1c", "岩居由希子", "饰：吉田歩美"], ["https://p0.meituan.net/movie/6ad2ef39d8d09d71a519abb9d