{"movieId": "1251207", "picture": "https://p0.meituan.net/movie/5bc05c507952b7a3ef7d88d4e4546a55705737.jpg@464w_644h_1e_1c", "name": "蜡笔小新：梦境世界大突击", "name2": "クレヨンしんちゃん 爆睡!ユメミーワールド大突撃", "type": [" 喜剧 ", " 动画 "], "place": "日本", "length": "97分钟", "time": "2016-11-04中国大陆上映", "description": "不知从何时起，春日部市的居民们突然进入了一个神秘的“梦之世界”。在那个梦的国度里，他们可以随心所欲做渴望已久的美梦。比如风间彻（真柴摩利 配音）变成了政治家，樱田妮妮（林玉绪 配音）化身为万众瞩目的偶像，佐藤正男（一龙斋贞友 配音）拥有了心仪的漫画书，阿呆（佐藤智惠 配音）则变成了石头。而我们的野原新之助同学（矢岛晶子 配音）呢……不出意料，果然想方设法在做一些下流低级的梦。梦，是让人心动和魅惑的世界。从那一天起，市民们乘坐每个人都拥有的梦之珠自由翱翔，在极乐的梦想中流连忘返，夜夜笙歌。没过几天，名叫贯庭玉咲（川田妙子 配音）的女孩随父母（安田显 & 吉濑美智子 配音）搬到了春日部市，并转学来到新之助的班级。不知为什么，就从咲来的那天开始，市民们的美梦渐渐被噩梦所代替。梦境中，他们或者变老、或者爱情遭到背叛、或者受人欺凌。人们一个接一个从梦境中惊醒，而且遭受噩梦侵扰的人越来越多。各位可怕的是，市民们的现实生活也受到严重影响。可怕的危机袭来，春日部防卫队的各位只有携手击败这一切背后的阴谋者！", "director": ["https://p0.meituan.net/movie/07a33581c4d0bde6094683b1ec7d67b511407.jpg@128w_170h_1e_1c", "高桥涉"], "actors": [["https://p1.meituan.net/movie/f45723e5a15bfdf283e7cc38e6d5401824708.jpg@128w_170h_1e_1c", "矢岛晶子", "饰：野原新之助（日语配音）Shinnosuke Nohara"], ["https://p1.meituan.net/movie/dd6e4226211b82acb50840090c1e4c6a31314.jpg@128w_170h_1e_1c", "楢桥美纪", "饰：小新母亲（日语配音）Misae Nohara"], ["https://p0.meituan.net/movie/3f33aa21677a9b9d18c28549b43dcf5a38208.jpg@128w_170h_1e_1c", "藤原启治", "饰：小新父亲（日语配音）Hiroshi Nohara"], ["https://p1.meituan.net/movie/cca01c1731f251cd8e7b03a205d56670107528.jpg@128w_170h_1e_1c", "兴梠里美", "饰：Himawari Nohara"], ["https://p1.meituan.net/movie/f45723e5a15bfdf283e7cc38e6d5401824708.jpg@128w_170h_1e_1c", "矢岛晶子", "饰：野原新之助（日语配音）Shinnosuke Nohara"], ["https://p1.meituan.net/movie/dd6e4226211b82acb50840090c1e4c6a31314.jpg@128w_170h_1e_1c", "楢桥美纪", "饰：小新母亲（日语配音）Misae Nohara"], ["https://p0.meituan.net/movie/3f33aa21677a9b9d18c28549b43dcf5a38208.jpg@128w_170h_1e_1c", "藤原启治", "饰：小新父亲（日语配音）Hiroshi Nohara"], ["https://p1.meituan.net/movie/cca01c1731f251cd8e7b03a205d56670107528.jpg@128w_170h_1e_1c", "兴梠里美", "饰：Himawari Nohara"], ["https://p1.meituan.net/movie/fd3a7bb5b72dc2ed80db5411ed7a50a212569.jpg@128w_170h_1e_1c", "吉濑美智子", "饰：贯庭玉咲