{"movieId": "672279", "picture": "https://p0.meituan.net/movie/8de585c7529086a94625d977f3ee8828357584.jpg@464w_644h_1e_1c", "name": "命运/冠位指定 MOONLIGHT/LOSTROOM", "name2": "Fate/Grand Order -MOONLIGHT/LOSTROOM-", "type": [" 剧情 ", " 动画 ", " 奇幻 "], "place": "日本", "length": "30分钟", "time": "2017-12-31日本上映", "description": "在公元2015年，一个魔术尚存的最后时代之中。人理继续保障机关「Chaldea」，透过近未来观测镜「Sheba」突然发现人类即将在接下来的2016年中毁灭。为了针对异象及时空特异典进行解析及干涉，他们利用被统称为「Grand Order」的禁忌仪式，将术师灵子化之后送回过去，只为阻止人类历史就此中断。 被扭曲的冬木圣杯战争，Saber（阿尔托利亚·潘德拉贡）黑化并杀掉Caster以外的所有从者顺道灭了整个冬木后在大空洞等待Caster的来临。这次战争的Caster为库·丘林，他个人表示如果职阶是Lancer就能秒杀黑Saber，因为主角，玛修和奥尔嘉玛丽的介入，成功停止了这场疯狂的圣杯战争，但Saber和Caster双双消失意味着这场战争没有人获得圣杯。关卡最后消灭了奥尔嘉玛丽灵魂的雷夫加上这次战争的Saber也认识Grand Order，到底是…？", "director": ["https://p0.meituan.net/movie/f5f37b8b843ab33b465794cdb55d24ab11812.jpg@128w_170h_1e_1c", "难波日登志"], "actors": [["https://p1.meituan.net/movie/a688777d4aea1f481fc16f69c56731c546755.jpg@128w_170h_1e_1c", "岛崎信长", null], ["https://p1.meituan.net/movie/9c33d54a83fb32d451aa19a7799c05dc16670.jpg@128w_170h_1e_1c", "高桥李依", null], ["https://p1.meituan.net/movie/65fdba42613ff3a195466462bdf5772625883.jpg@128w_170h_1e_1c", "铃村健一", null], ["https://p1.meituan.net/movie/9ff0d1e28f892d7badff502c864e374e72009.jpg@128w_170h_1e_1c", "米泽圆", null], ["https://p1.meituan.net/movie/a688777d4aea1f481fc16f69c56731c546755.jpg@128w_170h_1e_1c", "岛崎信长", null], ["https://p1.meituan.net/movie/9c33d54a83fb32d451aa19a7799c05dc16670.jpg@128w_170h_1e_1c", "高桥李依", null], ["https://p1.meituan.net/movie/65fdba42613ff3a195466462bdf5772625883.jpg@128w_170h_1e_1c", "铃村健一", null], ["https://p1.meituan.net/movie/9ff0d1e28f892d7badff502c864e374e72009.jpg@128w_170h_1e_1c", "米泽圆", null], ["https://p1.meituan.net/movie/eb2d4a5b145879b447b503b27bccccf746785.jpg@128w_170h_1e_1c", "杉田智和", null], ["https://p1.meituan.net/movie/ce63824b549e1393d5dc7ab39e30dde322910.jpg@128w_170h_1e_1c", "堀江瞬", null]]}
