{"movieId": "880237", "picture": "https://p0.meituan.net/movie/45f73cf0cf32a7d0bf47107f9e94795124123.jpg@464w_644h_1e_1c", "name": "花田喜事", "name2": "花田囍事", "type": [" 喜剧 ", " 爱情 ", " 古装 "], "place": "中国香港", "length": "85分钟", "time": "1993-01-20多平台上线", "description": "富家子弟周通（许冠杰 饰）武功高强，到处仗势凌人，其妹妹周吉（吴君如 饰）也十分无理取闹。他们的母亲太君（许冠英 饰）一直想他们定性并能够成家立室。可是在周吉的新婚之夜，夫君林嘉声（黄百鸣 饰）忍受不了周吉而逃走了。自此，太君便茶饭不思，周通于是为母亲办寿筵冲喜，更想请 著名魔术师大围高栢飞（张国荣 饰）助兴。与此同时白雪仙（关之琳 饰）乔装出来逛花市，与高栢飞一见钟情。白父（吴孟达 饰）得知事情后以为女儿已怀孕，便找到高柏飞提亲，却误以为周通就是高栢飞。当周通见过白雪仙之后，便誓要得到美人。母夜叉（毛舜筠 饰）从逃难的高栢飞与雪仙口中得知了他们的遭遇后，便假扮新娘教训周通。周吉的丈夫林嘉声成为了状元，周吉想与夫君和好，却遭到了林嘉声拒绝……", "director": ["https://p0.meituan.net/movie/083cc6066be345127f14b97a860877e521659.jpg@128w_170h_1e_1c", "高志森"], "actors": [["https://p0.meituan.net/movie/5de69a492dcbd3f4b014503d4e95d46c28837.jpg@128w_170h_1e_1c", "张国荣", "饰：高柏飞"], ["https://p0.meituan.net/moviemachine/809f7e006460f3494f17d96db679ff0e58512.jpg@128w_170h_1e_1c", "关之琳", "饰：白雪仙"], ["https://p1.meituan.net/movie/b255ee026894951108f2057adef8163640795.jpg@128w_170h_1e_1c", "许冠杰", "饰：周通"], ["https://p1.meituan.net/movie/04a49c61d5de95df0a069376e1c9f63741957.jpg@128w_170h_1e_1c", "毛舜筠", "饰：Jinx"], ["https://p0.meituan.net/movie/5de69a492dcbd3f4b014503d4e95d46c28837.jpg@128w_170h_1e_1c", "张国荣", "饰：高柏飞"], ["https://p0.meituan.net/moviemachine/809f7e006460f3494f17d96db679ff0e58512.jpg@128w_170h_1e_1c", "关之琳", "饰：白雪仙"], ["https://p1.meituan.net/movie/b255ee026894951108f2057adef8163640795.jpg@128w_170h_1e_1c", "许冠杰", "饰：周通"], ["https://p1.meituan.net/movie/04a49c61d5de95df0a069376e1c9f63741957.jpg@128w_170h_1e_1c", "毛舜筠", "饰：Jinx"], ["https://p1.meituan.net/movie/c0bd20b9683969878cb500a1f594004928100.jpg@128w_170h_1e_1c", "许冠英", "饰：Lady Chow"], ["https://p0.meituan.net/movie/bd462eb563c7c4e5605001c3e6b13ddd38902.jpg@128w_170h_1e_1c", "吴君如", "饰：周吉"], ["https://p0.meituan.net/movie/70307e42e8d6a6275ebfee462c8bc5b4129539.jpg@128w_170h_1e_1c", "黄百鸣", "饰：林嘉声"], ["https://p1.meituan.net/movie/13d4357722d33b46a9fa52fbe8316f9633831.jpg@1