{"movieId": "1240799", "picture": "https://p0.meituan.net/movie/13fd9d74429affb794f73f3ba2202d7594217.jpg@464w_644h_1e_1c", "name": "橙天", "name2": "Día naranja", "type": [" 喜剧 ", " 爱情 "], "place": "委内瑞拉,哥伦比亚,阿根廷", "length": "87分钟", "time": "2009-10-09委内瑞拉上映", "description": "Three women from different cities in Latin America, they simultaneously face the same challenge: an unexpected pregnancy. They do not know each other, but a golden and invisible thread links their lives. Their stories cross-relate and meet in different points, despite the distance. Each one in her own city, culture, and personal environment, will walk the streets, traversing fantasies, fears, desires and joys, looking for a door towards their new life, with as much glam our as they possibly can. A movie with many exhilarate and dramatic situations presented in an impeccable frame, driven by fashion, music, and a very feminine and sophisticated touch. Three accents, three colors, three kinds of sound, three cities. A movie as mandatory for women as wearing make-up.", "director": ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "AlejandraSzeplaki"], "actors": [["https://p0.meituan.net/movie/df32e07bd84a7878fdbbbb97c74fab6241080.jpg@128w_170h_1e_1c", "马丁娜·加西亚", "饰：Sol"], ["https://p1.meituan.net/movie/dddd5dc71db9df1aa931b21c1df31eff46249.jpg@128w_170h_1e_1c", "胡安·巴勃罗·拉瓦", "饰：Leo"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "CarolinaRiveros", "饰：Patricia"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "MartínBorisenko", "饰：Juan"], ["https://p0.meituan.net/movie/df32e07bd84a7878fdbbbb97c74fab6241080.jpg@128w_170h_1e_1c", "马丁娜·加西亚", "饰：Sol"], ["https://p1.meituan.net/movie/dddd5dc71db9df1aa931b21c1df31eff46249.jpg@128w_170h_1e_1c", "胡安·巴勃罗·拉瓦", "饰：Leo"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e