{"movieId": "22087", "picture": "https://p0.meituan.net/moviemachine/a33b757088d5ab7045748fc6005701b910656053.jpg@464w_644h_1e_1c", "name": "雷曼兄弟三部曲", "name2": "National Theatre Live: The Lehman Trilogy", "type": [" 剧情 "], "place": "英国", "length": "223分钟", "time": "2019-07-25英国上映", "description": "横跨近二百年延续子孙三代，《雷曼兄弟三部曲》讲述了改变世界的家族企业雷曼兄弟的传奇史诗。1844年九月的一个寒冷的早晨，一位来自巴伐利亚的年轻人站在纽约的码头边，梦想新世界的新生活。他的两个兄弟加入了他，一段美国奋斗史就此拉开序幕。163年后，他们建立的公司惨遭破产，并引发历史上最严重的金融危机……该剧原作由意大利人斯蒂法诺·马西尼创作，被翻译成11国语言并被搬上欧洲多个国家的舞台。 《雷曼兄弟三部曲》英语版由奥斯卡奖获奖导演萨姆·门德斯（电影《美国丽人》《007：大破天幕杀机》、戏剧《李尔王》《摆渡人》）执导，英国国家剧院联合艺术总监本·鲍尔翻译并操刀改编剧本，三位英国演技派代表——两度奥利弗奖得主西蒙·拉塞尔·比尔、托尼奖提名演员本·迈尔斯及亚当·戈德利玩转整个舞台，饰演全部角色。 该剧作为2018年英国国家剧院提早售罄的口碑新剧，2019年转西区再续火爆票房，喜提奥利弗奖最佳新剧、最佳话剧男主角等五项提名，给出五星好评的《卫报》盛赞：“无与伦比的夜晚，教科书般的演技”，同样打出五星的《泰晤士报》充分肯定了萨姆·门德斯导演的编排，交出了“戏剧最好的模样”。", "director": ["https://p1.meituan.net/movie/c5f9fb1ba48be59906dd7eba594ab66448030.jpg@128w_170h_1e_1c", "萨姆·门德斯"], "actors": [["https://p0.meituan.net/movie/109ef413dfe2eb338de688660689cb5a39287.jpg@128w_170h_1e_1c", "西蒙·拉塞尔·比尔", null], ["https://p0.meituan.net/movie/cd5372c9eadc42ca92a7e31a43cd69dd29759.jpg@128w_170h_1e_1c", "亚当·戈德利", null], ["https://p0.meituan.net/movie/1fff6b80c6f55f0fe92efe8e53e1f85e36834.jpg@128w_170h_1e_1c", "本·迈尔斯", null], ["https://p0.meituan.net/movie/109ef413dfe2eb338de688660689cb5a39287.jpg@128w_170h_1e_1c", "西蒙·拉塞尔·比尔", null], ["https://p0.meituan.net/movie/cd5372c9eadc42ca92a7e31a43cd69dd29759.jpg@128w_170h_1e_1c", "亚当·戈德利", null], ["https://p0.meituan.net/movie/1fff6b80c6f55f0fe92efe8e53e1f85e36834.jpg@128w_170h_1e_1c", "本·迈尔斯", null]]}
