{"movieId": "1353130", "picture": "https://p0.meituan.net/movie/2e36271d6be91721181f192bc2b168bc388333.jpg@464w_644h_1e_1c", "name": "大卫贝肯之倒霉特工熊", "name2": "Backkom Bear:Agent 008", "type": [" 喜剧 ", " 动画 ", " 家庭 ", " 冒险 "], "place": "中国大陆", "length": "90分钟", "time": "2017-01-13中国大陆上映", "description": "随着人类对自然资源的过度开采，北极的环境被完全破坏，只剩下最后一只北极熊得以存活。人类女孩杰西卡收养了这只北极熊，为他取名贝肯。杰西卡是安全部非常出色的特工。贝肯虽然也梦想当一名特工，但体态笨拙又总是闯祸的他只能在安全部做清洁工作。突然出现的北极熊神秘组织在全世界布下了炸弹，声称要报复人类。为了解除炸弹威胁，人类最高决策机构——全球联盟派遣安全部特工潜入北极熊基地，却不料基地里有人类探测仪致使潜入失败。全球联盟只好将贝肯训练成特工并派往北极熊基地。杰西卡担心贝肯的安危，偷偷伴随。贝肯和杰西卡在北极熊基地里遇到了重重关卡，却总是能够阴差阳错地化险为夷。虽然他们最终解除了炸弹危机，贝肯却被抓。神秘组织的首领向贝肯揭示了惊人的真相…而全球联盟正准备放弃贝肯，向北极熊组织发动全面进攻…", "director": ["https://p0.meituan.net/movie/54dd3b7463a8cc337702f159c18192bb17560.jpg@128w_170h_1e_1c", "李清舫"], "actors": [["https://p0.meituan.net/movie/e200d2d64dd3e0374081e36247c8543c5966.jpg@128w_170h_1e_1c", "汤水雨", null], ["https://p0.meituan.net/movie/28a873de2725565051edf622e2aa09c512126.jpg@128w_170h_1e_1c", "徐佳琦", "饰：Jessica"], ["https://p0.meituan.net/movie/fdb899904a2e3d517a4c04ac0ad1eca834086.jpg@128w_170h_1e_1c", "杨默", null], ["https://p0.meituan.net/movie/e200d2d64dd3e0374081e36247c8543c5966.jpg@128w_170h_1e_1c", "汤水雨", null], ["https://p0.meituan.net/movie/28a873de2725565051edf622e2aa09c512126.jpg@128w_170h_1e_1c", "徐佳琦", "饰：Jessica"], ["https://p0.meituan.net/movie/fdb899904a2e3d517a4c04ac0ad1eca834086.jpg@128w_170h_1e_1c", "杨默", null], ["https://p1.meituan.net/movie/976b5cb698845b162d09f84f712c57d7152871.jpg@128w_170h_1e_1c", "张遥函", null], ["https://p0.meituan.net/movie/823076e72c0f6553b3ed25d01b6598e2134817.jpg@128w_170h_1e_1c", "刘琮", null], ["https://p1.meituan.net/movie/bd500cad39d32b3d4882e56d74f3252628635.jpg@128w_170h_1e_1c", "墨阳", null], ["https://p0.meituan.net/movie/775aafcbb90ef31cda430e51a08aa40a187852.jpg@128w_170h_1e_1c", "许佳琪", "饰：Jessica"]]}
