{"movieId": "57212", "picture": "https://p0.meituan.net/movie/d9987ccd75eaa4db14d86d212523fa2c689954.jpg@464w_644h_1e_1c", "name": "圆梦巨人", "name2": "The BFG", "type": [" 冒险 ", " 家庭 ", " 奇幻 "], "place": "美国", "length": "117分钟", "time": "2016-10-14中国大陆上映", "description": "孤儿院里一个名叫苏菲 （鲁比·巴恩希尔饰）的小女孩一天夜里睡不着觉， 她在“巫师出没的时刻”看到一个和楼房一样高大的巨人沿街走过来。巨人发现苏菲看见了他，于是便把她拎回了巨人国。这个巨人是好心眼儿巨人 （马克·里朗斯饰），好心眼儿巨人专门搜集好梦，把梦分门别类地装在一个个玻璃瓶子里，再挨家挨户地把捕捉来的好梦吹到孩子们睡觉的卧室里。他与其他巨人国中的巨人不一样。其他巨人都吃人，他只吃自己种植的食物。为了阻止其他巨人继续吃人，聪明的苏菲她让BFG调制出一个关于巨人吃小孩的噩梦，并想要把这个梦吹到英国女王 （佩内洛普·威尔顿饰）的卧室里。两人由此开始了一段奇幻的冒险之旅。一路上，他们面临着巨人国吃人巨人们的重重威胁；与此同时，小女孩与好心眼儿巨人也从一开始的彼此不信任，成长出一场非同寻常的友谊  。", "director": ["https://p1.meituan.net/movie/bacad05d68f523f761822ab3cdb4c05657519.jpg@128w_170h_1e_1c", "史蒂文·斯皮尔伯格"], "actors": [["https://p1.meituan.net/movie/b51133f51e7964fa46efada1709af89e49168.jpg@128w_170h_1e_1c", "马克·里朗斯", "饰：好心眼的巨人 BFG"], ["https://p1.meituan.net/movie/477830d2968c176c477cb1691c99f264137372.jpg@128w_170h_1e_1c", "鲁比·巴恩希尔", "饰：苏菲 Sophie"], ["https://p0.meituan.net/movie/6c87f4a213ef197ec1d668b90991349636611.jpg@128w_170h_1e_1c", "黄磊", "饰：好心眼巨人（国语配音）"], ["https://p1.meituan.net/movie/894e2060554277f5ed21f587d751029c44255.jpg@128w_170h_1e_1c", "黄忆慈", "饰：苏菲（国语配音）"], ["https://p1.meituan.net/movie/b51133f51e7964fa46efada1709af89e49168.jpg@128w_170h_1e_1c", "马克·里朗斯", "饰：好心眼的巨人 BFG"], ["https://p1.meituan.net/movie/477830d2968c176c477cb1691c99f264137372.jpg@128w_170h_1e_1c", "鲁比·巴恩希尔", "饰：苏菲 Sophie"], ["https://p0.meituan.net/movie/6c87f4a213ef197ec1d668b90991349636611.jpg@128w_170h_1e_1c", "黄磊", "饰：好心眼巨人（国语配音）"], ["https://p1.meituan.net/movie/894e2060554277f5ed21f587d751029c44255.jpg@128w_170h_1e_1c", "黄忆慈", "饰：苏菲（国语配音）"], ["https://p1.meituan.net/moviemachine/ccc794b14edfc68b2bf4261b790f2156157717.jpg@128w_170h_1e_1c", "比尔·哈德尔", "饰：Bloodbottler"], ["https://p0.meituan.net/movie/fbf8e9702a5a9c8e1994663f7eab0a7525999.jpg@128w_170h_1e_1c", "丽贝卡·豪尔", "饰：Mary"], ["https://p0.meituan.net/movie/780a4380ac61f1cb48eb7740d187f09543821.jpg@128