{"movieId": "882", "picture": "https://p0.meituan.net/movie/d9ea22743286f310f1859b0681164c40253038.jpg@464w_644h_1e_1c", "name": "天若有情", "name2": "A Moment of Romance", "type": [" 剧情 ", " 动作 ", " 爱情 "], "place": "中国香港", "length": "87分钟", "time": "1990-06-14多平台上线", "description": "华仔 （刘德华饰）是舞女的私生子，母亲为情跳楼自杀，把他扔给一班舞女抚养，于是华仔自幼便与黑社会混在一起，但他对大哥和朋友都有情有义。一日，华仔受大哥所托去替另一伙黑社会头目喇叭 （黄光亮饰）的抢劫行动做接应，在混乱中 挟持了无辜的Jojo （吴倩莲饰）做人质。成功逃脱后，喇叭等人意图杀Jojo灭口，华仔以性命保证Jojo不会出卖他们。后来他用摩托带Jojo离开，并把逃跑用的车焚毁。警察根据Jojo在现场留下的手袋找到她，要求她认人，Jojo没有供出他们。但警方已有线报，知道是华仔参与，苦无证据。而喇叭一伙也疑心Jojo会报警，由此，华仔得罪了黑白两道。在一次又一次的接触中，华仔与Jojo渐生情愫，相处甚欢。奈何Jojo的父母由国外返港，知道后百般阻挠，并要送Jojo出国读书。华仔为避Jojo，到澳门外公处，Jojo亦追到澳门，在这里他们渡过了生命中最快乐无忧的日子。　　 然而好景不长，Jojo的母亲告华仔拐带少女，华仔不得已和Jojo返港。此时，喇叭一伙与华仔的大哥七哥的斗争也日益激烈，喇叭意图除去他们，于是设下鸿门宴，约华仔和他大哥等人在上海饭店吃饭。喇叭在饭店埋伏很多手下并暗算七哥等人。华仔的大哥舍命保护华仔，自己却惨死。华仔决心为大哥报仇，临行前去找Jojo。当晚Jojo正被母亲押去机场，在保姆的掩护下，Jojo和华仔一起跑了。他们砸了一家婚纱店的橱窗，换上了婚纱和 礼服，并到教堂。就在Jojo跪地祈祷时，华仔飞车去找喇叭复仇。Jojo听到了马达声，提起婚纱一路追去。而华仔则与喇嘛同归于尽。", "director": ["https://p0.meituan.net/moviemachine/9dd823f65fde9c399673c86f1e2b483426470.jpg@128w_170h_1e_1c", "陈木胜"], "actors": [["https://p0.meituan.net/moviemachine/9312e90f25f5ad40f2ceb4561f6fa08830409.jpg@128w_170h_1e_1c", "刘德华", "饰：华弟"], ["https://p0.meituan.net/movie/cbdc35c822d42df45d8ebdea53d8b3c341323.jpg@128w_170h_1e_1c", "吴倩莲", "饰：JoJo"], ["https://p1.meituan.net/movie/13d4357722d33b46a9fa52fbe8316f9633831.jpg@128w_170h_1e_1c", "吴孟达", "饰：太保"], ["https://p0.meituan.net/movie/5ee46a1378ae80e9b51bee1960fe2c0c36554.jpg@128w_170h_1e_1c", "黄光亮", "饰：喇叭"], ["https://p0.meituan.net/moviemachine/9312e90f25f5ad40f2ceb4561f6fa08830409.jpg@128w_170h_1e_1c", "刘德华", "饰：华弟"], ["https://p0.meituan.net/movie/cbdc35c822d42df45d8ebdea53d8b3c341323.jpg@128w_170h_1e_1c", "吴倩莲", "饰：JoJo"], ["https://p1.meituan.net/movie/13d4357722d33b46a9fa52fbe8316f9633831.jpg@128w_170h_1e_1c", "吴孟达", "饰：太保"], ["https://p0.meituan.net/movie/5ee46a1378ae80e9b51bee1960fe2c0c36554.jpg@128w_170h_1e_1c", "黄光亮", "饰：喇叭"], ["https://p0.meituan.net/movie/928582cda4fedbe35b3bd3