{"movieId": "1356487", "picture": "https://p0.meituan.net/movie/1414f7d1b2f3228abaf0ff33f3aeada6701713.jpg@464w_644h_1e_1c", "name": "十字路口", "name2": "クロスロード", "type": [" 剧情 ", " 动画 ", " 短片 "], "place": "日本", "length": "2分钟", "time": "2014日本上映", "description": "“也不是为了活的幸福，也并非想要明确的约定。比起那个来说，遥远地方的某处，是我们向往前去的地方。”无论身处关东还是关西，无论是喧嚣的繁华都市还是僻静的海港小镇，都有着普普通通的少女，为了各自心中的理想而努力。女孩海帆和男孩翔太从未忘却心头的理想，也知晓前路的曲折与艰辛。他们通过Z-KAI的通信教育在知识的海洋中破浪前行，享受着每一次好成绩取得时所带来的喜悦，惴惴地等待着最终考验的到来，又沉着专注地和万千学子们投入命运的战斗中去。十字路口，他们没有彷徨和失落，因为前方的灯塔早已照亮人生的方向…… 本片为新海诚受通信教育机构Z-KAI为广大学子拍摄的应援动画。", "director": ["https://p1.meituan.net/movie/249e7a7481c0dbe4d2e20b0d7d66465e36249.jpg@128w_170h_1e_1c", "新海诚"], "actors": [["https://p1.meituan.net/moviemachine/5738dfbb189ed65bde3c27d86276aa4f48704.jpg@128w_170h_1e_1c", "佐仓绫音", "饰：Miho"], ["https://p0.meituan.net/moviemachine/a32ca13a6cb30f57875cef49d5490b20176216.jpg@128w_170h_1e_1c", "小野贤章", "饰：Shota"], ["https://p0.meituan.net/movie/7a551e2ccefea595a4ecc893d2da59a716771.jpg@128w_170h_1e_1c", "MasahikoTanaka", "饰：Instructor"], ["https://p1.meituan.net/moviemachine/5738dfbb189ed65bde3c27d86276aa4f48704.jpg@128w_170h_1e_1c", "佐仓绫音", "饰：Miho"], ["https://p0.meituan.net/moviemachine/a32ca13a6cb30f57875cef49d5490b20176216.jpg@128w_170h_1e_1c", "小野贤章", "饰：Shota"], ["https://p0.meituan.net/movie/7a551e2ccefea595a4ecc893d2da59a716771.jpg@128w_170h_1e_1c", "MasahikoTanaka", "饰：Instructor"]]}
