{"movieId": "428", "picture": "https://p0.meituan.net/movie/5a6ad402a80db2cddd92316343f3ea1c469775.jpg@464w_644h_1e_1c", "name": "虎兄虎弟", "name2": "Deux frères", "type": [" 剧情 ", " 冒险 "], "place": "法国,英国", "length": "109分钟", "time": "2004-04-07多平台上线", "description": "20世纪20年代的法属殖民地印度支那，声名狼藉的英国猎手艾丹·迈克拉里 （ 盖·皮尔斯 饰）本以猎取象牙为 生，但却在一次猎杀行动中发现了老虎一家，这对他们来说简直是一场意外的收获。在捕杀了幼虎戈莫和桑哈的父亲后，尽管幼虎的妈妈曾经两次试图救回她的孩子，但是残酷的命运还是将这对双胞胎虎兄弟分开了。戈莫和桑哈，一个羞怯而温和，一个粗暴而凶猛。分开后凶猛的哥哥戈莫被卖到了马戏团，在那里，思乡病与被圈养在笼子中的生活掳走了戈莫的锐气。而温和的弟弟桑哈处境则稍好一些，成为了当地法籍长官尤因·诺曼丁 （ 让·克劳德·德夫斯 饰）那孤单的儿子拉奥 （ 弗雷迪·海默 饰）的宠物与玩伴。诺曼丁打算把附近的丛林发展成旅游景点，但是这必须要得到他的上级的同意，于是这个家庭将桑哈送去培养成“斗士”参加比赛，取悦他的上级。当两只老虎长大成熟后，它们再次相遇，只不过这一次他们不再是兄弟而是敌人.当戈莫和桑哈在斗兽场上骨肉相认时，面对皮鞭、棍棒、枪口，这一对虎兄弟不畏淫威，毅然罢斗。那一刻，两双虎眼睛深情对视着，水一般柔，眸子里闪回着儿时的往事，泪光晶莹。最后，两只老虎逃出了牢笼，回到了丛林。但是它们却对当地的村庄构成了潜在的威胁，诺曼丁派迈克拉里去把它们杀掉，可当迈克拉里看见这两只老虎快乐地回到属于它们的那片丛林时，他再也不能下手，不能允许自己完成任务，于是，他把戈莫和桑哈留给了属于它们的命运，转身离去  。", "director": ["https://p1.meituan.net/movie/dcc28e956a2449096b52ae4d2a77e7a0159631.jpg@128w_170h_1e_1c", "让-雅克·阿诺"], "actors": [["https://p0.meituan.net/movie/60ec744d23a7cfea7fa9d88798d8b9d731410.jpg@128w_170h_1e_1c", "盖·皮尔斯", "饰：艾丹 Aidan McRory"], ["https://p0.meituan.net/movie/7417c09215c30effc60c7f2a21b6706250111.jpg@128w_170h_1e_1c", "让-克洛德·德雷菲斯", "饰：Administrator Normandin"], ["https://p1.meituan.net/movie/478fae81a219cba865f40b4e72b47e4f87595.jpg@128w_170h_1e_1c", "弗莱迪·海默", "饰：拉乌尔小时候 Young Raoul"], ["https://p0.meituan.net/movie/5c74247e59d0f5c5e8b11929af4934a730848.jpg@128w_170h_1e_1c", "OanhNguyen", "饰：His Excellency"], ["https://p0.meituan.net/movie/60ec744d23a7cfea7fa9d88798d8b9d731410.jpg@128w_170h_1e_1c", "盖·皮尔斯", "饰：艾丹 Aidan McRory"], ["https://p0.meituan.net/movie/7417c09215c30effc60c7f2a21b6706250111.jpg@128w_170h_1e_1c", "让-克洛德·德雷菲斯", "饰：Administrator Normandin"], ["https://p1.meituan.net/movie/478fae81a219cba865f40b4e72b47e4f87595.jpg@128w_170h_1e_1c", "弗莱迪·海默", "饰：拉乌尔小时候 Young Raoul"], ["https://p0.meituan.net/movie/5c74247e59d0f5c5e8b11929af4934a730848.jpg@128w_170h_1e_1c", "OanhNguyen", "饰：Hi