{"movieId": "246714", "picture": "https://p1.meituan.net/movie/6b83635cb61501d325c4300e2ecb4377419162.jpg@464w_644h_1e_1c", "name": "一生一世", "name2": "But Always", "type": [" 爱情 "], "place": "中国大陆,中国香港", "length": "106分钟", "time": "2014-09-05中国大陆上映", "description": "上世纪七十年代的中国，动荡不安，在 北京凛冽的寒风中，赵永远 （ 谢霆锋 ）和安然 （ 高圆圆 ）一生的情缘拉开了帷幕。童年的不幸让两个幼小而纯真的心灵相互靠近，两人来自不同的家庭，却有着相似的际遇，他们两小无猜、相伴相随中孕育出温情。世间总是充满悲欢离合，忽然间，他们被命运安排到天各一方，童年的 友谊戛然而止，但这仅仅是聚散离合的开始。九十年代的中国正在翻天覆地的变化，当赵永远再次见到安然时，她已成为 亭亭玉立的大学生，两人封存多年的友谊迅速转化成爱情。为他们的爱情增添了巡礼的热烈和浪漫，青春在飞扬中对未来充满憧憬。赵永远和安然站道人生的十字路口，但两人坚信爱情和理想可以融为一体，年轻的他们立下海誓山盟，并确定自己一定可以做到：时间和距离都不能阻挡他们的爱，他们要为彼此守候，但上天再一次跟他们开了一个玩笑。岁月流转，数年之后，赵永远和安然已各安天命，但命运让他们再次相遇在 纽约。平静的假象被击得粉碎，两人意识到心底的一丝牵挂承受了深爱，从凌乱纠葛到 难舍难分，他们发现依然无法割舍对彼此的感情。但谁又有勇气改变命运的安排？谁又能想到接下来又有什么事情发生在他们之间。", "director": ["https://p1.meituan.net/movie/eaa05404b7f046044ac6c972119207d932910.jpg@128w_170h_1e_1c", "邹佡"], "actors": [["https://p0.meituan.net/movie/1b3fb6032c9499de15e6d1a05fce035260860.jpg@128w_170h_1e_1c", "谢霆锋", "饰：赵永远"], ["https://p1.meituan.net/movie/db26d86288f67f36ae5b566b0d4f36ce41840.jpg@128w_170h_1e_1c", "高圆圆", "饰：安然"], ["https://p1.meituan.net/movie/19092580ef8e734540a8023f585c24c250143.jpg@128w_170h_1e_1c", "杜海涛", "饰：孙跃进"], ["https://p0.meituan.net/movie/aa4e636f4b077f681b268fcad93942dc48228.jpg@128w_170h_1e_1c", "洛诗", "饰：李晓君"], ["https://p0.meituan.net/movie/1b3fb6032c9499de15e6d1a05fce035260860.jpg@128w_170h_1e_1c", "谢霆锋", "饰：赵永远"], ["https://p1.meituan.net/movie/db26d86288f67f36ae5b566b0d4f36ce41840.jpg@128w_170h_1e_1c", "高圆圆", "饰：安然"], ["https://p1.meituan.net/movie/19092580ef8e734540a8023f585c24c250143.jpg@128w_170h_1e_1c", "杜海涛", "饰：孙跃进"], ["https://p0.meituan.net/movie/aa4e636f4b077f681b268fcad93942dc48228.jpg@128w_170h_1e_1c", "洛诗", "饰：李晓君"], ["https://p1.meituan.net/movie/08c910b0a5dcf016c179762989de2e4a84322.jpg@128w_170h_1e_1c", "秦昊", "饰：迈克尔"], ["https://p1.meituan.net/movie/6a56840d6467db4ec68bd00bbab9657435881.jpg@128w_170h_1e_1c", "林雪", "饰：老李"], ["https://p0.meituan.net/movie/08492062298d3fbd