{"movieId": "405", "picture": "https://p1.meituan.net/movie/ed50b58bf636d207c56989872a91f4cf305138.jpg@464w_644h_1e_1c", "name": "我爱你", "name2": "그대를 사랑합니다", "type": [" 剧情 ", " 爱情 "], "place": "韩国", "length": "118分钟", "time": "2011-02-17腾讯视频独播", "description": "每天清晨骑着摩托车送牛奶的金万石嘴边总是挂着脏话，但其实是个热心肠的人。有一天，万石在上坡的时候偶遇了靠收废纸为生，孤独且艰辛的宋怡芬，并在孙女金妍儿的穿针引线下，对她产生了特殊的感情。在停车场工作的张君峰的妻子患有老年痴呆症。他每天早出晚归工作，回到家后就尽心照顾妻子。然而妻子却将不久于人世。君峰深爱着自己的妻子，因此悲痛无比。他想帮妻子减轻痛苦，同时他也无法接受没有妻子陪伴的日子，最后决定同妻子一起离开这个世界。他将门窗仔细封好，坐在妻子身边，笑着对她说一起走过了这么长的一辈子，下辈子还要娶她，妻子摇摇头说你永远都在为我付出而我却不能为你做什么，我不能再拖累你了。躺在妻子身边，握着她的手，平静地等待最后时刻的到来。老友夫妇的死对怡芬触动很大，她深爱着万石，不想失去他，但他已临近生命的终点，她不能承受死亡将他们分开，思虑再三，决定自己独自带着最美好的回忆回到老家，慢慢老去。万石起先无法接受，后来还是理解了她的选择，并决定送她回家。在她的老宅前，两人互相望着对方，千言万语都包含在着最后的凝望中。两人唯一的一次拥抱，深深的一抱，不禁都老泪纵横。随着握着的双手渐渐地分开，一段恋情就此慢慢地飘散开来，又在两人的心中汇聚，尘封在记忆之中。弥留之际，万石仿佛看到自己骑着摩托，来到怡芬的老宅前，载着她越过田野，越过山谷，越过天空，去往他们的天堂。老人带着一脸的满足，微笑着离去。", "director": ["https://p1.meituan.net/movie/c4b93eae0a7b4b0c9f20cf4c0a748f8938800.jpg@128w_170h_1e_1c", "秋昌旼"], "actors": [["https://p1.meituan.net/movie/64a3e376474a5d83e5cbdedba0ec2e2431541.jpg@128w_170h_1e_1c", "宋在浩", "饰：张君奉"], ["https://p1.meituan.net/movie/bab1d10e8fe6634f5e2406ff5c7a210035025.jpg@128w_170h_1e_1c", "李顺才", "饰：金万石"], ["https://p1.meituan.net/movie/9758a6e21831f41f320e504e3113ced228476.jpg@128w_170h_1e_1c", "尹秀晶", "饰：宋怡芬"], ["https://p1.meituan.net/movie/64a3e376474a5d83e5cbdedba0ec2e2431541.jpg@128w_170h_1e_1c", "宋在浩", "饰：张君奉"], ["https://p1.meituan.net/movie/bab1d10e8fe6634f5e2406ff5c7a210035025.jpg@128w_170h_1e_1c", "李顺才", "饰：金万石"], ["https://p1.meituan.net/movie/9758a6e21831f41f320e504e3113ced228476.jpg@128w_170h_1e_1c", "尹秀晶", "饰：宋怡芬"], ["https://p1.meituan.net/movie/1f75a1d4ae1aaf1ba081109b6d2f3ecd39495.jpg@128w_170h_1e_1c", "金秀美", "饰：张君奉的妻子"], ["https://p1.meituan.net/movie/a47fe1adff4105b743bb746e1ccbc3cc47227.jpg@128w_170h_1e_1c", "宋智孝", "饰：金妍儿"], ["https://p0.meituan.net/movie/a3937ce2e6ae57232ff62255dd14728044053.jpg@128w_170h_1e_1c", "吴达洙", "饰：达秀"], ["https://p1.meituan.net/movie/b0ed282b7dc6907d