{"movieId": "78826", "picture": "https://p1.meituan.net/movie/5bf4549bbde3462252a5e268eb8e45c841679.jpg@464w_644h_1e_1c", "name": "灌篮高手 剧场版4", "name2": "スラムダンク 吠えろバスケットマン魂!! 花道と流川の熱き夏", "type": [" 剧情 ", " 动画 ", " 运动 "], "place": "日本", "length": "40分钟", "time": "1995-07-15日本上映", "description": "正值炎炎夏日，地处海滨的湘北也被全国大赛的热情所点燃。与海南的艰苦鏖战，让曾经不甚起眼的湘北高中篮球部一战成名。在众多现场观众中，流川枫在富丘中学的学弟水泽一郎也见证了这激动人心的一刻。自从流川毕业后，水泽已经成为富中的顶梁柱，他不断磨练自己的球技，期待早日考入湘北和前辈流川一同称霸全国。而就在此刻，水泽遭遇人生最大的打击。他被诊断患上关节结核，剧烈的疼痛让他面临放弃篮球的命运。为了让水泽毫无遗憾的离开球场，走上手术台，他的姐姐茜找到晴子，希望能安排弟弟和流川共同打一场练习赛以了心愿…… 本片根据井上雄彦的同名漫画改编，为该动画的第四部剧场版。", "director": ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "明比正行"], "actors": [["https://p1.meituan.net/movie/6837de4355f730f2539d693df10d2e6929065.jpg@128w_170h_1e_1c", "草尾毅", null], ["https://p1.meituan.net/movie/3fafc41ac47b12c5b967bf3dcaca66e78230.jpg@128w_170h_1e_1c", "平松晶子", null], ["https://p0.meituan.net/movie/2ab7277b4f592e5f60af60df6eb8f4054857.jpg@128w_170h_1e_1c", "梁田清之", null], ["https://p0.meituan.net/movie/91c36830e4eeb403d9afa50a23dabf5214646.jpg@128w_170h_1e_1c", "里内信夫", "饰：角田悟"], ["https://p1.meituan.net/movie/6837de4355f730f2539d693df10d2e6929065.jpg@128w_170h_1e_1c", "草尾毅", null], ["https://p1.meituan.net/movie/3fafc41ac47b12c5b967bf3dcaca66e78230.jpg@128w_170h_1e_1c", "平松晶子", null], ["https://p0.meituan.net/movie/2ab7277b4f592e5f60af60df6eb8f4054857.jpg@128w_170h_1e_1c", "梁田清之", null], ["https://p0.meituan.net/movie/91c36830e4eeb403d9afa50a23dabf5214646.jpg@128w_170h_1e_1c", "里内信夫", "饰：角田悟"]]}
{"movieId": "249008", "picture": "https://p1.meituan.net/movie/20b81c48788d6f73a07fec370baabad4103840.jpg@464w_644h_1e_1c", "name": "爱在日落黄昏时", "name2": "Before Sunset", "type": [" 剧情 ", " 爱情 "], "place": "美国", "length": "80分钟", "time": "2015-04-20中国大陆上映", "description": "影片讲述了九年过后一段缘分的再续。维也纳浪漫一夜过去九年后，赛琳（朱丽·德尔比 饰）和杰西（伊桑·霍克 饰）终于在巴黎再次相遇。九年过去了，杰西已成为畅销书作家，而赛琳则在环保组织工作。杰西在巴黎的莎士比亚书店举行他在欧洲的最后一站新书发布会，书中写的就是他和赛琳在维也纳发生的故事，恰好，赛琳就出现在了观众席上。他们只有一下午的时间，日落之前杰西就要飞回美国。这个下午，他们在午后的巴黎街头散步，在美丽的赛纳河上泛舟……他们无所不谈，好似从未分开……", "director": ["https://p1.meituan.net/movie/2c08b97e2ec1c7476b3103f928576d8441733.jpg@128w_170h_1e_1c", "理查德·林克莱特"], "actors": [["https://p1.meituan.net/movie/3557fcf59b297f2ba7f98ceb9b26cbba53090.jpg@128w_170h_1e_1c", "伊桑·霍克", "饰：杰西 Jesse"], ["https://p0.meituan.net/movie/fb31aae6c5d379b40c99c2901df787f646278.jpg@128w_170h_1e_1c", "朱莉·德尔佩", "饰：赛琳 Celine"], ["https://p0.meituan.net/movie/a5e2da80c4901042ac76c839fdae41c840125.jpg@128w_170h_1e_1c", "弗农·多布切夫", "饰：书店经理 Bookstore Manager"], ["https://p0.meituan.net/movie/4c16569bffa9bf55a1c1051bc15a934b49940.jpg@128w_170h_1e_1c", "路易丝·勒莫瓦纳·托雷斯", "饰：记者甲 Journalist #1"], ["https://p1.meituan.net/movie/3557fcf59b297f2ba7f98ceb9b26cbba53090.jpg@128w_170h_1e_1c", "伊桑·霍克", "饰：杰西 Jesse"], ["https://p0.meituan.net/movie/fb31aae6c5d379b40c99c2901df787f646278.jpg@128w_170h_1e_1c", "朱莉·德尔佩", "饰：赛琳 Celine"], ["https://p0.meituan.net/movie/a5e2da80c4901042ac76c839fdae41c840125.jpg@128w_170h_1e_1c", "弗农·多布切夫", "饰：书店经理 Bookstore Manager"], ["https://p0.meituan.net/movie/4c16569bffa9bf55a1c1051bc15a934b49940.jpg@128w_170h_1e_1c", "路易丝·勒莫瓦纳·托雷斯", "饰：记者甲 Journalist #1"], ["https://p1.meituan.net/movie/81992363b0307c7d9948c1b03632af4826121.jpg@128w_170h_1e_1c", "罗多尔·保利", "饰：记者乙 Journalist #2"], ["https://p1.meituan.net/movie/435c0d4732198b3080d4b3ae297f96d144386.jpg@128w_170h_1e_1c", "玛丽安·普莱施泰格", "饰：女侍者 Waitress"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "Diabolo", "饰：菲利普 Philippe"], ["https: