{"movieId": "1284164", "picture": "https://p0.meituan.net/movie/e53491472dbb77ddacaf4cd4457dd544963594.jpg@464w_644h_1e_1c", "name": "一句顶一万句", "name2": "Someone to Talk to", "type": [" 剧情 "], "place": "中国大陆", "length": "110分钟", "time": "2016-11-04中国大陆上映", "description": "牛爱国（毛孩饰演）是县城里的鞋匠，他姐叫牛爱香（刘蓓饰演）。牛爱国要离婚，牛爱香想结婚。牛爱香年轻时谈恋爱受到伤害，直到快40岁才为了找一个能说话的人，和能说会道的厨师宋解放（范伟饰演）结婚，可是婚后却发现俩人也没话说。弟弟牛爱国因为“说得着”和庞丽娜（李倩饰演）结婚，然而经历了10年婚姻后，他们彻底没话说了。牛爱国继而发现老婆出轨婚纱店的蒋老板（喻恩泰饰演），他上演了一系列追踪、捉奸、拖着不离婚的戏码，内心经历了愤怒、冷静到释然的激烈过程。当牛爱国面临崩溃的时候，其他人压根不在意他，甚至是他最亲的战友和姐姐都无法对他的绝望和耻辱感同身受，只是劝他忍了。最后，牛爱国在偶遇的老同学章楚红（孙茜饰演）那里听来一句话：“过日子是过以后，不是过以前。”他仿佛一下子看到了生活的出路。", "director": ["https://p1.meituan.net/moviemachine/03f0bf69fc4e23cfccdbd853f5fc888d28814.jpg@128w_170h_1e_1c", "刘雨霖"], "actors": [["https://p0.meituan.net/movie/06fdcb73123de01f9d509bff2424825136669.jpg@128w_170h_1e_1c", "毛孩", "饰：牛爱国"], ["https://p0.meituan.net/moviemachine/cae84bd9606c558e73a65a051f7ce87f33623.jpg@128w_170h_1e_1c", "李倩", "饰：庞丽娜"], ["https://p0.meituan.net/movie/8d0b31213229b644d019c8cca69dfd0438902.jpg@128w_170h_1e_1c", "刘蓓", "饰：牛爱香"], ["https://p1.meituan.net/moviemachine/534ecb98ceb5b093ff632917df05371b32352.jpg@128w_170h_1e_1c", "范伟", "饰：宋解放"], ["https://p0.meituan.net/movie/06fdcb73123de01f9d509bff2424825136669.jpg@128w_170h_1e_1c", "毛孩", "饰：牛爱国"], ["https://p0.meituan.net/moviemachine/cae84bd9606c558e73a65a051f7ce87f33623.jpg@128w_170h_1e_1c", "李倩", "饰：庞丽娜"], ["https://p0.meituan.net/movie/8d0b31213229b644d019c8cca69dfd0438902.jpg@128w_170h_1e_1c", "刘蓓", "饰：牛爱香"], ["https://p1.meituan.net/moviemachine/534ecb98ceb5b093ff632917df05371b32352.jpg@128w_170h_1e_1c", "范伟", "饰：宋解放"], ["https://p1.meituan.net/movie/6a6826a4701b9ab3f60eacb3b31111ff208695.jpg@128w_170h_1e_1c", "李诺诺", "饰：百慧"], ["https://p1.meituan.net/moviemachine/7f5e4527bc580b451ae2906984d6e4b642609.jpg@128w_170h_1e_1c", "齐溪", "饰：赵欣婷"], ["https://p1.meituan.net/movie/37adf3645a1754834e78a242e9ce018a121641.jpg@128w_170h_1e_1c", "喻恩泰", "饰：蒋九"], ["https://p1.meituan.net/movie/bed15904e3