{"movieId": "65", "picture": "https://p0.meituan.net/movie/ec16f587b7be4e904b83ad33da0275e31237518.jpg@464w_644h_1e_1c", "name": "萤火虫之墓", "name2": "火垂るの墓", "type": [" 剧情 ", " 动画 ", " 战争 "], "place": "日本", "length": "89分钟", "time": "1988-04-16日本上映", "description": "一个衣衫褴褛的少年，气息奄奄地躺在人来人往的车站，正慢慢走向他那14岁短暂生命的终点，这是在战败月余后的日本。空袭开始了，妈妈在轰炸中不幸离世。在突如其来的打击面前，哥哥能做的只是将妈妈死去的消息瞒过年幼的妹妹。在空旷的广场上，哥哥强笑着卖力地为哭着要找妈妈的妹妹表演单杠，夕阳下两个瘦小的身影显得那么的单薄。也许，就是在那一刻，哥哥试图将所有的悲伤扛起，决定在纷乱的废墟上为妹妹擎起一片晴空。兄妹俩只能去投靠亲戚。然而，战争让亲情疏远，物质的贫乏更使人们彼此冷漠。越来越多的白眼和碗中越来越少的米饭暗示着他们必须离开了。哥哥终于决定带着妹妹搬走，去建造一个属于自己的家。但是，在唱着歌快乐离开的时候，他岂能料到因那战争而不可逆转的悲惨命运。为了让妹妹不再饿肚子，哥哥只好趁飞机轰炸之时冒着生命危险去偷。每当在人去楼空的屋子里找到一些食物，他都会无比的兴奋。在漆黑的废弃山洞中，哥哥将萤火虫捉进蚊帐，漫天飞舞的萤火虫在夏季闷热的深夜里明明灭灭。哥哥将熟睡中的妹妹紧紧抱住，生怕一松手就又会失去。", "director": ["https://p1.meituan.net/movie/e41935fbb5bf4fc869242dec053f471744029.jpg@128w_170h_1e_1c", "高畑勋"], "actors": [["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "辰巳努", "饰：Seita"], ["https://p0.meituan.net/movie/5a42c359c38142667f5503016c0493ad45300.jpg@128w_170h_1e_1c", "白石绫乃", "饰：Setsuko"], ["https://p0.meituan.net/movie/2dbdf1ddd2c23eb7c04b2035c63a2b5c27159.jpg@128w_170h_1e_1c", "志乃原良子", "饰：Mother"], ["https://p1.meituan.net/movie/a81ac03c0de3a53eaa21aa9baf7fa06d165757.jpg@128w_170h_1e_1c", "克里斯平·弗里曼", "饰：Additional Voices (voice: English version)"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "辰巳努", "饰：Seita"], ["https://p0.meituan.net/movie/5a42c359c38142667f5503016c0493ad45300.jpg@128w_170h_1e_1c", "白石绫乃", "饰：Setsuko"], ["https://p0.meituan.net/movie/2dbdf1ddd2c23eb7c04b2035c63a2b5c27159.jpg@128w_170h_1e_1c", "志乃原良子", "饰：Mother"], ["https://p1.meituan.net/movie/a81ac03c0de3a53eaa21aa9baf7fa06d165757.jpg@128w_170h_1e_1c", "克里斯平·弗里曼", "饰：Additional Voices (voice: English version)"], ["https://p0.meituan.net/movie/549c84f6d10e3448601d9546fe500ca29209.jpg@128w_170h_1e_1c", "丹·格林", "饰：Additional Voices (voice: English version)"], ["https://p0.meituan.net