{"movieId": "345023", "picture": "https://p1.meituan.net/movie/a0ea0db8a3b9210c269a7750da7273b9750239.jpg@464w_644h_1e_1c", "name": "守法公民", "name2": "Law Abiding Citizen", "type": [" 剧情 ", " 动作 ", " 犯罪 "], "place": "美国", "length": "108分钟", "time": "2009-10-16美国上映", "description": "克莱德·谢尔顿（格莱德·巴特勒 Gerard Butler 饰）是居住在费城某小镇的一名研发人员，他有着美丽的妻子和可爱的女儿，生活幸福美满。但这一切都被突如其来的灾难所摧毁。某晚，两个暴徒闯入他的家中，妻子和女儿都受到残害。然而虽然证据确凿，但由于司法程序的迂腐和尼克·瑞斯（杰米·福克斯 Jamie Foxx 饰）助理执行官的堕落，最终让首犯克拉伦斯·多比（克里斯蒂安·斯多特 Christian Stolte 饰）因证据不足只得到10年徒刑。 　　本以为一切归于沉寂，但10年后当年未了的风波再起。怀着巨大仇恨的克莱德开始筹划展开报复，先是干掉了当年的从犯阿米，接着他很快找到了邪恶无耻的多比，并对其进行残酷的折磨与虐杀。克莱德的仇恨得到巨大的宣泄，但是他的复仇还未就此停止。他所针对的不只是那两个暴徒，而是整个腐朽堕落的司法系统……", "director": ["https://p0.meituan.net/moviemachine/f94c6cbb13d4652987b0c1edcef0f2e6208471.jpg@128w_170h_1e_1c", "F·加里·格雷"], "actors": [["https://p0.meituan.net/moviemachine/96984ba6cdd5db86194d48c7387a36a0178495.jpg@128w_170h_1e_1c", "杰拉德·巴特勒", "饰：克莱德·谢尔顿 Clyde Shelton"], ["https://p1.meituan.net/movie/1ecb45aa40fe07e53dda93e676dde46142321.jpg@128w_170h_1e_1c", "杰米·福克斯", "饰：尼克·赖斯 Nick Rice"], ["https://p1.meituan.net/movie/b93e00bf872807bc5940d7031401945e58829.jpg@128w_170h_1e_1c", "莱丝莉·比伯", "饰：莎拉·洛厄尔 Sarah Lowell"], ["https://p0.meituan.net/movie/0fbfb336b0bc8a9e537bfa9da43265f0238639.jpg@128w_170h_1e_1c", "科尔姆·米尼", "饰：侦探邓尼根 Detective Dunnigan"], ["https://p0.meituan.net/moviemachine/96984ba6cdd5db86194d48c7387a36a0178495.jpg@128w_170h_1e_1c", "杰拉德·巴特勒", "饰：克莱德·谢尔顿 Clyde Shelton"], ["https://p1.meituan.net/movie/1ecb45aa40fe07e53dda93e676dde46142321.jpg@128w_170h_1e_1c", "杰米·福克斯", "饰：尼克·赖斯 Nick Rice"], ["https://p1.meituan.net/movie/b93e00bf872807bc5940d7031401945e58829.jpg@128w_170h_1e_1c", "莱丝莉·比伯", "饰：莎拉·洛厄尔 Sarah Lowell"], ["https://p0.meituan.net/movie/0fbfb336b0bc8a9e537bfa9da43265f0238639.jpg@128w_170h_1e_1c", "科尔姆·米尼", "饰：侦探邓尼根 Detective Dunnigan"], ["https://p0.meituan.net/movie/745d8d871a6f3fbd4984195f32bbbec741049.jpg@128w_170h_1e_1c", "布鲁斯·麦克吉尔", "饰：乔纳斯·坎特雷尔 Jonas Cantrell"], ["https://p0.meituan.net/movie/3a3c7