{"movieId": "248944", "picture": "https://p0.meituan.net/movie/6567c4682965972a9922bdb22324d18358554.jpg@464w_644h_1e_1c", "name": "大鼻子情圣", "name2": "National Theatre Live: Cyrano de Bergerac", "type": [" 剧情 ", " 爱情 "], "place": "英国", "length": "160分钟", "time": "2020-06-23中国大陆上映", "description": "剧作家埃德蒙·罗斯丹（Edmond Rostand）的《大鼻子情圣》是最受欢迎的法国喜剧作品之一。才华横溢的西哈诺有一个丑陋的大鼻子，英俊潇洒的克里斯蒂安却是一个无用的草包，当西哈诺用自己的文采代替克里斯蒂安虏获了罗克珊的芳心，痴心一往的姑娘最终能否意识到自己爱上的究竟是谁？ 凭借《X战警》系列电影和《无耻之徒》剧集蜚声海外的詹姆斯·麦卡沃伊（James McAvoy）重返西区舞台，出人意料地选择了出演《大鼻子情圣》中以丑陋大鼻子著称的西哈诺。作为杰米·劳埃德制作公司星光璀璨的西区演出季的一部分，它与汤姆·希德勒斯顿的《背叛》、“龙妈”的《海鸥》一道，为经典剧作注入了当代活力，揽获了超高的人气和票房。 在此版《大鼻子情圣》中，马丁·克伦普的当代改编对这部英雄喜剧进行了大胆解构：麦卡沃伊饰演的西哈诺一口苏格兰乡音，时而情致绵绵，时而激情饶舌。在动人的辞藻和韵律之中，如此深刻地捕捉到了主人公的悲剧性孤独感。在几乎没有布景的极简舞台上，身着现代服装的多种族演员和残疾演员带来了复杂身体形象，激发人们的想象力和情感共鸣，丰富了原作中爱情与自我的思索和表达。", "director": ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "TonyGrech"], "actors": [["https://p0.meituan.net/movie/3a4991571c0ff87e2cba4feec0e895b655020.jpg@128w_170h_1e_1c", "詹姆斯·麦卡沃伊", "饰：Cyrano de Bergerac"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "EbenFigueiredo", "饰：Christian"], ["https://p0.meituan.net/movie/f1d5f391aead2227457047b9422dc0be20353.jpg@128w_170h_1e_1c", "米歇尔·奥斯丁", "饰：Ragueneau"], ["https://p0.meituan.net/movie/b7ed81b32a77b71ae1c6ea189e34323716242.jpg@128w_170h_1e_1c", "NariBlair-Mangat", "饰：Valvert"], ["https://p0.meituan.net/movie/3a4991571c0ff87e2cba4feec0e895b655020.jpg@128w_170h_1e_1c", "詹姆斯·麦卡沃伊", "饰：Cyrano de Bergerac"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "EbenFigueiredo", "饰：Christian"], ["https://p0.meituan.net/movie/f1d5f391aead2227457047b9422dc0be20353.jpg@128w_170h_1e_1c", "米歇尔·奥斯丁", "饰：Ragueneau"], ["https://p0.meituan.net/movie/b7ed81b32a77b71ae1c6ea189e34323716242.jpg@128w_170h_1e_1c", "NariBlair-Mangat", "饰：Valvert"], ["https://p0.meituan.net/movie/fcbdb744fb96b24ea4c05f99927c74bf8374.jpg@128w_1