{"movieId": "1361794", "picture": "https://p1.meituan.net/movie/a52367d1660d24abe4c9945846616042307622.jpg@464w_644h_1e_1c", "name": "要听神明的话", "name2": "神さまの言うとおり", "type": [" 惊悚 ", " 恐怖 "], "place": "日本", "length": "117分钟", "time": "2014-11-15日本上映", "description": "日本一座普普通通的高中，对生活倍感无聊的16岁男生高畑瞬（福士苍汰 饰）在课堂上打发着枯燥冗长的青春时光。然而就在毫无征兆的情况下，黑板前老师的脑袋竟突然爆开，血光四溅。班上的学生全部呆若木鸡，而伴随惨剧而出的，则是一尊寻常可见的达摩不倒翁端坐在讲台之上。未等学生们回过神来，达摩自顾自玩起了“一二三不许动”的游戏，凡是违反规则行动的人全部遭到血腥屠杀。经过数轮殊死较量，瞬终于在规定时间之前按下了终止游戏的按钮，然而此时他的教室早已血流成河，同学们无一生还。可怕的是血腥游戏并未结束，还没有搞清状况的瞬逃出教室，遇到了隔壁班的青梅竹马秋元依智香（山崎紘菜饰）。两人按照不倒翁的指示来到体育馆，和其他班级的幸存者参加第二轮游戏。随后不久，巨大的招财猫破顶而入，它以压倒性的身形和力量轻松扑杀了眼前穿着老鼠服装的参赛者们，而瞬他们终止游戏的办法只有一个，那就是将猫铃铛从招财猫脖子上的篮球筐内投进去。经历了一系列的挫折和尝试后，招财猫的游戏总算画上句号。与此同时，周身散发着狂暴和死亡气息的另一名幸存者天谷武（神木隆之介饰）登场，这却是一个为了生存不惜对同类大开杀戒的可怕角色。与此同时，日本乃至世界各地都接连发生了类似的离奇事件，在这一连串乱象的背后，似乎有什么常人难以解释的阴谋正有条不紊地进行。大小媒体铺天盖地跟踪报道，幸存的少年也在网络上被奉为“神之子”而受到追捧。两轮游戏过后，瞬和依智香、天谷被吸入神秘的立方体。正如瞬他们所料，神秘的游戏仍在继续，“小芥子”的出现拉开了新一轮屠杀的序幕。在此过程中，瞬凭借冷静的观察力和接触的智慧答对了小芥子们的难题，并从它们手中救出了初中时代的同学高濑翔子（优希美青饰）。而为了取得通往下一关卡的钥匙，幸存的七名少男少女必须携起手来，共同闯过接下来的生死难关……", "director": ["https://p1.meituan.net/movie/8505455e39bfc2dbc56e82302f2fb76345533.jpg@128w_170h_1e_1c", "三池崇史"], "actors": [["https://p1.meituan.net/movie/5a995164858cbc247dc33e89b24e5cbc44413.jpg@128w_170h_1e_1c", "神木隆之介", "饰：天谷武 Amaya Takeru"], ["https://p1.meituan.net/movie/9b2dcceede858718480e75593c95ffce44464.jpg@128w_170h_1e_1c", "染谷将太", "饰：佐竹 Satake"], ["https://p1.meituan.net/movie/a6c2f7a05a0777c29d8ef53d0934154754808.jpg@128w_170h_1e_1c", "前田敦子", "饰：招财猫 Beckoning cat"], ["https://p1.meituan.net/movie/775d2a4cf1e7d26461b1cd4c4115889b43209.jpg@128w_170h_1e_1c", "福士苍汰", "饰：高畑瞬 Shun Takahata"], ["https://p1.meituan.net/movie/5a995164858cbc247dc33e89b24e5cbc44413.jpg@128w_170h_1e_1c", "神木隆之介", "饰：天谷武 Amaya Takeru"], ["https://p1.meituan.net/movie/9b2dcceede858718480e75593c95ffce44464.jpg@128w_170h_1e_1c", "染谷将太", "饰：佐竹 Satake"], ["https://p1.meituan.net/movie/a6c2f7a05a0777c29d8ef53d0934154754808.jpg@128w_170h_1e_1c", "前田敦子", "饰：招财猫 Beckoning cat"], ["https: