{"movieId": "1300709", "picture": "https://p0.meituan.net/movie/0d12bc679f059fa81ac67cee64c80d3e594867.jpg@464w_644h_1e_1c", "name": "赎罪", "name2": "Atonement", "type": [" 剧情 ", " 爱情 ", " 悬疑 ", " 战争 "], "place": "英国,法国", "length": "123分钟", "time": "2008-02-22中国大陆上映", "description": "1935年，宁静悠闲的英国乡村。生活富足且地位显赫的泰丽思一家正在这里躲避着近年来英国少有的酷暑。这天，家里年仅十三岁的小姑娘布里奥妮·泰丽思 （西尔莎·罗南饰）在农庄闲逛时偶然看到了自己不该看到的一切——天气过于炎热，以至塞西莉亚·泰丽思 （凯拉·奈特利饰）脱掉衣服，跳进自家花园的喷泉乘凉。庄园管家的儿子罗比·特纳 （詹姆斯·麦卡沃伊饰）刚刚从剑桥来到庄园。这一香艳景致恰好被罗宾·特纳看到。而二人又曾是同年玩伴，打小便亲密无间。自然爱美之心让特纳惊在原地，寸步不能移动。年幼无知的小姑娘以为高大的罗比要对美丽的姐姐欲行不轨。恰巧在同一天夜里，招风的表姐劳拉·昆西 （ 朱诺·坦普尔 饰）又被人强暴，这一切更让布里奥妮认定罗比就是那个无恶不作的罪犯。事实上，受过良好教育的罗比·特纳早就对性格坚毅的塞西莉亚情有独钟，而塞西莉亚同时对志向远大的小伙子颇为看重。此时的两人已然处在了恋情当中。但小布里奥尼的突然出现加上此次对罗比堪称致命的误会，最终断送了塞西莉亚与罗比青梅竹马的爱情。倒霉的罗比蒙冤入狱。只留下伤心欲绝的塞西莉亚独自一人承受失去爱人的痛苦与内心愧疚的折磨。而贪慕虚荣的表姐劳拉竟然“一蹴而就”地嫁给了那个当年强暴自己的有钱人保罗·马歇尔 （ 本尼迪特·坎贝巴彻 饰）。多年后，残酷的第二次世界大战如同这场致命的误会一般袭击并蹂躏着带给姐姐无尽痛苦的布里奥妮生活和内心。自我救赎成了她此生最大的心愿。然而，无情的战火最终将一对未成眷属的有情人相继吞没。而心结难开的布里奥尼则花费了她毕生的经历将这场致命误会写成情真意切的小说，期待有朝一日能真相大白于天下，还一对有情人清白  。", "director": ["https://p0.meituan.net/movie/eaecdce569c1ed0e09e7e5a5df6fb16143975.jpg@128w_170h_1e_1c", "乔·赖特"], "actors": [["https://p1.meituan.net/movie/8681de5b3a26e25ab358353fe615020751012.jpg@128w_170h_1e_1c", "凯拉·奈特莉", "饰：塞西莉亚 Cecilia Tallis"], ["https://p0.meituan.net/movie/3a4991571c0ff87e2cba4feec0e895b655020.jpg@128w_170h_1e_1c", "詹姆斯·麦卡沃伊", "饰：罗比·特纳 Robbie Turner"], ["https://p1.meituan.net/moviemachine/0eba081cdb7218ac29bc1070c6ae77a4158885.jpg@128w_170h_1e_1c", "西尔莎·罗南", "饰：13岁塔利斯 Briony Tallis, aged 13"], ["https://p1.meituan.net/movie/34eeb0e741b1780b90e74cf9bc2d944b39704.jpg@128w_170h_1e_1c", "本尼迪克特·康伯巴奇", "饰：保罗·马歇尔 Paul Marshall"], ["https://p1.meituan.net/movie/8681de5b3a26e25ab358353fe615020751012.jpg@128w_170h_1e_1c", "凯拉·奈特莉", "饰：塞西莉亚 Cecilia Tallis"], ["https://p0.meituan.net/movie/3a4991571c0ff87e2cba4feec0e895b655020.jpg@128w_170h_1e_1c", "詹姆斯·麦卡沃伊", "饰：罗比·特纳 Robbie Turner"], ["https://p1.meituan.net/moviemachine/0eba081cdb7218ac29bc1070c6ae77a4158885.jpg@128w_170h_1e_1c", "西尔莎·罗