{"movieId": "78646", "picture": "https://p0.meituan.net/movie/89b11a8dceaeb4458e9793acdf7d45bd216801.jpg@464w_644h_1e_1c", "name": "孔子", "name2": "Confucius", "type": [" 剧情 ", " 传记 ", " 历史 ", " 古装 "], "place": "中国大陆,中国香港", "length": "125分钟", "time": "2010-01-22中国大陆上映", "description": "公元前六世纪，孔子（周润发 饰）受到鲁定公（姚鲁 饰）赏识，从中督宰晋升为大司寇，这让他得以实行自己的以礼治国的执政理念。但是，三桓独霸朝纲，也让孔子感受到了重重阻力。他因阻止季桓子（陈建斌 饰）家奴免受陪葬，而与之结怨。他随鲁定公赴齐国会盟，与齐景公（马精武 饰）和大夫黎鉏（王绘春 饰）斗智斗勇，维护了鲁国的利益，讨回三城，因此出任代国相。他提出隳三都的政策，引发佞臣谋反，在平叛之后，季桓子假传圣旨，罢黜了孔子。从此，孔子率颜回（任泉 饰）、子路等弟子开始游历各国。在卫国，孔子得到卫灵公的尊重，获俸粟6万石。他见到了卫灵公的夫人南子（周迅 饰），并在交谈中展现了正气凛然的君子风范…… 本片主题曲《幽兰操》为歌后王菲息声多年后复出之作。", "director": ["https://p1.meituan.net/moviemachine/6f19de4887d52a5a59f835882c71e18f157025.jpg@128w_170h_1e_1c", "胡玫"], "actors": [["https://p0.meituan.net/movie/4bec899956ac27c57686c441515edaa647367.jpg@128w_170h_1e_1c", "周润发", "饰：孔子"], ["https://p1.meituan.net/movie/3e0b7f708a0d2be92adc62d67f9db76d42576.jpg@128w_170h_1e_1c", "周迅", "饰：南子"], ["https://p0.meituan.net/movie/2cd5d02a62ca3f9b006c20851124fad7104530.jpg@128w_170h_1e_1c", "陈建斌", "饰：季桓子"], ["https://p0.meituan.net/moviemachine/1ded859e9e4c2af345c7fb70bdc12cb824962.jpg@128w_170h_1e_1c", "姚橹", "饰：鲁定公"], ["https://p0.meituan.net/movie/4bec899956ac27c57686c441515edaa647367.jpg@128w_170h_1e_1c", "周润发", "饰：孔子"], ["https://p1.meituan.net/movie/3e0b7f708a0d2be92adc62d67f9db76d42576.jpg@128w_170h_1e_1c", "周迅", "饰：南子"], ["https://p0.meituan.net/movie/2cd5d02a62ca3f9b006c20851124fad7104530.jpg@128w_170h_1e_1c", "陈建斌", "饰：季桓子"], ["https://p0.meituan.net/moviemachine/1ded859e9e4c2af345c7fb70bdc12cb824962.jpg@128w_170h_1e_1c", "姚橹", "饰：鲁定公"], ["https://p1.meituan.net/movie/b1376dc43e9e607bdb793c97245825e761297.jpg@128w_170h_1e_1c", "陆毅", "饰：季孙肥"], ["https://p1.meituan.net/movie/23924b1ff9c472324f6a96a839bc0ba892377.jpg@128w_170h_1e_1c", "任泉", "饰：颜回"], ["https://p0.meituan.net/movie/5eabdf028f07d6e42ea452d79b5f3b5737486.jpg@128w_170h_1e_1c", "王斑", "饰：叔孙武"], ["https://p1.meituan.net/movie/ffba9d270ed347fa045ccf51f033c27628400