{"movieId": "78392", "picture": "https://p1.meituan.net/movie/b558d4135320f7f60ec6e9c66895df7f2991499.jpg@464w_644h_1e_1c", "name": "宙斯之子：赫拉克勒斯", "name2": "Hercules", "type": [" 动作 ", " 奇幻 ", " 冒险 "], "place": "美国", "length": "101分钟", "time": "2014-10-21中国大陆上映", "description": "宙斯之子赫拉克勒斯（道恩·强森 饰）自幼饱尝人世间难以想象的苦痛与磨练，他完成了神所安排的十二项试炼，创造了万众敬仰的半神传奇。而事实上大力神赫拉克勒斯不过是在奥托力科斯（卢夫斯·塞维尔 饰）、安菲阿拉俄斯（伊恩·麦柯肖恩 饰）、阿塔兰塔（英格丽德·波尔索·贝达尔 饰）等足以托付生命的勇士的协助下走上了耀眼的神坛。英雄和他的伙伴们以雇佣兵的身份游走各地，似乎从来不关心什么才是正义。某天，大力神受雇于色雷斯国国王科杜斯，协助其训练一支无坚不摧的军队，挫败邪恶巫师瑞索斯的叛乱。但随着战争落下帷幕，大力神却被阴谋拉下神坛，不得不去面对内心最苦痛的回忆以及生命中最后的残酷试炼……", "director": ["https://p0.meituan.net/movie/233785681412ac19fa8eda8c3b5fe64670095.jpg@128w_170h_1e_1c", "布莱特·拉特纳"], "actors": [["https://p1.meituan.net/movie/7e3067d066c1e285b0cc17bfd5f1b34e108474.jpg@128w_170h_1e_1c", "道恩·强森", "饰：宙斯之子赫拉克勒斯 Hercules"], ["https://p0.meituan.net/moviemachine/4409b9c9887dc06d05d6e4fcc200ac99200309.jpg@128w_170h_1e_1c", "伊恩·麦柯肖恩", "饰：安菲阿拉俄斯 Amphiaraus"], ["https://p0.meituan.net/movie/f1c5e48c8ab792104781ce0c12cdb9ec31596.jpg@128w_170h_1e_1c", "卢夫斯·塞维尔", "饰：奥托力克斯 Autolycus"], ["https://p0.meituan.net/movie/2a55577063fe064b465f426ac3ad1be033562.jpg@128w_170h_1e_1c", "约瑟夫·费因斯", "饰：欧律斯透斯国王 King Eurystheus"], ["https://p1.meituan.net/movie/7e3067d066c1e285b0cc17bfd5f1b34e108474.jpg@128w_170h_1e_1c", "道恩·强森", "饰：宙斯之子赫拉克勒斯 Hercules"], ["https://p0.meituan.net/moviemachine/4409b9c9887dc06d05d6e4fcc200ac99200309.jpg@128w_170h_1e_1c", "伊恩·麦柯肖恩", "饰：安菲阿拉俄斯 Amphiaraus"], ["https://p0.meituan.net/movie/f1c5e48c8ab792104781ce0c12cdb9ec31596.jpg@128w_170h_1e_1c", "卢夫斯·塞维尔", "饰：奥托力克斯 Autolycus"], ["https://p0.meituan.net/movie/2a55577063fe064b465f426ac3ad1be033562.jpg@128w_170h_1e_1c", "约瑟夫·费因斯", "饰：欧律斯透斯国王 King Eurystheus"], ["https://p0.meituan.net/movie/1c8a497b03ad3b00c9664aab112c068153895.jpg@128w_170h_1e_1c", "彼得·穆兰", "饰：斯特科 Sitacles"], ["https://p0.meituan.net/movie/7d7543f615cb27d6839d8252f1c03ea712634.jpg@128w_170h_1e_1c", "约翰·赫特", "饰：科提斯国王 Lord Cotys"], ["https://p0.meituan.net/movi