{"movieId": "13816", "picture": "https://p1.meituan.net/movie/b88fe92134056eed2390d3f7009c18792940728.jpg@464w_644h_1e_1c", "name": "音乐家", "name2": "The Composer", "type": [" 剧情 ", " 历史 "], "place": "中国大陆", "length": "112分钟", "time": "2019-05-17中国大陆上映", "description": "二次大战期间，接受特殊使命的中国音乐家（胡军 饰）由纳粹德国兵临城下的莫斯科辗转流落阿拉木图。在举目无亲、贫病交加和对亲人（袁泉 饰妻子）无比的思念中，最终获得哈萨克音乐家拜卡达莫夫（别里克·艾特占诺夫 饰）和姐姐达娜什（阿鲁赞·加佐别可娃饰）母女的救助，度过了短暂而辉煌的生命最后时光。影片创作历时5年，先后2万多人辗转中国、俄罗斯、哈萨克斯坦实地拍摄，4家国际顶级特效团队真实还原战争历史画卷，场面宏大，制作精良，催人泪下，深情表达了中国音乐家在战争逆境中的家国情怀与不屈灵魂。", "director": ["https://p0.meituan.net/moviemachine/65e9e1036f78dc15084ee04354ef3fa044685.jpg@128w_170h_1e_1c", "西尔扎提·亚合甫"], "actors": [["https://p0.meituan.net/movie/51c196529dc89d01e4f8087c0dc7d00e38525.jpg@128w_170h_1e_1c", "胡军", "饰：冼星海"], ["https://p1.meituan.net/movie/3240dd2c8ed6dd2cfb89f48f5f08cfd131444.jpg@128w_170h_1e_1c", "袁泉", "饰：钱韵玲"], ["https://p0.meituan.net/moviemachine/17f7c2a04960a0cf37261fa8669dadb732050.jpg@128w_170h_1e_1c", "别里克·艾特占诺夫", "饰：拜卡达莫夫"], ["https://p0.meituan.net/moviemachine/422b772c56ebe77fa077bf5e7732d5fe39219.jpg@128w_170h_1e_1c", "阿鲁赞·加佐别可娃", "饰：卡丽亚"], ["https://p0.meituan.net/movie/51c196529dc89d01e4f8087c0dc7d00e38525.jpg@128w_170h_1e_1c", "胡军", "饰：冼星海"], ["https://p1.meituan.net/movie/3240dd2c8ed6dd2cfb89f48f5f08cfd131444.jpg@128w_170h_1e_1c", "袁泉", "饰：钱韵玲"], ["https://p0.meituan.net/moviemachine/17f7c2a04960a0cf37261fa8669dadb732050.jpg@128w_170h_1e_1c", "别里克·艾特占诺夫", "饰：拜卡达莫夫"], ["https://p0.meituan.net/moviemachine/422b772c56ebe77fa077bf5e7732d5fe39219.jpg@128w_170h_1e_1c", "阿鲁赞·加佐别可娃", "饰：卡丽亚"], ["https://p0.meituan.net/movie/da6108180139e93fba96238260d58e44173463.jpg@128w_170h_1e_1c", "迪纳茨·努尔赛伊提", "饰：小卡丽娅"], ["https://p0.meituan.net/movie/7fbe93c3a9f2e7f853ff5f3a423b67da26543.jpg@128w_170h_1e_1c", "阿鲁赞·加佐别可娃", "饰：Danash"]]}
