{"movieId": "336934", "picture": "https://p0.meituan.net/movie/b7c7f57b3d366e4553f808402f5d3e731478539.jpg@464w_644h_1e_1c", "name": "夜宴", "name2": "Legend of the Black Scorpion", "type": [" 剧情 ", " 动作 ", " 奇幻 "], "place": "中国大陆,中国香港", "length": "131分钟", "time": "2006-09-15中国大陆上映", "description": "该片讲述了五代十国时期，先帝驾崩，太子巡游在外。皇叔篡位并 自封厉帝执掌朝政。身为当朝太子后母却又是与太子自小青梅竹马的婉后迫于无奈，委身厉帝，并希冀以此保太子周全。但是，刚刚得知 父皇驾崩消息的太子，却在其竹海的伎馆遭遇了一场生死之战。厉帝在诛杀太子的同时也在先皇的宫廷开始了排除异己确立皇权的屠杀。婉后为求自保，在这场政治争夺中成为了厉帝的帮凶，同时对权力的企及也在她心底日益萌生。同时被迫臣服于厉帝却持有异心的还有太守殷太常。殷太常之子殷隼乃是当朝虎将，其女青女更是早已许婚太子。大势所趋之下，识时务的殷太常开始阻止青女与太子的交往，并极力想在新的王朝确立自己的地位。谁料青女痴情于太子，并梦见太子回朝。当太子无鸾出现在婉后面前，婉后抱住少年时的情人，仿若生死两别。但是无鸾一声：“母后”将她残酷的推开。她不再是无鸾少年时习武的陪伴者，她不再是无鸾的后母，此时，她将成为新的皇后，成就新的皇权，并以她昔日的身份和荣耀，助篡位者猖。于是，这本该灭绝的王朝开始了一场新的混乱。", "director": ["https://p1.meituan.net/movie/33a0d96256ef696148c321d2670717e052973.jpg@128w_170h_1e_1c", "冯小刚"], "actors": [["https://p0.meituan.net/moviemachine/606126323efb7af990469242221579f045289.jpg@128w_170h_1e_1c", "吴彦祖", "饰：无鸾"], ["https://p0.meituan.net/moviemachine/415b91df95c3ce02540901b5f67207ee188015.jpg@128w_170h_1e_1c", "章子怡", "饰：婉后"], ["https://p1.meituan.net/moviemachine/cfda0fb23f4415f4ccfe6552d5e2ee0a140241.jpg@128w_170h_1e_1c", "葛优", "饰：厉帝"], ["https://p1.meituan.net/movie/3e0b7f708a0d2be92adc62d67f9db76d42576.jpg@128w_170h_1e_1c", "周迅", "饰：青女"], ["https://p0.meituan.net/moviemachine/606126323efb7af990469242221579f045289.jpg@128w_170h_1e_1c", "吴彦祖", "饰：无鸾"], ["https://p0.meituan.net/moviemachine/415b91df95c3ce02540901b5f67207ee188015.jpg@128w_170h_1e_1c", "章子怡", "饰：婉后"], ["https://p1.meituan.net/moviemachine/cfda0fb23f4415f4ccfe6552d5e2ee0a140241.jpg@128w_170h_1e_1c", "葛优", "饰：厉帝"], ["https://p1.meituan.net/movie/3e0b7f708a0d2be92adc62d67f9db76d42576.jpg@128w_170h_1e_1c", "周迅", "饰：青女"], ["https://p1.meituan.net/movie/7db9a54b44f585fe4fdd28b8f87e963341250.jpg@128w_170h_1e_1c", "马精武", "饰：殷太常"], ["https://p0.meituan.net/movie/3a4d1251405e7cce3072c4daa397bc7943660.jpg@128w_170h_1e_1c", "黄晓明", "饰：殷隼"], ["https://p0.meituan.net