{"movieId": "338503", "picture": "https://p0.meituan.net/movie/730c6a8550002ad5afebb24918893e26295716.jpg@464w_644h_1e_1c", "name": "等着你", "name2": "널 기다리며", "type": [" 惊悚 "], "place": "韩国", "length": "108分钟", "time": "2016-03-10韩国上映", "description": "熙朱（沈恩京 饰）的父亲死在了连环杀人犯基范（金圣武 饰）的屠刀之下，这残酷的一幕被当时只有七岁的熙朱尽收眼底，虽然一晃眼很多年过去，但当时的一幕幕和凶手穷凶极恶的模样依旧时时出现在熙朱的眼前。尽管基范最终受到了法律的制裁被关入了大牢，但这并不足以消解盘踞在熙朱心头的仇恨。 十五年后，基范的刑期已满重获自由，而熙朱也长大成人，开始了她的复仇计划，她决心手刃仇人替父亲报仇。然而，基范天性邪恶狡诈，缺乏经验的熙朱很可能复仇不成，反而成为其手下冤魂。这些年来，刑警大英（尹济文 饰）一直照顾着无依无靠的熙朱，如今，和当年相似的连环杀人案件再度发生，他亦展开了对于凶手的追击。", "director": ["https://p0.meituan.net/movie/24907cfcffe2b45ce4b57769450f071351410.jpg@128w_170h_1e_1c", "毛弘镇"], "actors": [["https://p1.meituan.net/movie/972c2c23c32c04877a95ce4b2c37b9bc47294.jpg@128w_170h_1e_1c", "沈恩京", "饰：Hui-ju"], ["https://p0.meituan.net/movie/3a3c3c052cb344733d5dc059b121b34935858.jpg@128w_170h_1e_1c", "安宰弘", "饰：Detective Cha"], ["https://p0.meituan.net/movie/ff84db2095bbdb6f6b6ecdc927ddc64e112000.jpg@128w_170h_1e_1c", "金圣武", "饰：Gi-beom"], ["https://p0.meituan.net/movie/df645df3539325eeaf434ba6fb06e8f438048.jpg@128w_170h_1e_1c", "尹宰文", "饰：Dae-yeong"], ["https://p1.meituan.net/movie/972c2c23c32c04877a95ce4b2c37b9bc47294.jpg@128w_170h_1e_1c", "沈恩京", "饰：Hui-ju"], ["https://p0.meituan.net/movie/3a3c3c052cb344733d5dc059b121b34935858.jpg@128w_170h_1e_1c", "安宰弘", "饰：Detective Cha"], ["https://p0.meituan.net/movie/ff84db2095bbdb6f6b6ecdc927ddc64e112000.jpg@128w_170h_1e_1c", "金圣武", "饰：Gi-beom"], ["https://p0.meituan.net/movie/df645df3539325eeaf434ba6fb06e8f438048.jpg@128w_170h_1e_1c", "尹宰文", "饰：Dae-yeong"], ["https://p0.meituan.net/movie/ff3fbfe8f3ad065b5b80c8c9329635c531222.jpg@128w_170h_1e_1c", "金元海", "饰：Section chief"], ["https://p0.meituan.net/movie/437b176c0a69abd78fd6e4e2cd443e566637.jpg@128w_170h_1e_1c", "郑海钧", null], ["https://p1.meituan.net/movie/a3e6f2a766fc20521defc1a8233e1a1c16327.jpg@128w_170h_1e_1c", "成泓日", "饰：Strong squad 2nd team chief"], ["https://p0.meituan.net/movie/ebaa04a89712f3555d5ed0ced544bf7921901.jp